ru na zadní část zařízení, aby nedošlo k její ztrátě. &lt;strong&gt;Součástí každého C906 je také zajímavý a cenný software:&lt;/strong&gt; Přenosná úložiště ADATA jsou známá nejen pro jejich vysokou kvalitu, pozoruhodný výkon a inovativní design, ale poskytují také velmi cenný software. - Nástroj &lt;strong&gt;OStoGO&lt;/strong&gt; vám pomůže převést vaše instalační DVD systému Microsoft Windows 7 do přenosného úložného zařízení a umožní vám tak pohodlně a rychle nainstalovat Windows 7 díky bootování z USB bez nutnosti použití optické jednotky. - Mocný nástroj &lt;strong&gt;UFDtoGo&lt;/strong&gt; synchronizuje data, e-maily a vaše oblíbené položky a poskytuje vám opravdovou mobilitu. - Norton Internet Security 2011 (60-denní zkušební verze) chrání vaše data před viry a jinými škodlivými procesy. Registrací vašeho produktu ADATA online získáte tuto ochranu zdarma. *Software zdarma ke stažení a registrace produktů jsou k dispozici pouze pro produkty ADATA s natištěnou ochrannou známkou 'Software Download'. &lt;strong&gt;Specifikace:&lt;/strong&gt; - Rozměry: 58 x 17,6 x 10,4 mm (D x Š x H) - Hmotnost: 9 g - Rozhraní: USB 2.0, zpětně kompatibilní s USB 1.1 - Systémové požadavky: Windows 98/98SE/ME/2000/XP/Vista™/7 nebo vyšší, Mac OS 9.0 nebo vyšší, Linux™ jádro 2.4 nebo vyšší&lt;/p&gt;  &lt;p&gt;Od 1. ledna 2019 se záruční doba pro model C906 mění na 5 let; pro modely C906 zakoupené před 31. prosincem 2018 (včetně) se záruční doba nemění.&lt;/p&gt;","false","0","0001013300070003","8609","136","true","","-1","-1","true","60","Měsíc(ů)","","0001-01-01T00:00:00","62.00","KS","99","5","2011-03-29T10:40:41.92","ADT","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_306\/306863_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_306\/306863_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_306\/306863_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_306\/306863_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_306\/306863_0e_3.jpg'}","{'0':{'AttributeCode':'8',