ním v černé a bílé barvě vystihuje podstatu moderního designu a vyjadřuje minimalistický styl s nádechem urbanismu. Představuje tak nejen praktické úložné zařízení, ale zároveň i módní doplněk, který vypovídá o vašem individuálním stylu. &lt;strong&gt;Elegantní design&lt;/strong&gt; C906 je velmi kompaktní USB paměťové zařízení, které umožňuje snadnou přenositelnost všech vašich dat. Váží jen 9 gramů a je pouhých 5,8 cm dlouhý. C906 má zaoblené hrany a lesklý povrchem, který mu dává jeho okouzlující vzhled. ADATA C906 má praktické provedení s možností zacvaknout krytku konektoru na zadní část zařízení, aby nedošlo k její ztrátě. &lt;strong&gt;Součástí každého C906 je také zajímavý a cenný software:&lt;/strong&gt; Přenosná úložiště ADATA jsou známá nejen pro jejich vysokou kvalitu, pozoruhodný výkon a inovativní design, ale poskytují také velmi cenný software. - Nástroj &lt;strong&gt;OStoGO&lt;/strong&gt; vám pomůže převést vaše instalační DVD systému Microsoft Windows 7 do přenosného úložného zařízení a umožní vám tak pohodlně a rychle nainstalovat Windows 7 díky bootování z USB bez nutnosti použití optické jednotky. - Mocný nástroj &lt;strong&gt;UFDtoGo&lt;/strong&gt; synchronizuje data, e-maily a vaše oblíbené položky a poskytuje vám opravdovou mobilitu. - Norton Internet Security 2011 (60-denní zkušební verze) chrání vaše data před viry a jinými škodlivými procesy. Registrací vašeho produktu ADATA online získáte tuto ochranu zdarma. *Software zdarma ke stažení a registrace produktů jsou k dispozici pouze pro produkty ADATA s natištěnou ochrannou známkou 'Software Download'. &lt;strong&gt;Specifikace:&lt;/strong&gt; - Rozměry: 58 x 17,6 x 10,4 mm (D x Š x H) - Hmotnost: 9 g - Rozhraní: USB 2.0, zpětně kompatibilní s USB 1.1 - Systémové požadavky: Windows 98/98SE/ME/2000/XP/Vista™/7 nebo vyšší, Mac OS 9.0 nebo vyšší, Linux™ jádro 2.4 nebo vyšší&lt;/p&gt;  &lt;p&gt;Od 1. ledna 2019 se záruční doba pro model C906 mění na 5 let; pro modely C906 zakoupené před 31. prosincem 2018 (včetně) se záruční doba nemění.&lt;/p&gt;","false","0","0001013300070003","8609","16","true","","-1","-1","true","60","Měsíc(ů)","","0001-01-01T00:00:00","59.00","KS","6.00","2","2012-07-16T14:29:24.747","ADT","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_392\/392559_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_392\/392559_0b_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8692'},'1':{'AttributeCode':'896','ValueCode':'11008'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.017','length':'11.5','width':'10.3','height':'0.5'},'1':{'typ':'PACK','count':'10','weight':'0.18','length':'12','width':'10.5','height':'6'},'2':{'typ':'PACK','count':'200','weight':'4.57','length':'36','width':'24','height':'29'}}","N","","false",""),("406609","1034789","ADATA Flash Disk 64GB C008, USB 2.0 Classic, černá","71.50","163.00","ADT","1.50","90.00","0.000000","0.000","60 Měsíc(ů)","A-DATA","72.00","75.00","21.00","AC008-64G-RKD","false","0,00","","A-Data","85235110","4713435791721","ADATA Flash Disk 64GB C008, USB 2.0 Classic, černá","ADATA Flash Disk 64GB USB 2.0 Classic C008, černý","1","&lt;p&gt;Elegantní USB flash disk s výsuvným USB konektorem, který hladce vysunete z disku palcem. Provedení bez krytky eliminuje nepříjemné potíže se ztracenou krytkou. USB konektor lze rychle a pohodlně připravit k použití jen jednou rukou. &lt;strong&gt;Elegantní provedení bez krytky konektoru&lt;/strong&gt; USB konektor je ukryt v kompaktním těle, kde je plně chráněn bez nutnosti používat krytku. Jednoduchým pohybem palce vpřed je flash disk ihned připraven k použití a zpětným pohybem zase rychle schováte konektor pro potřeby skladování nebo cestování. &lt;strong&gt;Váš osobní styl&lt;/strong&gt; C008 je navržen s otvorem na poutko, takže jej snadno připojíte ke klíčům nebo k mobilnímu telefonu. * řemínek není součástí výrobku. &lt;strong&gt;Půvabný a minimalistický design&lt;/strong&gt; Matně texturované tělo je odolné proti poškrábání a zároveň odpuzuje špínu. C