"179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_518\/518170_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_518\/518170_0b_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8768'},'1':{'AttributeCode':'896','ValueCode':'11010'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.017','length':'11.5','width':'10','height':'1'},'1':{'typ':'PACK','count':'10','weight':'0.185','length':'5.5','width':'10.5','height':'11.5'}}","N","","false",""),("524574","325543","TRANSCEND Flash Disk 32GB JetFlash®880S, USB 3.0/micro USB (R:90/W:20 MB/s) stříbrná","234.50","284.00","TRN","1.50","48.00","0.000000","0.000","5 Rok(ů)","TRANSCEND","247.00","295.00","21.00","TS32GJF880S","false","0,00","","Transcend","85235110","760557831402","TRANSCEND Flash Disk 32GB JetFlash®880S, USB 3.0/micro USB (R:90/W:20 MB/s) stříbrná","Kapacita uložiště:32 GB; Verze USB:3.0","1","&lt;p&gt;&lt;a href='http://uk.transcend-info.com/Products/No-691'&gt;http://uk.transcend-info.com/Products/No-691&lt;/a&gt; &lt;p&gt;Na cestách môžete jednoducho prenášať súbory do mobilného zariadenia a z neho. Transcend JetFlash 880 USB 3.0 Flash disk OTG je navrhnutý tak, aby zmenil spôsob prenášania a výmeny osobných digitálnych médií. USB 3 v plnej veľkosti.0 ponúka ešte vyššie prenosové rýchlosti na zvýšenie efektivity. &lt;br/&gt;Okrem toho môžete pomocou bezplatne stiahnuteľnej aplikácie Transcend Elite App jednoducho preskúmať súbory na zariadení JetFlash 880 a rýchlo zálohovať všetky svoje cenné súbory uložené v smartfóne alebo tablete. &lt;h3&gt;Duálny prístup USB: USB 3.0 + micro USB&lt;/h3&gt; &lt;p&gt;Na jednej strane zariadenia JetFlash 880 sa nachádza plnohodnotné rozhranie SuperSpeed USB 3.0 možno pripojiť k ľubovoľnému zariadeniu vybavenému portom USB, ktoré poskytuje desaťnásobnú šírku pásma oproti USB 2.0. Na druhej strane je rozhranie micro USB, ktoré umožňuje pripojenie k mobilným zariadeniam. &lt;h3&gt;Ľahší a menší kovový dizajn&lt;/h3&gt; &lt;p&gt;JetFlash 880 je vyrobený v ergonomickom dizajne s kvalitným kovom pri oveľa menších rozmeroch a nižšej hmotnosti. Hoci má JetFlash 880 malú veľkosť, ponúka sa v kapacitách až do 64 GB na jednoduché zálohovanie alebo prenos súborov. &lt;h3&gt;Odolnosť voči vode a prachu&lt;/h3&gt; &lt;p&gt;Použitie inovatívnej technológie COB (Chip on Board) zaručuje, že JetFlash 880 je úplne odolný voči prachu a vode, čím sa dostáva na ďalšiu úroveň odolnosti. &lt;h3&gt;Exkluzívna aplikácia Transcend Elite&lt;/h3&gt; &lt;p&gt;Vďaka funkciám správy súborov, šifrovania súborov a zálohovania jedným dotykom vám aplikácia Transcend Elite App umožňuje jednoducho preskúmať súbory na vloženej pamäťovej karte alebo USB flash disku, prenášať súbory pomocou 256-bitového šifrovania AES, zdieľať súbory s rôznymi službami cloudového úložiska a rýchlo zálohovať fotografie, videá, dokumenty a ďalší dôležitý obsah uložený v zariadení so systémom Android. &lt;p&gt;&lt;strong&gt;Špecifikácie:&lt;/strong&gt; &lt;table class='table table-responsive' style='width: 100%;' border='0' cellspacing='0' cellpadding='0'&gt; &lt;tbody&gt; &lt;tr class='spec_tr'&gt;&lt;th width='25%'&gt;Veľkosť&lt;/th&gt; &lt;td width='75%'&gt;26.8 mm X 12.2 mm X 7.55 mm (1.06' x 0.48' x 0.30')&lt;/td&gt; &lt;/tr&gt; &lt;tr class='spec_tr'&gt;&lt;th width='25%'&gt;Hmotnosť&lt;/th&gt; &lt;td width='75%'&gt;3g (0.11 oz)&lt;/td&gt; &lt;/tr&gt; &lt;tr class='spec_tr'&gt;&lt;th width='25%'&gt;Rozhranie&lt;/th&gt; &lt;td width='75%'&gt;USB 3.0 (Standard A/Micro B), spätne kompatibilný s USB 2.0&lt;/td&gt; &lt;/tr&gt; &lt;tr class='spec_tr'&gt;&lt;th width='25%'&gt;Certifikáty&lt;/th&gt; &lt;td width='75%'&gt;CE, FCC, BSMI&lt;/td&gt; &lt;/tr&gt; &lt;tr class='spec_tr'&gt;&lt;th width='25%'&gt;*Poznámka&lt;/th&gt; &lt;td width='75%'&gt;Oba konektory USB sa nemôžu používať súčasne.&lt;/td&gt; &lt;/tr&gt; &lt;tr class='spec_tr'&gt;&lt;th width='25%'&gt;Systémové požiadavky&lt;/th&gt; &lt;td width='75%'&gt;Stolný počítač alebo notebook s portom USB (USB 3.0 port potrebný pre USB3.0 výkon) a jeden z nasledujúcich operačných systémov &lt;ul&gt; &lt;li&gt;Microsoft Windows 7&lt;/li&gt; &lt;li&gt;Microsoft Windows 8&lt;/li&gt; &lt;li&gt;Microsoft Windows 8.1&lt;/li&gt; &lt;li&gt;Mac OS 10.5 alebo neskôr&lt;/li&gt; &lt;li&gt;Jadro Linuxu 2.6.31 alebo neskôr&lt;/li&gt; &lt;/ul&gt;tablet alebo mobilný telefón s konektorom micro B USB a podporou funkcie hostiteľa USB OTG.&lt;br/&gt;Požiadavky na zariadenie na spustenie aplikácie Transcend Elite:&lt;br/&gt;Zariadenie so systémom Android 4.0+ alebo novšie.&lt;/td&gt; &lt;/tr&gt; &lt;/tbody&gt; &lt;/table&gt;https://www.youtube.com/watch?x-yt-cl=84359240&amp;v=ln3ZoyQwox0&amp;x-yt-ts=1421782837.","false","0","0001025800020018","9762","-1","true","","-1","-1","true","5","Rok(ů)","","0001-01-01T00:00:00","247.00","KS","0.00","10","2015-01-21T09:56:25.757","TRN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_524\/524574_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_524\/524574_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_524\/524574_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_524\/524574_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_524\/524574_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_524\/524574_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_524\/524574_0g_3.jpg','7':'https:\/\/c.edsystem.cz\/IMGCACHE\/_524\/524574_0h_3.jpg','8':'https:\/\/c.edsystem.cz\/IMGCACHE\/_524\/524574_0i_3.jpg','9':'https:\/\/c.edsystem.cz\/IMGCACHE\/_524\/524574_0j_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8692'},'1':{'AttributeCode':'896','ValueCode':'11009'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.01','length':'0.7','width':'13','height':'10'},'1':{'typ':'PACK','count':'25','weight':'0.32','length':'13','width':'10','height':'11'}}","N","","false",""),("526030","325546","TRANSCEND Flash Disk 128GB JetFlash®700, USB 3.0 (R:90/W:40 MB/s) černá","170.50","262.00","TRN","1.50","90.00","0.000000","0.000","5 Rok(ů)","TRANSCEND","180.00","215.00","21.00","TS128GJF700","fa