 s USB 2.0) &lt;p dir='ltr' align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td valign='middle' width='38%'&gt; &lt;p dir='ltr' align='left'&gt;Certifikáty &lt;p dir='ltr' align='left'&gt;  &lt;/td&gt; &lt;td valign='middle' width='63%'&gt; &lt;p dir='ltr' align='left'&gt;CE, FCC, BSMI &lt;p dir='ltr' align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td valign='middle' width='38%'&gt; &lt;p dir='ltr' align='left'&gt;*Poznámka &lt;p dir='ltr' align='left'&gt;  &lt;/td&gt; &lt;td valign='middle' width='63%'&gt; &lt;p dir='ltr' align='left'&gt;Rýchlosť sa môže líšiť v závislosti od hardvéru, softvéru a používania hostiteľa. &lt;p dir='ltr' align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;/tbody&gt; &lt;/table&gt;.","false","0","0001025800020018","9762","-1","true","","-1","-1","true","5","Rok(ů)","","0001-01-01T00:00:00","424.00","KS","5.00","5","2015-02-03T12:27:47.94","TRN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_526\/526031_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_526\/526031_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_526\/526031_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_526\/526031_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_526\/526031_0e_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8768'},'1':{'AttributeCode':'896','ValueCode':'11009'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.021','length':'13','width':'10.5','height':'0.8'},'1':{'typ':'PACK','count':'25','weight':'0.539','length':'14','width':'11','height':'14.5'}}","N","","false",""),("543647","325570","TRANSCEND Flash Disk 32GB JetFlash®890S OTG, USB 3.1 Type-C/A (R:90/W:30 MB/s) stříbrná","252.50","302.00","TRN","1.50","48.00","0.000000","0.000","5 Rok(ů)","TRANSCEND","265.00","318.00","21.00","TS32GJF890S","false","0,00","","Transcend","85235110","760557833529","TRANSCEND Flash Disk 32GB JetFlash®890S OTG, USB 3.1 Type-C/A (R:90/W:30 MB/s) stříbrná","Kapacita uložiště:32 GB; Verze USB:3.1","1","&lt;p&gt;&lt;em&gt;&lt;strong&gt;http://uk.transcend-info.com/Products/No-707&lt;/strong&gt;&lt;/em&gt; &lt;p&gt;&lt;br/&gt;JetFlash 890 USB 3.0 spĺňa novú generáciu technológie USB typu C.1 Flash disk OTG má dvojitý konektor - obojstranný konektor USB typu C a bežný konektor USB 3.1 (Gen 1)* - ktorý je určený na prenos a zálohovanie fotografií, hudby a videí medzi najnovšími zariadeniami vybavenými portom USB typu C, ako je MacBook, a počítačmi PC, notebookmi a Mac. Pomocou bezplatne stiahnuteľnej aplikácie Transcend Elite App môžete navyše jednoducho preskúmať súbory na zariadení JetFlash 890 a rýchlo zálohovať všetky svoje cenné súbory uložené v MacBooku, smartfóne a tablete.&lt;br/&gt;Dva konektory USB, dvojnásobné pohodlie&lt;br/&gt;Vďaka technológii USB OTG (On-The-Go) kombinuje JetFlash 890 bežný konektor USB 3.1 (Gen 1) a konektorom USB typu C do USB flash disku, čo vám zabezpečí lepšiu prenosnosť pri prenášaní vzácnych fotografií, hudby, videí a akýchkoľvek iných digitálnych súborov medzi tabletmi, smartfónmi, počítačmi Mac, PC a notebookmi. &lt;br/&gt;&lt;span style='font-size: small;'&gt;&lt;strong&gt;V oboch prípadoch je pripojený pomocou USB typu C&lt;/strong&gt;&lt;/span&gt;&lt;br/&gt;Pripojiť správnu stranu k portu USB by mohlo byť naozaj náročné, ale teraz to už neplatí. Vďaka obojstrannej konštrukcii ušetrí konektor USB typu C zariadenia JetFlash 890 nielen námahu pri dvoj- či trojnásobnom skúšaní pred skutočným pripojením k portu USB, ale aj váš čas pri prenose dát vďaka jednorazovému pripojeniu.&lt;br/&gt;&lt;span style='font-size: small;'&gt;&lt;strong&gt;Bezkonkurenčné prenosové rýchlosti&lt;/strong&gt;&lt;/span&gt;&lt;br/&gt;Vďaka konštrukcii pripojenia USB sa nemusíte obávať pripojenia k internetu cez Wi-Fi, Bluetooth a 3G/4G. Vybavený rozhraním SuperSpeed USB 3.1 (Gen 1), JetFlash 890 dosahuje neuveriteľnú prenosovú rýchlosť až 90 MB/s, čo predstavuje maximálne 4-násobne vyššiu rýchlosť ako USB 2.0 rozhranie. &lt;br/&gt;&lt;span style='font-size: small;'&gt;&lt;strong&gt;Získajte extra priestor s kapacitou až 64 GB&lt;/strong&gt;&lt;/span&gt;&lt;br/&gt;Vďaka kapacite až 64 GB a portu USB OTG typu C môžete bez problémov rozšíriť úložnú kapacitu svojich mobilných zariadení. správa 'Pamäť plná' vám už nebude kaziť dôležité chvíle.&lt;br/&gt;&lt;span style='font-size: small;'&gt;&lt;strong&gt;Skvelá zábava s plnohodnotným USB&lt;/strong&gt;&lt;/span&gt;&lt;br/&gt;Štandardné rozhranie USB umožňuje jednoduchý prenos súborov do všetkých bežných zariadení vybavených portom USB vrátane stolových počítačov, ultrabookov, notebookov, televízorov, prehrávačov Blu-ray, prehrávačov DVD, stereosystémov a herných konzol.&lt;br/&gt;&lt;span style='font-size: small;'&gt;&lt;strong&gt;Odolnosť voči vode a prachu&lt;/strong&gt;&lt;/span&gt;&lt;br/&gt;Keďže je vyrobený technikou COB (Chip On Board) a zostavený s kovovým krytom, JetFlash 890 je úplne odolný voči prachu a vode, ale zároveň mimoriadne ľahký.&lt;br/&gt;&lt;span style='font-size: small;'&gt;&lt;strong&gt;Bez straty údajov s jednoduchým koncovým uzáverom&lt;/strong&gt;&lt;/span&gt;&lt;br/&gt;Krytka je navrhnutá tak, aby pasovala na oba konce blesku JetFlash 890. Keď je jeden konektor obsadený, môžete na druhej strane konektora USB nasadiť krytku, pričom dbajte na to, aby bola krytka vždy na zariadení JetFlash 890 a chránila tak konektory USB aj údaje. &lt;br/&gt;&lt;span style='font-size: small;'&gt;&lt;strong&gt;Exkluzívna aplikácia Transcend Elite pre Mac OS X a Android&lt;/strong&gt;&lt;/span&gt;&lt;br/&gt;Aplikácia Transcend's Elite App, špeciálne navrhnutá pre operačné systémy Mac OS X a Android, obsahuje funkcie správy súborov, šifrovania súborov a zálohovania jedným dotykom (len pre Android), ktoré vám umožňujú jednoducho preskúmať súbory na vašom mobilnom zariadení. Medzitým môžete prenášať súbory pomocou 256-bitového šifrovania AES, zdieľať súbory s rôznymi službami cloudového úložiska a rýchlo zálohovať fotografie, videá, dokumenty a ďalší dôležitý obsah uložený v zariadení. &lt;p&gt;&lt;span style='font-size: small;'&gt;&lt;strong&gt;Špecifikácie&lt;/strong&gt;&lt;/span&gt; &lt;table style='width: 895px;' dir='ltr' border='0' cellspacing='0' cellpadding='2'&gt; &lt;tbody&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;p align='center'&gt;&lt;strong&gt;Rozmery&lt;/strong&gt; &lt;p align='center'&gt;  &lt;p align='center'&gt;  &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;28.6 mm x 14.3 mm x 8.6 mm (1.13 x 0.56 x 0.34 palcov) &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;p align='center'&gt;&lt;strong&gt;Hmotnosť&lt;/strong&gt; &lt;p align='center'&gt;  &lt;p align='center'&gt;  &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;3g (0.11oz) &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;p align='center'&gt;&lt;strong&gt;Rozhranie pripojenia&lt;/strong&gt; &lt;p align='center'&gt;  &lt;p align='center'&gt;  &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;USB typu C a USB 3.1 konektory typu A 1. generácie &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;(spätne kompatibilný s USB 3.0 / 2.0) &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;p align='center'&gt;&lt;strong&gt;Certifikáty&lt;/strong&gt; &lt;p align='center'&gt;  &lt;p align='center'&gt;  &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;CE, FCC, BSMI &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;p align='center'&gt;&lt;strong&gt;*Poznámka&lt;/strong&gt; &lt;p align='center'&gt;  &lt;p align='center'&gt;  &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;Oba konektory USB sa nemôžu používať súčasne. &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;p align='center'&gt;&lt;strong&gt;Systémové požiadavky&lt;/strong&gt; &lt;p align='center'&gt;  &lt;p align='center'&gt;  &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;Stolný alebo prenosný počítač s portom USB a jedným z nasledujúcich operačných systémov: &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;Microsoft Windows XP &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;Microsoft Windows Vista &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;Microsoft Windows 7 &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;Microsoft Windows 8 &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;Microsoft Windows 8.1 &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;Microsoft Windows 10 &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;MAC OS 9.0 alebo neskôr &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;Jadro Linuxu 2.4.2 alebo neskôr &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;Tablet alebo mobilný telefón s konektorom USB typu C a podporou funkcie hostiteľa USB OTG &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='16'&gt; &lt;/td&gt; &lt;td width='77%' height='16'&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;Požiadavky na zariadenie na spustenie aplikácie Transcend Elite: &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;Zariadenie so systémom Android 4.0+ &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;/tbody&gt; &lt;/table&gt;.","false","0","0001025800020028","10758","-1","true","","-1","-1","true","5","Rok(ů)","","0001-01-01T00:00:00","265.00","KS","0.00","8","2015-08-20T10:52:09.663","TRN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_543\/543647_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_543\/543647_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_543\/543647_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_543\/543647_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_543\/543647_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_543\/543647_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_543\/543647_0g_3.jpg','7':'https:\/\/c.edsystem.cz\/IMGCACHE\/_543\/543647_0h_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8692'},'1':{'AttributeCode':'896','ValueCode':'11010'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.013','length':'13','width':'10','height':'1'}}","N","","false",""),("543648","325571","TRANSCEND Flash Disk 64GB JetFlash®890S OTG, USB 3.1 Type-C/A (R:90/W:30 MB/s) stříbrná","326.50","418.00","TRN","1.50","90.00","0.000000","0.000","5 Rok(ů)","TRANSCEND","343.00","411.00","21.00","TS64GJF890S","false","0,00","","Transcend","85235110","760557833536","TRANSCEND Flash Disk 64GB JetFlash®890S OTG, USB 3.1 Type-C/A (R:90/W:30 MB/s) stříbrná","Kapacita uložiště:64 GB; Verze USB:3.1","1","&lt;p&gt;&lt;em&gt;&lt;strong&gt;http://uk.transcend-info.com/Products/No-707&lt;/strong&gt;&lt;/em&gt; &lt;p&gt;&lt;br/&gt;JetFlash 890 USB 3.0 spĺňa novú generáciu technológie USB typu C.1 Flash disk OTG má dvojitý konektor - obojstranný konektor USB typu C a bežný konektor USB 3.1 (Gen 1)* - ktorý je určený na prenos a zálohovanie fotografií, hudby a videí medzi najnovšími zariadeniami vybavenými portom USB typu C, ako je MacBook, a počítačmi PC, notebookmi a Mac. Pomocou bezplatne stiahnuteľnej aplikácie Transcend Elite App môžete navyše jednoducho preskúmať súbory na zariadení JetFlash 890 a rýchlo zálohovať všetky svoje cenné súbory uložené v MacBooku, smartfóne a tablete.&lt;br/&gt;Dva konektory USB, dvojnásobné pohodlie&lt;br/&gt;Vďaka technológii USB OTG (On-The-Go) kombinuje JetFlash 890 bežný konektor USB 3.1 (Gen 1) a konektorom USB typu C do USB flash disku, čo vám zabezpečí lepšiu prenosnosť pri prenášaní vzácnych fotografií, hudby, videí a akýchkoľvek iných digitálnych súborov medzi tabletmi, smartfónmi, počítačmi Mac, PC a notebookmi. &lt;br/&gt;&lt;span style='font-size: small;'&gt;&lt;strong&gt;V oboch prípadoch je pripojený pomocou USB typu C&lt;/strong&gt;&lt;/span&gt;&lt;br/&gt;Pripojiť správnu stranu k portu USB by mohlo byť naozaj náročné, ale teraz to už neplatí. Vďaka obojstrannej konštrukcii ušetrí konektor USB typu C zariadenia JetFlash 890 nielen námahu pri dvoj- či trojnásobnom skúšaní pred skutočným pripojením k portu USB, ale aj váš čas pri prenose dát vďaka jednorazovému pripojeniu.&lt;br/&gt;&lt;span style='font-size: small;'&gt;&lt;strong&gt;Bezkonkurenčné prenosové rýchlosti&lt;/strong&gt;&lt;/span&gt;&lt;br/&gt;Vďaka konštrukcii pripojenia USB sa nemusíte obávať pripojenia k internetu cez Wi-Fi, Bluetooth a 3G/4G. Vybavený rozhraním SuperSpeed USB 3.1 (Gen 1), JetFlash 890 dosahuje neuveriteľnú prenosovú rýchlosť až 90 MB/s, čo predstavuje maximálne 4-násobne vyššiu rýchlosť ako USB 2.0 rozhranie. &lt;br/&gt;&lt;span style='font-size: small;'&gt;&lt;strong&gt;Získajte extra priestor s kapacitou až 64 GB&lt;/strong&gt;&lt;/span&gt;&lt;br/&gt;Vďaka kapacite až 64 GB a portu USB OTG typu C môžete bez problémov rozšíriť úložnú kapacitu svojich mobilných zariadení. správa 'Pamäť plná' vám už nebude kaziť dôležité chvíle.&lt;br/&gt;&lt;span style='font-size: small;'&gt;&lt;strong&gt;Skvelá zábava s plnohodnotným USB&lt;/strong&gt;&lt;/span&gt;&lt;br/&gt;Štandardné rozhranie USB umožňuje jednoduchý prenos súborov do všetkých bežných zariadení vybavených portom USB vrátane stolových počítačov, ultrabookov, notebookov, televízorov, prehrávačov Blu-ray, prehrávačov DVD, stereosystémov a herných konzol.&lt;br/&gt;&lt;span style='font-size: small;'&gt;&lt;strong&gt;Odolnosť voči vode a prachu&lt;/strong&gt;&lt;/span&gt;&lt;br/&gt;Keďže je vyrobený technikou COB (Chip On Board) a zostavený s kovovým krytom, JetFlash 890 je úplne odolný voči prachu a vode, ale zároveň mimoriadne ľahký.&lt;br/&gt;&lt;span style='font-size: small;'&gt;&lt;strong&gt;Bez straty údajov s jednoduchým koncovým uzáverom&lt;/strong&gt;&lt;/span&gt;&lt;br/&gt;Krytka je navrhnutá tak, aby pasovala na oba konce blesku JetFlash 890. Keď je jeden konektor obsadený, môžete na druhej strane konektora USB nasadiť krytku, pričom dbajte na to, aby bola krytka vždy na zariadení JetFlash 890 a chránila tak konektory USB aj údaje. &lt;br/&gt;&lt;span style='font-size: small;'&gt;&lt;strong&gt;Exkluzívna aplikácia Transcend Elite pre Mac OS X a Android&lt;/strong&gt;&lt;/span&gt;&lt;br/&gt;Aplikácia Transcend's Elite App, špeciálne navrhnutá pre operačné systémy Mac OS X a Android, obsahuje funkcie správy súborov, šifrovania súborov a zálohovania jedným dotykom (len pre Android), ktoré vám umožňujú jednoducho preskúmať súbory na vašom mobilnom zariadení. Medzitým môžete prenášať súbory pomocou 256-bitového šifrovania AES, zdieľať súbory s rôznymi službami cloudového úložiska a rýchlo zálohovať fotografie, videá, dokumenty a ďalší dôležitý obsah uložený v zariadení. &lt;p&gt;&lt;span style='font-size: small;'&gt;&lt;strong&gt;Špecifikácie&lt;/strong&gt;&lt;/span&gt; &lt;table style='width: 895px;' dir='ltr' border='0' cellspacing='0' cellpadding='2'&gt; &lt;tbody&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;p align='center'&gt;&lt;strong&gt;Rozmery&lt;/strong&gt; &lt;p align='center'&gt;  &lt;p align='center'&gt;  &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;28.6 mm x 14.3 mm x 8.6 mm (1.13 x 0.56 x 0.34 palcov) &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;p align='center'&gt;&lt;strong&gt;Hmotnosť&lt;/strong&gt; &lt;p align='center'&gt;  &lt;p align='center'&gt;  &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;3g (0.11oz) &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;p align='center'&gt;&lt;strong&gt;Rozhranie pripojenia&lt;/strong&gt; &lt;p align='center'&gt;  &lt;p align='center'&gt;  &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;USB typu C a USB 3.1 konektory typu A 1. generácie &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;/td&gt; &lt;td width='77%' height='21'&gt; &lt;p align='left'&gt;(spätne kompatibilný s USB 3.0 / 2.0) &lt;p align='left'&gt;  &lt;p align='left'&gt;  &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td width='23%' height='21'&gt; &lt;p align='center'&gt;&lt;strong&gt;Certifikáty&lt;/strong&gt; &lt;p align='center'&gt;  &lt;p align='