itější.&lt;/em&gt;&lt;/p&gt;  &lt;hr /&gt;  &lt;p&gt;Disky Kingston DataTraveler 2000 jsou navrženy tak, aby byly bezpečné, s alfanumerickou klávesnicí, která umožňuje disk uzamknout číselnou nebo slovní kombinací a je tak snadné jej chránit kódem PIN.&lt;/p&gt;  &lt;p&gt;Jeho funkce automatického uzamykání se aktivuje, když je disk vysunut ze zařízení a po 10 nezdařených pokusech o proniknutí systém odstraní šifrovací klíč.&lt;/p&gt;  &lt;p&gt;Disk je vybaven hardwaorvým AES 256bitovým šifrováním dat v režimu XTS. Šifrování je prováděno na disku, nikoliv na hostitelském počítači a nenechává v systému žádnou stopu po kódu PIN, aby se úroveň zabezpečení ještě zvýšila.&lt;/p&gt;  &lt;p&gt;Disk DataTraveler 2000 je nezávislý na operačním systému a jej možné je použít na libovolném zařízení s rozhraním USB 2.0 nebo USB 3.1 Gen 1 (USB 3.0). Je kompatibilní se systémy Windows, Mac OS, Linux, Chrome OS, Android, tenkými klienty a integrovanými systémy a disk nevyžaduje žádný software nebo ovladače.&lt;/p&gt;  &lt;p&gt;Jeho odolný design chrání disk před každodenními vlivy, například vodou nebo prachem.&lt;/p&gt;  &lt;hr /&gt;  &lt;p&gt;• Klávesnice usnadňuje uzamčení disku&lt;br /&gt;• 256bitové hardwarové šifrování dat AES&lt;br /&gt;• Disk je možné použít na libovolném zařízení s rozhraním USB 2.0 nebo USB 3.1 Gen 1 (USB 3.0)&lt;br /&gt;• Odolný design chrání disk před každodenními vlivy&lt;/p&gt;","false","9","000101810007","6029","25","true","00020163","7405","-1","true","5","Rok(ů)","","2023-01-25T00:00:00","2066.00","KS","0.00","4","2016-01-18T10:43:01.553","KIN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_563\/563635_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_563\/563635_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_563\/563635_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_563\/563635_0d_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'66'},'1':{'AttributeCode':'896','ValueCode':'11009'}}","{'0':{'typ':'JEDN','count':'1','weight':'0