ož umožňuje vyhnout se potenciálním rizikům malwaru.&lt;/p&gt;  &lt;p&gt;DT4000G2DM nabízí správu pomocí SafeConsole* (dodává se samostatně), která umožňuje použití celé sady nástrojů pro správu společně se serverovou technologií řídicího centra SafeConsole. Správci IT mohou centrálně spravovat USB disky tak, aby splňovaly požadavky dodržování pravidel a poskytovat vysokou úroveň podpory.  Aktivace je jednoduchá a umožňuje pracovníkům IT dálkově ovládat nastavená hesla, konfigurovat je společně se zásadami pro správu zařízení, aktivovat audity dodržování pravidel atd. Tyto výkonné nástroje zjednodušují integraci disku, ovládání a správu i ve vzdálených lokacích.&lt;/p&gt;  &lt;p&gt;DataTraveler 4000G2DM je certifikován podle FIPS 140-2 úroveň 3 a zajišťuje shodu s TAA, takže plní často požadované firemní a vládní požadavky na zabezpečení IT. Firemní uživatelé si mohou přizpůsobit disky tak, aby splňovaly interní firemní požadavky IT. Firemní logo, serializace, počet pokusů o zadání hesla, minimální délka hesla a přizpůsobitelné identifikátory produktu pro integraci do standardního softwaru pro správu (bílý seznam) jsou dostupné prostřednictvím přizpůsobení.&lt;/p&gt;  &lt;p&gt;Technologie USB 3.0 znamená, že uživatelé nemusí snižovat rychlosti přenosu pro zvýšení zabezpečení a mohou bezpečně ukládat data a přistupovat k nim pomocí technologie SuperSpeed.&lt;/p&gt;  &lt;p&gt;• Cenově dostupné zabezpečení podnikové třídy&lt;br /&gt;• Nabízí správu SafeConsole**&lt;br /&gt;• Certifikace FIPS 140-2 úrovně 3 a shoda s TAA&lt;br /&gt;• Přizpůsobitelné podle specifických interních požadavků na IT prostředí&lt;br /&gt;• Technologie SuperSpeed (USB 3.0)&lt;/p&gt;  &lt;p&gt;&lt;br /&gt;&lt;span style='color: #999999;'&gt;*Server SafeConsole Secure USB se správou verze 5.0.1+&lt;/span&gt;&lt;br /&gt;&lt;span style='color: #999999;'&gt;**Server SafeConsole Secure USB se správou verze 5.0.1+, dodává se samostatně.&lt;/span&gt;&lt;/p&gt;","false","0","000101810007","6029","33","t