ky USB se zatažitelným konektorem společnosti Verbatim, pokročilou kvalitu a design jednotky USB Classic si zcela jistě oblíbíte. Jednotka USB Store 'n' Go Classic disponuje funkcí vysunutí a zasunutí konektoru USB, který je tak chráněn, pokud není používán, a nepotřebuje samostatný kryt, který se snadno ztrácí.&lt;br /&gt;&lt;br /&gt;Jednotka USB Classic je lehká a je k dispozici v různých barvách a s různými funkcemi. Jedná se o perfektní řešení úložiště pro každého. Stačí jen připojit k portu USB a můžete začít přetahovat složky a soubory.&lt;br /&gt;&lt;br /&gt;Ke stažení je k dispozici zkušební verze softwaru pro ochranu pomocí hesla – www.verbatim-europe.com/usbsoftwaredownload&lt;br /&gt;&lt;br /&gt;dvouletá omezená záruka společnosti Verbatim.Kapacita: 8GB&lt;br /&gt;Rozměry: 58 mm x 22 mm x 10,8 mm&lt;/p&gt;","false","9","0001011700030005","2446","-1","true","00020093","4192","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","170.00","KS","99","5","2018-07-17T16:00:26.503","VER","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_792\/792689_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_792\/792689_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_792\/792689_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_792\/792689_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_792\/792689_0e_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'64'},'1':{'AttributeCode':'896','ValueCode':'11009'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.017','length':'14','width':'9','height':'1.5'},'1':{'typ':'PACK','count':'10','weight':'0.206','length':'14.5','width':'10','height':'8'}}","N","","false",""),("799524","665022","Viking USB Flash disk 3.0 4v1 s koncovkou Lightning/Micro USB/USB/USB-C, 16 GB, stříbrná","490.50","516.00","VIK","1.50","24.00","0.000000","0.000","24 Měsíc(ů)","VIKING","515.00","561.00","21.00","VUF16GBS","false","0,00","Dočasně nedostupné","Viking","85078000","8595656504795","Viking USB Flash disk 3.0 4v1 s koncovkou Lightning/Micro U