echny hlavní formáty souborů.&lt;/li&gt;&lt;li&gt;Dokonalá kompatibilita se všemi platformami operačních systémů.&lt;/li&gt;&lt;li&gt;Rychlé čtení a zápis – vychutnejte si film v HD rozlišení 1080P.&lt;/li&gt;&lt;li&gt;Podpora formátování FAT32 a exFAT.&lt;/li&gt;&lt;li&gt;Dovolí přepisovat soubory větší než 4 GB.&lt;/li&gt;&lt;/ul&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;figure class='box-img'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_799/799524_6b.jpg' alt='Obr. KOMPATIBILNÍ FORMÁTY: 799524b' /&gt;&lt;/figure&gt;&lt;div class='desc'&gt;&lt;h2&gt;KOMPATIBILNÍ FORMÁTY:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Filmy: .mov .mpg .vob .wmv .rmvb .avi .mp4 .mkv .flv .mpg .gif .rm&lt;/li&gt;&lt;li&gt;Hudba: .mp3 .wav .aac .m4a .wma .ape .ogg .ac3 .flac&lt;/li&gt;&lt;li&gt;Fotografie: .jpg .gif .tif .png .bmp&lt;/li&gt;&lt;li&gt;Dokumenty: .txt .doc .ppt .xls .pdf .xlsx .doc&lt;/li&gt;&lt;li&gt;Možnosti rozšíření paměti pro iPad / iPhone / iPod Touch / Android / Type-C / PC&lt;/li&gt;&lt;li&gt;Certifikát: FCC, RoHS, CE&lt;/li&gt;&lt;/ul&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;div class='desc'&gt;&lt;h2&gt;Technické parametry:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;Rychlost čtení a zápisu Lightning/USB-C/micro USB: 30MB/s / 20MB/s&lt;/li&gt;&lt;li&gt;Rychlost čtení a zápisu USB2.0: 30MB/s / 20MB/s.&lt;/li&gt;&lt;li&gt;Podpora systému Android / iOS / Windows / Linux / OS X&lt;/li&gt;&lt;li&gt;Rozměry: 61,6 x 14 x 9,2 mm&lt;/li&gt;&lt;li&gt;Hmotnost: cca 20g&lt;/li&gt;&lt;/ul&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;div class='box-video'&gt;&lt;center&gt;&lt;br&gt;&lt;iframe width='560' height='315' src='https://www.youtube.com/embed/d9MRcr50_zM?controls=0' frameborder='0' allow='accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture' allowfullscreen&gt;&lt;/iframe&gt;&lt;/center&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;","false","10","000100420034","12565","3","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00