lt;/h2&gt;  &lt;ul&gt;  &lt;li&gt;Díky technologii USB3.0, můžete zálohovat a nahrávat vaše soubory až 100MB/s&lt;/li&gt;  &lt;li&gt;Lehké a malé zařízení, ideální pro každodenní nošení a používání.&lt;/li&gt;  &lt;li&gt;Ideální pro rozšíření paměti vašeho telefonu / zařízení, pro zálohování dokumentů, fotek, videí, atd.&lt;/li&gt;  &lt;/ul&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div class='row'&gt;  &lt;div class='desc'&gt;  &lt;h2&gt;Podpora zařízení&lt;/h2&gt;  &lt;ul&gt;  &lt;li&gt;IOS9, OS X, Windows, Android, iPhone X, iPhone 8 / 8Plus / iPhone7 / 7plus, iPhone6 / 6s / 6plus / 6splus / iPhoneSE, iPhone5 / 5s / 5c / iPad: iPad Pro / iPad Air 2/ iPad Air/ iPad4 / iPad mini&lt;/li&gt;  &lt;li&gt;iPod: iPod touch6 / iPod touch5, atd., iOS8 - iOS11; OSX; Windows; Linnux.'&lt;/li&gt;  &lt;li&gt;Umožňuje přehrávání videí / hudby přímo z externí paměti.&lt;/li&gt;  &lt;li&gt;Pro Apple zařízení je potřeba doinstalovat aplikace iUSB Pro - zdarma na Appstore&lt;/li&gt;  &lt;li&gt;Správa všech dat přímo v zařízení iOS.&lt;/li&gt;  &lt;li&gt;Možnost zálohování a obnovení seznamu kontaktů.&lt;/li&gt;  &lt;li&gt;Prohlížeč dokumentů pro všechny hlavní formáty souborů.&lt;/li&gt;  &lt;li&gt;Dokonalá kompatibilita se všemi platformami operačních systémů.&lt;/li&gt;  &lt;li&gt;Rychlé čtení a zápis, vychutnejte si film v HD rozlišení 1080P bez sekání.&lt;/li&gt;  &lt;li&gt;Podpora formátování FAT32 a exFAT - Dovolí přepisovat soubory větší než 4 GB.&lt;/li&gt;  &lt;li&gt;Podpora šifrování zálohovaných dat.&lt;/li&gt;  &lt;/ul&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div class='row'&gt;  &lt;div class='desc'&gt;  &lt;h2&gt;Technické parametry&lt;/h2&gt;  &lt;ul&gt;  &lt;li&gt;Model: VIKING USB FLASH 4v1 (32GB, 64GB, 128GB)&lt;/li&gt;  &lt;li&gt;Kapacita: 32GB, 64GB, 128GB&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt;&lt;strong&gt;Podpora systémů&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;FAT32, exFAT, IOS9, OS X, Windows, Android, iPhone X,iPhone 8/ 8Plus/iPhone7/7plus,iPhone6/6s/6plus/6splus/