;em&gt;Ideální, je-li zabezpečení nejdůležitější.&lt;/em&gt;&lt;/p&gt;  &lt;p&gt;Disky Kingston DataTraveler 2000 jsou navrženy tak, aby byly bezpečné, s alfanumerickou klávesnicí, která umožňuje disk uzamknout číselnou nebo slovní kombinací a je tak snadné jej chránit kódem PIN. Jeho funkce automatického uzamykání se aktivuje, když je disk vysunut ze zařízení a po 10 nezdařených pokusech o proniknutí systém odstraní šifrovací klíč. Disk DT2000 je vybaven hardwarovým AES 256bitovým šifrováním dat v režimu XTS. Šifrování je prováděno na disku, nikoliv na hostitelském počítači a nenechává v systému žádnou stopu po kódu PIN. Disk DataTraveler 2000 je nezávislý na operačním systému a je možné je použít na libovolném zařízení s rozhraním USB 2.0 nebo USB 3.1 Gen 1 (USB 3.0). Je kompatibilní se systémy Windows, Mac OS, Linux, Chrome OS, Android (používá se téměř na polovině zařízení dnes expedovaných na trh), tenkými klienty a integrovanými systémy a disk nevyžaduje žádný software nebo ovladače. Disk má certifikaci FIPS 197, takže splňuje častý požadavek na zabezpečení firemního IT vybavení a jeho odolná konstrukce jej chrání před každodenními nepříznivými vlivy, jako je voda a prach.&lt;/p&gt;  &lt;p&gt;• Alfanumerická klávesnice usnadňuje uzamčení disku&lt;br /&gt;• 256bitové hardwarové šifrování AES celého disku&lt;br /&gt;• Disk je možné použít na libovolném zařízení s rozhraním USB 2.0 nebo USB 3.1  Gen1 (USB 3.0) &lt;br /&gt;• Certifikace FIPS 197&lt;/p&gt;","false","0","000101810007","6029","28","true","","-1","-1","true","5","Rok(ů)","","0001-01-01T00:00:00","2988.00","KS","1.00","2","2018-08-22T10:58:05.853","KIN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1321\/1321861_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1321\/1321861_0b_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8767'},'1':{'AttributeCode':'896','ValueCode':'11009'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.057','length':'18','width':'11.5','height':'2'},'1':{'typ':'PAC