167547","SanDisk Flash Disk 128GB Cruzer Spark, USB 2.0","Kapacita uložiště:128 GB; Verze USB:2.0","1","&lt;p&gt;&lt;strong&gt;USB Flash disk Cruzer Spark™ USB 2.0&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;S flash diskem Cruzer Spark™ USB 2.0 budete mít svá data neustále u sebe. Tento flash disk je bez víčka a jeho kompaktní a praktický design se zabudovaným očkem pro zavěšení na klíčenku vám umožní mít ho neustále po ruce. Flash disk Cruzer Spark je kompatibilní s počítači&lt;br /&gt;Mac i PC a je k dispozici v kapacitách 16 až 128 GB.* Své soubory budete mít neustále po ruce, ať už je potřebujete k práci, do školy či jen pro zábavu.&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;Výhody&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Mějte svá data stále po ruce&lt;/li&gt;  &lt;li&gt;Lehký a snadno použitelný&lt;/li&gt;  &lt;li&gt;Žádné díly, které byste mohli ztratit&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;TECHNICKÉ PARAMETRY&lt;/p&gt;  &lt;table dir='LTR' border='1' width='880' cellspacing='0' cellpadding='2'&gt;  &lt;tbody&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;PN&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;SDCZ61-128G-G35&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Kapacita&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;128GB&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Rozhraní&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;USB 2.0&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Rozměry&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;48,05 × 18,06 × 7,7 mm&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Provozní teplota&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;0 – 35 °C&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Skladovací teplota&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;-10 – 70 °C&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Záruka&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;5-letá záruka&lt;/td&gt;  &lt;/tr&gt;  &lt;/tbody&gt;  &lt;/table&gt;  &lt;p&gt; &lt;/p&gt;","false","0","000101570008","7253","38","true","","-1","-1","true","60","Měsíc(ů)","","2023-01-18T00:00:00","244.00","KS","0.00","2","2018-10-08T11:07:02.05","SAN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1383\/1383101_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1383\/1383101_0b_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8768'},'1':{'AttributeCode':'896','ValueCode':'11008'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.012','length':'8','width':'13','height':'1'},'1':{'typ':'PACK','count':'25','weight':'0.344','length':'16','width':'9','height':'14'},'2':{'typ':'PACK','count':'50','weight':'0.678','length':'28','width':'8.5','height':'14'}}","N","","false",""),("1424831","443440","Kingston Flash Disk 128GB D300S AES 256 XTS Encrypted USB Drive","6790.50","6882.00","KIF","1.50","90.00","0.000000","0.000","60 Měsíc(ů)","KINGSTON FLASH","6888.00","7148.00","21.00","IKD300S/128GB","false","0,00","","Kingston","85235110","740617287530","Kingston Flash Disk 128GB D300S AES 256 XTS Encrypted USB Drive","Kapacita uložiště:128 GB; Verze USB:3.0","1","&lt;h1&gt;IronKey D300&lt;/h1&gt;  &lt;p&gt;Chraňte mobilní data pomocí pokročilého zabezpečení.&lt;/p&gt;  &lt;h2&gt;Všechny modely&lt;/h2&gt;  &lt;p&gt;Flash disk IronKey™ D300 USB společnosti Kingston zaručuje pokročilou úroveň zabezpečení na základě specifických prvků IronKey na ochranu citlivých informací. Disk má certifikaci FIPS 140-2 Level 3 a je vybaven 256bitovým hardwarovým šifrováním AES v režimu XTS. Důležitý pilíř pro nastavení norem zabezpečení, firemních zásad a osvědčených postupů na ochranu proti ztrátě dat (DLP).  Důležitý prvek při úsilí o zajištění souladu s průmyslovými normami a celosvětovými předpisy, jako např. GDPR.&lt;br /&gt;Pro větší klid flash disk používá digitálně podepsaný firmware, díky čemuž je imunní vůči BadUSB, pro zabránění neoprávněného přístupu vyžaduje ochranu komplexním heslem* s minimální charakteristikou. &lt;br /&gt;Šifrování a dešifrování se provádí ve flash disku bez zanechání stop v hostitelském systému a flash disk se uzamkne a přeformátuje po 10 neplatných pokusech na ochranu proti útokům za použití síly.&lt;br /&gt;Odolný a bezpečný flash disk IronKey D300 má zinkové pouzdro a epoxidovou pečeť indikující případnou neoprávněnou manipulaci pro fyzické zabezpečení, takže si můžete být jisti, že flash disk zvládne i ty nejnáročnější situace. &lt;br /&gt;Upravitelnost, snadné používání a vodotěsnost do 4 stop v souladu s IEC60529 IXP8**. Technologie SuperSpeed (USB 3.0) znamená, že nemusíte dělat žádné kompromisy v oblasti zabezpečení.&lt;/p&gt;  &lt;h2&gt;Sériové modely (S)&lt;/h2&gt;  &lt;p&gt;Modely IronKey D300S / D300SM přináší dva přídavné prvky nad rámec prvotřídní ochrany dat.&lt;br /&gt;Jedinečné sériové číslo a čárový kód vytištěné na flash disku&lt;br /&gt;• Umožňuje správcům sítě jednoduše přečíst nebo naskenovat kód bez nutnosti připojení flash disku za účelem zjištění jeho jedinečného sériového čísla. &lt;br /&gt;• Úspora času při používání a vracení flash disku a rovněž při činnostech fyzické kontroly a správy IT majetku prováděných společností. Když se najde ztracený flash disk, podle sériového čísla je možno rychle zjistit vlastníka.&lt;/p&gt;  &lt;h2&gt;Virtuální klávesnice&lt;/h2&gt;  &lt;p&gt;• Umožňuje uživatelům zadat heslo myší namísto fyzické klávesnice; snížení rizika zachycení hesla při zadávání. &lt;br /&gt;• Ochrana při používání zašifrovaného flash disku na jiných počítačích, které mohou zaznamenávat každý stisk na fyzické klávesnici, včetně zadávání hesel.&lt;/p&gt;  &lt;h2&gt;Model Managed&lt;/h2&gt;  &lt;p&gt;IronKey D300M / D300SM je dostupný v modelu Managed, který vyžaduje IronKey EMS s D300SM podporujícím SafeConsole od DataLocker***.  Umožňuje centrální správu přístupu k flash disku a použití u tisíců flash disků. &lt;br /&gt;Ať už na bázi cloudu nebo v prostorách firmy, uplatňuje zásady specifické pro používání flash disků, např. síla hesla a limit na počet pokusů zadání hesla, a umožňuje správcům na dálku zablokovat ztracené nebo ukradené flash disky, zjistit zapomenutá hesla atd.&lt;/p&gt;  &lt;p&gt;• Pokročilá úroveň zabezpečení na základě uznávaných prvků IronKey&lt;br /&gt;• Dostupné v modelu Managed, který vyžaduje IronKey EMS od DataLocker***&lt;br /&gt;• Odolné a bezpečné pouzdro, které splňuje normy IronKey&lt;br /&gt;• Rychlý přenos dat, který využívá nejnovější NAND Flash a technologii ovládání&lt;br /&gt;• Možnosti přizpůsobení&lt;br /&gt;• Jednoduché používání&lt;/p&gt;  &lt;p&gt;&lt;span style='color: #999999;'&gt;* Požadavky na heslo stanoví správce při nastavení používání IronKey EMS pro flash disky IronKey D300 Managed.&lt;/span&gt;&lt;br /&gt;&lt;span style='color: #999999;'&gt;** Před použitím musí být výrobek čistý a suchý.&lt;/span&gt;&lt;br /&gt;&lt;span style='color: #999999;'&gt;*** IronKey EMS od DataLocker, nutno zakoupit samostatně.&lt;/span&gt;&lt;/p&gt;","false","0","000101810009","7068","48","true","","-1","-1","true","60","Měsíc(ů)","","0001-01-01T00:00:00","6888.00","KS","0.00","3","2018-12-13T15:41:35.04","KIN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1424\/1424831_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1424\/1424831_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1424\/1424831_0c_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8768'},'1':{'AttributeCode':'896','ValueCode':'11009'