ed, který vyžaduje IronKey EMS od DataLocker***&lt;br /&gt;• Odolné a bezpečné pouzdro, které splňuje normy IronKey&lt;br /&gt;• Rychlý přenos dat, který využívá nejnovější NAND Flash a technologii ovládání&lt;br /&gt;• Možnosti přizpůsobení&lt;br /&gt;• Jednoduché používání&lt;/p&gt;  &lt;p&gt;&lt;span style='color: #999999;'&gt;* Požadavky na heslo stanoví správce při nastavení používání IronKey EMS pro flash disky IronKey D300 Managed.&lt;/span&gt;&lt;br /&gt;&lt;span style='color: #999999;'&gt;** Před použitím musí být výrobek čistý a suchý.&lt;/span&gt;&lt;br /&gt;&lt;span style='color: #999999;'&gt;*** IronKey EMS od DataLocker, nutno zakoupit samostatně.&lt;/span&gt;&lt;/p&gt;","false","0","000101810009","7068","59","true","","-1","-1","true","60","Měsíc(ů)","","0001-01-01T00:00:00","7011.00","KS","0.00","3","2018-12-13T15:39:23.94","KIN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1436\/1436503_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1436\/1436503_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1436\/1436503_0c_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8768'},'1':{'AttributeCode':'896','ValueCode':'11009'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.078','length':'13','width':'7.5','height':'3'}}","N","","false",""),("1446745","493197","SanDisk Flash Disk 16GB Cruzer Fit, USB 2.0","95.50","121.00","SND","1.50","24.00","0.000000","0.000","60 Měsíc(ů)","SANDISK","98.00","131.00","21.00","SDCZ33-016G-G35","false","0,00","Dočasně nedostupné","SanDisk","85235110","619659171780","SanDisk Flash Disk 16GB Cruzer Fit, USB 2.0","Kapacita uložiště:16 GB; Verze USB:2.0","1","&lt;p&gt;&lt;strong&gt;CRUZER FIT™ USB FLASH DRIVE - 16 GB&lt;br /&gt;&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;&lt;strong&gt;Capacity:&lt;/strong&gt; 16 GB&lt;/li&gt;  &lt;li&gt;&lt;strong&gt;Generation:&lt;/strong&gt; USB 2.0&lt;/li&gt;  &lt;li&gt;&lt;strong&gt;Available capacities:&lt;/strong&gt; 8GB, 16GB, 32GB, and 64GB1&lt;/li&gt;  &lt;li&gt;&lt;st