&gt; - Choose from 16GB up to 512GB of capacity to give you enough space to always keep your most important content close by.&lt;/li&gt;  &lt;li&gt;&lt;strong&gt;Password protection&lt;/strong&gt; - Built-in SanDisk SecureAccess password protection software provides a dependable way to help keep your content safe.&lt;/li&gt;  &lt;li&gt;&lt;strong&gt;Easy file recovery&lt;/strong&gt; - RescuePRO Deluxe file recovery software helps you restore files, even if they’re accidentally lost or deleted.&lt;/li&gt;  &lt;li&gt;&lt;strong&gt;5-Year limited warranty&lt;/strong&gt; - Includes a 5-year limited warranty so you can confidently rely on your drive for years to come.&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;TECHNICAL SPECIFICATIONS&lt;/p&gt;  &lt;table dir='LTR' border='1' width='800' cellspacing='0' cellpadding='2'&gt;  &lt;tbody&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt; Capacity&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;128 GB&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Interface&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;USB 3.1 Gen 1&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Connector&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;USB-A&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Compatibility&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt; USB 3.1 Gen 1&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt; Dimensions (L x W x H)&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt; 1.57' x 0.62' x 0.23'&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt; Sequential Re