.018','length':'10.5','width':'13','height':'1'}}","N","","false",""),("1479777","714112","VERBATIM USB 3.0 Drive 64 GB - Keypad Secure (R:160/W:140 MB/s) GDPR","1043.50","1135.00","VER","1.50","90.00","0.000000","0.000","24 Měsíc(ů)","VERBATIM","1043.00","1941.00","21.00","49428","false","0,00","","Verbatim","85235110","023942494287","VERBATIM USB 3.0 Drive 64 GB - Keypad Secure (R:160/W:140 MB/s) GDPR","Kapacita uložiště:64 GB; Verze USB:3.0","1","&lt;p&gt;&lt;span style='font-size: 12pt;'&gt;&lt;strong&gt;Klávesnica Secure USB 3.0 Disk 64 GB&lt;/strong&gt;&lt;/span&gt; &lt;p&gt;&lt;strong&gt;Prehľad&lt;/strong&gt; &lt;p&gt;V dnešnom svete je bezpečnosť vašich dôverných údajov mimoriadne dôležitá. Predstavte si, že by ste stratili svoje osobné súbory, nechali ich vo vlaku alebo na zadnom sedadle taxíka a vedeli, že k nim má prístup ktokoľvek, pretože boli uložené na štandardnom pevnom disku. Teraz je tu pre váš pokoj bezpečný USB disk s klávesnicou. &lt;p&gt;256-bitové hardvérové šifrovanie AES bezproblémovo šifruje všetky údaje na disku v reálnom čase so zabudovanou klávesnicou na zadanie prístupového kódu. Disk USB neukladá heslá do nestálej pamäte počítača alebo systému, takže je oveľa bezpečnejší ako softvérové šifrovanie. Ak sa dostane do nesprávnych rúk, zariadenie sa po 20 neúspešných pokusoch o zadanie prístupového kódu zablokuje a bude vyžadovať opätovné naformátovanie. &lt;p&gt;Klávesnica je kompatibilná s operačnými systémami PC aj Mac a má rozhranie USB 3.0 pre mimoriadne rýchly prenos dát. Balenie obsahuje predlžovací kábel USB-A na USB-A, ktorý vám pomôže pripojiť sa k ťažko prístupným portom. Možno ho pripojiť aj k televízorom, čo pri bežných šifrovaných zariadeniach nie je možné. &lt;p&gt;Na zvýšenie bezpečnosti je k dispozícii softvér Nero Backup, ktorý vám pomôže zálohovať všetky vaše súbory, priečinky a disky z notebooku alebo počítača, kedykoľvek budete chcieť. Umožňuje tiež naplánovať automatické zálohovanie na nastavený čas a deň, aby sa zabezpečilo jeho pravidelné vykonávanie! Softvér Nero Backup je kompatibilný so systémami Windows Vista, Windows 7, Windows 8 a Windows 10 (nie je kompatibilný so systémom Mac OS). &lt;p&gt;  &lt;p&gt;  &lt;p&gt;TECHNICKÉ ŠPECIFIKÁCIE &lt;table dir='LTR' border='1' width='880' cellspacing='0' cellpadding='2'&gt; &lt;tbody&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Podrobnosti o produkte&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt; &lt;p&gt;Kapacita: 64 GB&lt;br/&gt;Rýchlosť čítania: až 160 MB/s &lt;br/&gt;Rýchlosť zápisu: až 140 MB/s &lt;p&gt;  &lt;ul&gt; &lt;li&gt;256-bitové hardvérové šifrovanie AES, bezproblémové šifrovanie všetkých údajov na disku v reálnom čase&lt;/li&gt; &lt;li&gt;Zabudovaná klávesnica na zadávanie prístupového kódu (až 12 číslic)&lt;/li&gt; &lt;li&gt;Možno používať s televízormi (funkcia, ktorá nie je možná pri bežných šifrovaných zariadeniach)&lt;/li&gt; &lt;li&gt;USB 3.0 pripojenie&lt;/li&gt; &lt;li&gt;LED indikátory stavu napájania/šifrovania&lt;/li&gt; &lt;li&gt;Heslo sa neukladá do pamäte počítača alebo systému, preto je oveľa bezpečnejšie&lt;/li&gt; &lt;li&gt;ako softvérové šifrovanie&lt;/li&gt; &lt;li&gt;Kompatibilita s PC a Mac&lt;/li&gt; &lt;li&gt;Kombinovaný hliníkový / plastový kryt&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Systémové požiadavky&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt; &lt;p&gt;USB 3.0 (kompatibilný aj s USB 2.0*) &lt;p&gt;&lt;strong&gt;PC:&lt;/strong&gt;&lt;br/&gt;Minimálne procesor Intel Pentium II/50MHZ, 64MB RAM&lt;br/&gt;Windows 10, 8, 7 &lt;p&gt;&lt;strong&gt;MAC:&lt;/strong&gt;&lt;br/&gt;Minimálne procesor Apple G, 64 MB RAM&lt;br/&gt;Mac OS X 10.4 alebo vyššia &lt;p&gt;*pre optimálny výkon musí byť disk pripojený k USB 3.0 hostiteľský radič &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' 