kácia&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt; &lt;ul&gt; &lt;li&gt;Napájanie: napájanie zo zbernice cez kábel USB&lt;/li&gt; &lt;li&gt;Rozhranie: USB 3.1 GEN 1&lt;/li&gt; &lt;li&gt;Materiál krytu: plast a hliník&lt;/li&gt; &lt;li&gt;Indikátor LED: Napájanie, aktivita USB a stav šifrovania&lt;/li&gt; &lt;li&gt;Hmotnosť výrobku: 30 gramov (približne)&lt;/li&gt; &lt;li&gt;Rozmery: 93.5 mm x 28 mm x 12 mm (d x š x v)&lt;/li&gt; &lt;li&gt;Prevádzková teplota: 5 °C až 50 °C&lt;/li&gt; &lt;li&gt;Teplota skladovania: -40°C až 70°C&lt;/li&gt; &lt;li&gt;Prevádzková vlhkosť: 5 až 90 %, nekondenzujúca&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Obsah balenia&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt; &lt;ul&gt; &lt;li&gt;Klávesnica Zabezpečená jednotka USB-CTM&lt;/li&gt; &lt;li&gt;Predlžovací kábel USB-C na USB-CTM&lt;/li&gt; &lt;li&gt;Softvér Nero Backup (nie je kompatibilný s Mac OS)&lt;/li&gt; &lt;li&gt;Stručná príručka&lt;/li&gt; &lt;li&gt;Používateľská príručka (vopred nahraná na jednotke)&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;PN&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;49430&lt;/td&gt; &lt;/tr&gt; &lt;/tbody&gt; &lt;/table&gt; &lt;p&gt; .","false","1","0001011700030005","2446","-1","true","00020093","4192","-1","true","24","Měsíc(ů)","","2023-01-15T00:00:00","776.00","KS","0.00","7","2019-08-09T12:23:25.36","VER","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1479\/1479798_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1479\/1479798_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1479\/1479798_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1479\/1479798_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1479\/1479798_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1479\/1479798_0f_3.jpg','6':'h