0px currentColor; font-size: 100%; vertical-align: baseline; -ms-text-size-adjust: none;'&gt;&lt;a style='color: #111111; font-size: 18px; font-weight: 400; text-decoration: none; cursor: pointer; -ms-text-size-adjust: none;'&gt;TAIWAN EXCELLENCE 2019&lt;/a&gt;&lt;/h2&gt;  &lt;div class='awardDate' style='background: none; margin: 5px 0px 0px; padding: 0px; outline: 0px; border: 0px currentColor; color: #999999; font-size: 14px; vertical-align: baseline; -ms-text-size-adjust: none;'&gt;2018-10-01&lt;/div&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;/li&gt;  &lt;li style='background: none; margin: 0px; padding: 0px 1px 65px; outline: 0px; border: 0px currentColor; width: calc(25%); font-size: 100%; vertical-align: baseline; box-sizing: border-box; -ms-text-size-adjust: none;'&gt;  &lt;div class='item' style='background: none; margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; font-size: 100%; vertical-align: baseline; -ms-text-size-adjust: none;'&gt;  &lt;div class='Img' style='background: none; margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; font-size: 100%; vertical-align: baseline; position: relative; -ms-text-size-adjust: none;'&gt;  &lt;div class='imgBox' style='background: none; margin: 0px; padding: 10px; outline: 0px; border: 0px currentColor; width: 100%; height: 120px; font-size: 100%; vertical-align: baseline; display: flex; position: relative; box-sizing: border-box; -ms-text-size-adjust: none; justify-content: center; align-items: center;'&gt;&lt;a style='left: 0px; top: 0px; width: 100%; height: 100%; text-decoration: none; display: flex; position: absolute; z-index: 1; cursor: pointer; box-sizing: border-box; -ms-text-size-adjust: none; justify-content: center; align-items: center;'&gt;&lt;img style='background: none; margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; height: auto; font-size: 100%; vertical-align: baseline; max-height: 100%; max-width: 100%; -ms-text-size-adjust: none;' src='https://www.teamgroupinc.com/en/upload/product_award_pic/e8411b7a93d584691efb08782ae20db5.jpg' alt='COMPUTEX d&amp;amp;i awards 2018' /&gt;&lt;/a&gt;&lt;/div&gt;  &lt;/div&gt;  &lt;div class='Txt' style='background: none; margin: 0px; padding: 25px 10px 0px; outline: 0px; border: 0px currentColor; text-align: center; font-size: 100%; vertical-align: baseline; -ms-text-size-adjust: none;'&gt;  &lt;h2 style='background: none; margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; font-size: 100%; vertical-align: baseline; -ms-text-size-adjust: none;'&gt;&lt;a style='color: #111111; font-size: 18px; font-weight: 400; text-decoration: none; cursor: pointer; -ms-text-size-adjust: none;'&gt;COMPUTEX d&amp;amp;i awards 2018&lt;/a&gt;&lt;/h2&gt;  &lt;div class='awardDate' style='background: none; margin: 5px 0px 0px; padding: 0px; outline: 0px; border: 0px currentColor; color: #999999; font-size: 14px; vertical-align: baseline; -ms-text-size-adjust: none;'&gt;2018-06-01&lt;/div&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;/li&gt;  &lt;/ul&gt;  &lt;/div&gt;  &lt;p&gt;&lt;strong&gt;USB Drive | T183&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Features&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Multifunctional and practical design&lt;/li&gt;  &lt;li&gt;Environmentally safe materials&lt;/li&gt;  &lt;li&gt;USB3.1 Gen 1 transfer interface&lt;/li&gt;  &lt;li&gt;Supports hot swap&lt;/li&gt;  &lt;li&gt;Lifetime warranty and free technical support&lt;/li&gt;  &lt;li&gt;Taiwan Utility Model Patent No. M578862&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Innovative design and glorious classic&lt;/strong&gt;&lt;br /&gt;TEAMGROUP’s innovative, multifunctional USB drive – T183 Tool USB drive, has won the 2018 COMPUTEX d&amp;amp;i award. Different than traditional USB drive, which its sole purpose is data storage, the out-of-box design emphasizes on aesthetic design and practical functions. The innovative, multifunctional design creates additional value for the USB drive.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Multifunctional, little life helper&lt;/strong&gt;&lt;br /&gt;Many practical features are added to the T183 Tool USB drive to make your life easier. In addition to high-speed USB drive’s storage function, it also has bottle opener, ruler, keychain and can cut through a carton tape. Moreover, the T183 Tool USB drive is magnetic, which can be easily placed on a visible iron surface (office cubicle walls/refrigerator). It’s a little life helper you can’t live without.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Forged metal, solid and durable&lt;/strong&gt;&lt;br /&gt;The T183 Tool USB drive is made with top class Zinc alloy forging technology and aesthetic design. The solid and durable, one-piece metal forged body is both fashionable and practical. It is a multifunctional tool that is worthy for you to have.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;High speed transfer performance&lt;/strong&gt;&lt;br /&gt;The T183 high speed 3.1 USB drive uses USB 3.1(Gen1) high speed transfer specification. It can greatly enhance transfer performance, and also downward compatible with USB 2.0 interface. The transfer speed and read speed per second can reach above 85MB/s. It allows quick access for large files in a short time, so work efficiency can be increased.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Multi-protections such as waterproof, dust-proof, shockproof, corrosion resistant, etc.&lt;/strong&gt;&lt;br /&gt;The T183 Tool USB drive uses COB (Chip On Board) assembly process to offer multi-protection such as waterproof, dust-proof and shockproof. In addition, it also has special coating for rust and corrosion protection. It avoids data corruption or data loss which caused by external forces during the operation.&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;TECHNICAL SPECIFICATIONS&lt;/p&gt;  &lt;table dir='LTR' border='1' width='880' cellspacing='0' cellpadding='2'&gt;  &lt;tbody&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Interface&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;USB 3.1 Gen1 (USB 3.0)&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Capacity&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;128GB&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Data Transfer Rate&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;Read: 90MB/s Max&lt;br /&gt;Write: 35MB/s Max&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Color&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;Nickel Black&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Dimensions (L x W x H)&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;60.3 x 18 x 4.6 mm&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Weight&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;19 g&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Voltage&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;DC+5V&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Operating System&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;Windows 10 / 8.1 / 8 / 7 / Vista, MAC OS 10.4 or later,&lt;br /&gt;Linux 2.6.33 or later&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Warranty&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;Lifetime warranty&lt;/td&gt;  &lt;/tr&gt;  &lt;/tbody&gt;  &lt;/table&gt;  &lt;p&gt; &lt;/p&gt;","false","9","00010314","11462","-1","true","","-1","-1","true","120","Měsíc(ů)"