/p&gt;  &lt;p&gt;&lt;strong&gt;Retractable capless design&lt;/strong&gt;&lt;br /&gt;The C186 USB 3.1 drive is designed with a retractable USB connector, so you don’t have to worry about losing the cap. The special designed structure can slide with ease to reduce wear and tear. It is durable for up to 10,000 times of usage, making file transferring, sharing and storage easier than ever before.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Exclusive effort-saving bidirectional pull-push design!&lt;/strong&gt;&lt;br /&gt;The exclusive elasticity constructed design, physically save approximately 10% of energy in normal using time to make more effort-saving for pull-push more efficiency.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;USB 3.1 Gen1 high-speed interface&lt;/strong&gt;&lt;br /&gt;The C186 retractable USB drive uses USB 3.1 Gen1 high-speed interface. The USB drive has a 128GB capacity, which can satisfy the need for file backup or large multimedia file transferring. By greatly reducing the time for file transferring and accessing, the high-speed USB drive can be enhanced to present a superb performance.&lt;/p&gt;  &lt;br&gt;  &lt;p&gt;TECHNICAL SPECIFICATIONS&lt;/p&gt;  &lt;table dir='LTR' border='1' width='880' cellspacing='0' cellpadding='2'&gt;  &lt;tbody&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Interface&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;USB 3.1 Gen1&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Capacity&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;64GB&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Color&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;Black&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Dimensions (L x W x H)&lt;/strong&gt;&lt;/td&gt;  &