ve | C145&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Features&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Equipped with the new-generation USB 3.0 interface.&lt;/li&gt;  &lt;li&gt;Ultra-thin 8.4mm design; the most lightweight design in the industry.&lt;/li&gt;  &lt;li&gt;Easy sliding design with a durability of sliding over 10,000 times.&lt;/li&gt;  &lt;li&gt;Supports hot-swapping and plug&amp;amp;play.&lt;/li&gt;  &lt;li&gt;Downward compatible with USB 2.0/USB 1.1 interfaces.&lt;/li&gt;  &lt;li&gt;Does not require the use of external power.&lt;/li&gt;  &lt;li&gt;Supports power saving mode.&lt;/li&gt;  &lt;/ul&gt;  &lt;br&gt;  &lt;p&gt;&lt;strong&gt;SB 3.0 Makes Data Transfer a Snap&lt;/strong&gt;&lt;br /&gt;TEAMGROUP Color C145 pen drive features a sliding USB connector, which smoothly extends from the drive at the push of a thumb in only one second. Cap-less design eliminates the problem of lost drive caps. The scratch-free, 3D-feel, matte and glossy contrasting texture and streamlined exterior design with ergonomic push button make C145 more elegant and comfortable than ever.&lt;br /&gt;With ultra-thin 8.4mm design, C145, which is designed to enhance the user experience, fits comfortably between thumb and finger, the easy-to-grip contoured design requires minimal effort when unplugging from a USB port. C145 is fully compatible with High-Speed USB 3.0 interface, up to 128GB storage capacity and different colors for selection.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Fits comfortable between thumb and finger&lt;/strong&gt;&lt;br /&gt;With a thickness of just 8.4 mm, A compact design of C145 fits easily into your pocket or computer bag.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Speed, Capacity&lt;/strong&gt;&lt;br /&gt;Combining a glossy contrasted texture with ample capacity, C145 USB flash drive packs a generous capacity into a racing-car-style exterior design USB drive. Available in sizes up to 128GB, the flash drive can accommodate photos, songs, videos, and all of y