isk&lt;/strong&gt;&lt;br/&gt;UUN2 vyniká svojím vzhľadom pripomínajúcim šperk a je ideálnym riešením pre ľudí, ktorí ocenia originálny dizajn. Jednoduchý tvar puzdra s dvoma typmi povrchovej úpravy materiálu a pútkom na kľúče zaujme mnohých používateľov. Oceľové strieborné puzdro a dizajn bez krytky zaisťujú bezpečné používanie flash disku v každej situácii. &lt;p&gt;&lt;strong&gt;Zvýšená odolnosť vďaka oceľovému puzdru&lt;/strong&gt;&lt;br/&gt;Odolný flash disk UUN2 ocenia mnohí používatelia. Robustné oceľové puzdro UUN2 má originálny a nadčasový dizajn a zaručuje väčšiu odolnosť voči poškodeniu a zároveň chráni uložené údaje. Vďaka dizajnu bez krytky si budete môcť dlho užívať kompletný vzhľad a funkčnosť tohto flash disku. &lt;p&gt;&lt;strong&gt;Výdrž najaktívnejšieho&lt;/strong&gt;&lt;br/&gt;Flash disk UUN2 využíva technológiu COB (chip on board) - kremíkové pamäťové čipy a radič boli namontované na jeden plošný spoj a pokryté špeciálnou živicou. Vďaka tomu získal tento flash disk okrem malých rozmerov a hmotnosti aj ďalšiu výhodu: je vodotesný a odolný voči nárazom, čo znamená ešte väčší komfort pri používaní. Vďaka tomu je tento USB flash disk určený pre aktívnych používateľov, ktorí oceňujú praktické hodnoty vymeniteľného úložiska. &lt;br/&gt; &lt;p&gt;TECHNICKÉ ŠPECIFIKÁCIE &lt;table dir='LTR' border='1' width='880' cellspacing='0' cellpadding='2'&gt; &lt;tbody&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Kapacita&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;16 GB&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Farba&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;Silver&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Rozhranie&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;USB 2.0 typu A spätne kompatibilný s USB 1.1&lt;/td&gt; &lt;/