arat o ztracené díly.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Elegantní flash disk&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;UUN2 vyniká svým vzhledem připomínajícím šperk a je perfektním řešením pro lidi, kteří ocení originální design. Jednoduchý tvar pouzdra se dvěma typy povrchové úpravy materiálu a poutkem na klíče upoutá mnoho uživatelů. Ocelové stříbrné pouzdro a design bez krytky zajišťují bezpečné používání flash disku ve všech situacích.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Zvýšená odolnost s ocelovým pouzdrem&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;Odolný flash disk UUN2 oceňuje mnoho uživatelů. Odolné ocelové pouzdro UUN2 má originální a nadčasový design a zaručuje větší odolnost proti poškození a zároveň chrání uložená data. Design bez krytky vám umožní užívat si kompletní vzhled a funkčnost tohoto flash disku po dlouhou dobu.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Vytrvalost pro nejaktivnější&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;Flash disk UUN2 využívá technologii COB (chip on board) – křemíkové paměťové čipy a řadič byly osazeny na jediném tištěném obvodu a pokryty speciální pryskyřicí. Díky tomu, kromě malých rozměrů a hmotnosti, získal tento flash disk další výhodu: je voděodolný a nárazuvzdorný, což znamená ještě větší komfort používání. Díky tomu je tento USB flash disk určen pro aktivní uživatele, kteří oceňují praktické hodnoty vyměnitelného úložiště.&lt;/p&gt;  &lt;p&gt;Kapacita: 64 GB, Rozhraní zařízení: USB Typ-A, USB verze: 2.0, Rychlost čtení: 20 MB/s, Rychlost zápisu: 5 MB/s. Formát: Bez krytky.&lt;/p&gt;","false","0","","-1","-1","true","","-1","-1","true","99","Doživotní","","0001-01-01T00:00:00","114.00","KS","0.00","3","2020-02-10T15:34:33.14","GRM","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1507\/1507080_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1507\/1507080_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1507\/1507080_0c_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8767'},'1':{'AttributeCode':'896','ValueCode':'11008'}}","{'0':{'typ':'JEDN','count':'1','weight':'0','length':'0','width':'0','height':'0'}}","N","","false",""),("1507172","490205","GOODRAM Flash Disk UPO3 64GB USB 3.0 stříbrná","219.50","311.00","GDR","1.50","90.00","0.000000","0.000","99 Doživotní","GOODRAM","220.00","312.00","21.00","UPO3-0640S0R11","false","0,00","Novinka","GoodRAM","85235110","5908267920596","GOODRAM Flash Disk UPO3 64GB USB 3.0 stříbrná","Kapacita uložiště:64 GB; Verze USB:3.0","1","&lt;h2&gt;&lt;strong&gt;UPO3 USB 3.0&lt;/strong&gt;&lt;/h2&gt;  &lt;p style='text-align: justify;'&gt;UPO3 je určen pro ty, kteří oceňují praktické vlastnosti USB flash disků. Tento kompaktní 2 cm dlouhý USB flash disk umožňuje pohodlný přenos a ukládání dat. Kovové jednotné pouzdro se vyznačuje originálním a nadčasovým designem. Technologie COB (Chip on Board) zaručuje lepší odolnost, chrání cenná data, zatímco moderní rozhraní USB 3.0 umožňuje dosahovat vysokých přenosových rychlostí (čtení až 60 MB/s) a umožňuje okamžitý přenos vašich oblíbených fotografií, videí nebo důležité prezentace.&lt;/p&gt;  &lt;p style='text-align: justify;'&gt;&lt;strong&gt;Vytrvalost pro nejaktivnější&lt;/strong&gt;&lt;/p&gt;  &lt;p style='text-align: justify;'&gt;Flash disk UPO3 využívá technologii COB (chip on board) – křemíkové paměťové čipy a řadič byly osazeny na jednom tištěném spoji a pokryty speciální pryskyřicí. Díky tomu, kromě malých rozměrů a hmotnosti, získal tento flash disk další výhodu: je odolný proti nárazům, což znamená ještě větší komfort používání. Díky tomu je tento USB flash disk určen pro aktivní uživatele, kteří oceňují praktické hodnoty vyměnitelného úložiště.&lt;/p&gt;  &lt;p style='text-align: justify;'&gt;&lt;strong&gt;Maximální kapacita, minimální velikost&lt;/strong&gt;&lt;/p&gt;  &lt;p style='text-align: justify;'&gt;Pouzdro UPO3 je dlouhé jen asi 2 cm, přesto díky nejnovější technologii pojme tento flash disk až 64 GB dat! Malá velikost umožňuje pohodlný přenos dat a ukládání tohoto flash disku. Lze jej například nosit s klíči nebo jej trvale zapojit do notebooku nebo zábavního systému automobilku. Díky praktickému pouzdru UPO3 je tento flash disk perfektní jako klíčenka, zatímco očko umožňuje jeho snadné připevnění na šňůrku. Díky tomu můžete rychle sdílet své fotografie, oblíbené filmy nebo hudbu s přáteli a své dokumenty, tabulky a prezentace se svými obchodními partnery.&lt;/p&gt;  &lt;p style='text-align: justify;'&gt;&lt;strong&gt;Určeno pro přenosná zařízení&lt;/strong&gt;&lt;/p&gt;  &lt;p style='text-align: justify;'&gt;UPO3 je ideální pro použití v moderních ultraboocích – díky malé velikosti je po vložení do USB portu prakticky neviditelný. Vysoká přenosová rychlost uspokojí i ty nejnáročnější uživatele.&lt;br /&gt;Kapacita 64 GB, USB Typ-A, 3.2 Gen 1 (3.1 Gen 1), 60 MB/s&lt;/p&gt;","false","1","","-1","-1","true","","-1","-1","true","99","Doživotní","","0001-01-01T00:00:00","220.00","KS","0.00","3","2020-02-11T13:23:34.483","GRM","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1507\/1507172_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1507\/1507172_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1507\/1507172_0c_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8767'},'1':{'AttributeCode':'896','ValueCode':'11009'}}","{'0':{'typ':'JEDN','count':'1','weight':'0','length':'0','width':'0','height':'0'}}","N","","false",""),("1509152","605226","TEAM Flash Disk 32GB T193, USB 3.2 (prachotěsné, vodotěsné, nárazuvzdorné)","131.50","181.00","TEG","1.50","48.00","0.000000","0.000","120 Měsíc(ů)","TEAMGROUP","131.00","160.00","21.00","TT193332GF01","true","10-49","Doprodej","TEAMGROUP","85235110","765441049130","TEAM Flash Disk 32GB T193, USB 3.2 (prachotěsné, vodotěsné, nárazuvzdorné)","Kapacita uložiště:32 GB; Verze USB:3.2","1","&lt;div class='wrap' style='background: none; margin: auto; padding: 0px; outline: 0px; border: 0px currentColor; text-align: left; color: #000000; text-transform: none; text-indent: 0px; letter-spacing: normal; font-size: 100%; font-style: normal; font-variant: normal; font-weight: 400; text-decoration: none; word-spacing: 0px; vertical-align: baseline; white-space: normal; max-width: 1150px; orphans: 2; -ms-text-size-adjust: none; -webkit-text-stroke-width: 0px;'&gt;  &lt;ul class='awardList' style='background: none; list-style: none; margin: 0px -1px; padding: 0px; outline: 0px; border: 0px currentColor; font-size: 100%; vertical-align: baseline; display: flex; -ms-text-size-adjust: none; flex-wrap: wrap;'&gt;  &lt;li style='background: none; margin: 0px; padding: 0px 1px 65px; outline: 0px; border: 0px currentColor; width: calc(25%); font-size: 100%; vertical-align: baseline; box-sizing: border-box; -ms-text-size-adjust: none;'&gt;  &lt;div class='item' style='background: none; margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; font-size: 100%; vertical-align: baseline; -ms-text-size-adjust: none;'&gt;  &lt;div class='Img' style='background: none; margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; font-size: 100%; vertical-align: baseline; position: relative; -ms-text-size-adjust: none;'&gt;  &lt;div class='imgBox' style='background: none; margin: 0px; padding: 10px; outline: 0px; border: 0px currentColor; width: 100%; height: 120px; font-size: 100%; vertical-align: baseline; display: flex; position: relative; box-sizing: border-box; -ms-text-size-adjust: none; justify-content: center; align-items: center;'&gt;&lt;a style='left: 0px; top: 0px; width: 100%; height: 100%; text-decoration: none; display: flex; position: absolute; z-index: 1; cursor: pointer; box-sizing: border-box; -ms-text-size-adjust: none; justify-content: center; align-items: center;'&gt;&lt;img style='background: none; margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; height: auto; font-size: 100%; vertical-align: baseline; max-height: 100%; max-width: 100%; -ms-text-size-adjust: none;' src='https://www.teamgroupinc.com/en/upload/product_award_pic/f77758f1e468cf686248fc01ac896581.jpg' alt='DESIGN AWARD' /&gt;&lt;/a&gt;&lt;/div&gt;  &lt;/div&gt;  &lt;div class='Txt' style='background: none; margin: 0px; padding: 25px 10px 0px; outline: 0px; border: 0px currentColor; text-align: center; font-size: 100%; vertical-align: baseline; -ms-text-size-adjust: none;'&gt;  &lt;h2 style='background: none; margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; font-size: 100%; vertical-align: baseline; -ms-text-size-adjust: none;'&gt;&lt;a style='color: #2b38a7; font-size: 18px; font-weight: 400; text-decoration: none; cursor: pointer; -ms-text-size-adjust: none;'&gt;DESIGN AWARD&lt;/a&gt;&lt;/h2&gt;  &lt;div class='awardDate' style='background: none; margin: 5px 0px 0px; padding: 0px; outline: 0px; border: 0px currentColor; color: #999999; font-size: 14px; vertical-align: baseline; -ms-text-size-adjust: none;'&gt;2020-05-19&lt;/div&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;/li&gt;  &lt;/ul&gt;  &lt;/div&gt;  &lt;p&gt;&lt;strong&gt;USB Flash Drive 3.2 | T193&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Features&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Taiwan Utility Model Patent (No. M581756)&lt;/li&gt;  &lt;li&gt;Taiwan Design Patent (No. D199855)&lt;/li&gt;  &lt;li&gt;Practical, multifunctional design&lt;/li&gt;  &lt;li&gt;Only 7.2cm after folding. Easy to stow.&lt;/li&gt;  &lt;li&gt;USB 3.2 Gen 1 (3.0/3.1) transfer interface&lt;/li&gt;  &lt;li&gt;Supports hot swap&lt;/li&gt;  &lt;li&gt;Lifetime warranty and free technical support&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;strong&gt;The perfect interpretation of trending creativity and practicality&lt;br /&gt;&lt;/strong&gt;The T193 Stationery Flash Drive subverts the people’s stereotype of flash drives. The look is both stylish and creative. In addition, the ergonomic product design and the multifunctional stationery are specially made for students and office workers. It interprets the innovative fashion sense perfectly.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Multifunctional stationery design&lt;/strong&gt;&lt;br /&gt;The T193 Stationery Flash Drive has Taiwan Utility Model Patent M581756, Design Patent D199855 and it is an innovative flash drive that combines multifunctional stationery design. The creatively designed magnet and magnifying glass are suitable for office workers; The functions of ruler, compasses and protractor are great for helping students to measure mathematical geometry and achieve learning objectives easily.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Easy to stow, fold and carry&lt;/strong&gt;&lt;br /&gt;The convenience to carry around the T193 Stationery Flash Drive is thoughtfully considered. The unfolded length is 12cm and only 7.2cm after folding. The magnetic feature can easily organize the paper clips scattered on the desktop. In addition, it can be firmly attached to the wall of office cubicle/fridge/iron pencil case to avoid data damage caused by accidental collisions.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;USB 3.2 Gen 1 (3.0/3.1) high speed transfer interface&lt;/strong&gt;&lt;br /&gt;Not only the one-piece body is forged with top class zinc alloy, but the T193 Stationery Flash Drive also uses USB 3.2 Gen 1 (3.0/3.1) high speed transfer interface to greatly reducing the time for file transfer and accessing. The USB 3.2 flash drive with 128GB high storage capacity can satisfy the need for file backup or large multimedia file transfer.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Protection function is upgraded again&lt;/strong&gt;&lt;br /&gt;The T193 Stationery Flash Drive uses COB (Chip on Board) assembly process to offer data protection functions such as dustproof, waterproof, shockproof, etc. The solid durability makes sure that the flash drive and the data are not easily damaged or lost due to external impact during use or carrying.&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;TECHNICAL SPECIFICATIONS&lt;/p&gt;  &lt;table dir='LTR' border='1' width='880' cellspacing='0' cellpadding='2'&gt;  &lt;tbody&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Model&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;T193&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Interface&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;USB 3.2 Gen 1 (3.0/3.1)&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Capacity&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;32GB&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Color&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;Nickel Black&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Data Transfer Rate&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;Read: 90MB/s Max&lt;br /&gt;Write: 35MB/s Max&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Dimensions (L x W x H)&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;72 x 24 x 4.6 mm&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Weight&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;19g&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Voltage&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;DC+5V&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Warranty&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;Lifetime warranty&lt;/td&gt;  &lt;/tr&gt;  &lt;/tbody&gt;  &lt;/table&gt;  &lt;p&gt; &lt;/p&gt;","false","9","00010314","11462","-1","true","","-1","-1","true","120","Měsíc(ů)","","0001-01-01T00:00:0