urrentColor; font-size: 100%; vertical-align: baseline; -ms-text-size-adjust: none;'&gt;&lt;a style='color: #2b38a7; font-size: 18px; font-weight: 400; text-decoration: none; cursor: pointer; -ms-text-size-adjust: none;'&gt;CENA ZA DIZAJN&lt;/a&gt;&lt;/h2&gt; &lt;div class='awardDate' style='background: none; margin: 5px 0px 0px; padding: 0px; outline: 0px; border: 0px currentColor; color: #999999; font-size: 14px; vertical-align: baseline; -ms-text-size-adjust: none;'&gt;2020-05-19&lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/li&gt; &lt;/ul&gt; &lt;/div&gt; &lt;p&gt;&lt;strong&gt;USB Flash disk 3.2 | T193&lt;/strong&gt; &lt;p&gt;&lt;strong&gt;Funkcie&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Taiwanský patent úžitkového vzoru (č. M581756)&lt;/li&gt; &lt;li&gt;Taiwanský patent na dizajn (č. D199855)&lt;/li&gt; &lt;li&gt;Praktický, multifunkčný dizajn&lt;/li&gt; &lt;li&gt;Iba 7.2 cm po zložení. Ľahko sa ukladá.&lt;/li&gt; &lt;li&gt;USB 3.2 Gen 1 (3.0/3.1) prenosové rozhranie&lt;/li&gt; &lt;li&gt;Podporuje výmenu za prevádzky&lt;/li&gt; &lt;li&gt;Doživotná záruka a bezplatná technická podpora&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;  &lt;p&gt;&lt;strong&gt;Dokonalá interpretácia trendovej kreativity a praktickosti&lt;br/&gt;&lt;/strong&gt;T193 Stationery Flash Drive vyvracia stereotypné predstavy ľudí o flash diskoch. Vzhľad je štýlový a kreatívny. Okrem toho sú ergonomický dizajn výrobkov a multifunkčné písacie potreby špeciálne vyrobené pre študentov a kancelárskych pracovníkov. Dokonale interpretuje inovatívny zmysel pre módu. &lt;p&gt;&lt;strong&gt;Multifunkčný dizajn pre písacie potreby&lt;/strong&gt;&lt;br/&gt;T193 Stationery Flash Drive má taiwanský patent na úžitkový vzor M581756, patent na dizajn D199855 a je to inovatívny flash disk, ktorý kombinuje multifunkčný dizajn pre písacie potreby. Kreatívne navrhnutý magnet a lupa sú vhodné pre kancelárskych pracovníkov; funkcie pravítka, kružidla a uhlomeru sú skvelé na pomoc študentom pri meraní matematickej geometrie a jednoduchom dosahovaní vzdelávacích cieľov. &lt;p&gt;&lt;strong&gt;Ľahko sa ukladá, skladá a prenáša&lt;/strong&gt;&lt;br/&gt;Pohodlie pri prenášaní T193 Stationery Flash Drive je premyslené. Rozložená dĺžka je 12 cm a iba 7.2 cm po zložení. Vďaka magnetickej funkcii môžete ľahko usporiadať kancelárske sponky roztrúsené na pracovnej ploche. Okrem toho ho možno pevne pripevniť na stenu kancelárskej skrine/chladničky/železnej ceruzky, aby sa zabránilo poškodeniu údajov spôsobenému náhodnými nárazmi. &lt;p&gt;&lt;strong&gt;USB 3.2 Gen 1 (3.0/3.&lt;strong&gt;1) vysokorýchlostné prenosové rozhranie&lt;/strong&gt;&lt;br/&gt;Nielenže je jednodielne telo vykované z prvotriednej zliatiny zinku, ale T193 Stationery Flash Drive využíva aj USB 3.2 Gen 1 (3.0/3.1) vysokorýchlostné prenosové rozhranie na výrazné skrátenie času na prenos súborov a prístup k nim. USB 3.2 flash disk s vysokou kapacitou 128 GB dokáže uspokojiť potrebu zálohovania súborov alebo prenosu veľkých multimediálnych súborov. &lt;p&gt;&lt;strong&gt;Funkcia ochrany je opäť vylepšená&lt;/strong&gt;&lt;br/&gt;Stacionárny flash disk T193 využíva proces montáže COB (Chip on Board), ktorý ponúka funkcie ochrany dát, ako je odolnosť proti prachu, vode, nárazom atď. Pevná odolnosť zaručuje, že sa flash disk a dáta počas používania alebo prenášania ľahko nepoškodia ani nestratia v dôsledku vonkajších nárazov. &lt;p&gt;  &lt;p&gt;TECHNICKÉ ŠPECIFIKÁCIE &lt;table dir='LTR' border='1' width='880' cellspacing='0' cellpadding='2'&gt; &lt;tbody&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Model&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;T193&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Rozhranie&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;USB 3.2 Gen 1 (3.0/3.1)&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Kapacita&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;64 GB&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Farba&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;Čierny nikel&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Rýchlosť prenosu údajov&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;Čítanie: 90 MB/s Max.&lt;br/&gt;Zápis: 35 MB/s Max&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Rozmery (D x Š x V)&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;72 x 24 x 4.6 mm&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Hmotnosť&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;19g&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Napätie&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;DC+5V&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Záruka&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;Doživotná záruka&lt;/td&gt; &lt;/tr&gt; &lt;/tbody&gt; &lt;/table&gt; &lt;p&gt; .","false","0","00010314","11462","-1","true","","-1","-1","true","120","Měsíc(ů)","","0001-01-01T00:00:00","203.00","KS","0.00","8","2020-06-06T02:08:42.067","TEG","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1509\/1509158_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1509\/1509158_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1509\/1509158_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1509\/1509158_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1509\/1509158_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1509\/1509158_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1509\/1509158