B Flash Drive 3.2 | T193&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Features&lt;/strong&gt;&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Taiwan Utility Model Patent (No. M581756)&lt;/li&gt;  &lt;li&gt;Taiwan Design Patent (No. D199855)&lt;/li&gt;  &lt;li&gt;Practical, multifunctional design&lt;/li&gt;  &lt;li&gt;Only 7.2cm after folding. Easy to stow.&lt;/li&gt;  &lt;li&gt;USB 3.2 Gen 1 (3.0/3.1) transfer interface&lt;/li&gt;  &lt;li&gt;Supports hot swap&lt;/li&gt;  &lt;li&gt;Lifetime warranty and free technical support&lt;/li&gt;  &lt;/ul&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;strong&gt;The perfect interpretation of trending creativity and practicality&lt;br /&gt;&lt;/strong&gt;The T193 Stationery Flash Drive subverts the people’s stereotype of flash drives. The look is both stylish and creative. In addition, the ergonomic product design and the multifunctional stationery are specially made for students and office workers. It interprets the innovative fashion sense perfectly.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Multifunctional stationery design&lt;/strong&gt;&lt;br /&gt;The T193 Stationery Flash Drive has Taiwan Utility Model Patent M581756, Design Patent D199855 and it is an innovative flash drive that combines multifunctional stationery design. The creatively designed magnet and magnifying glass are suitable for office workers; The functions of ruler, compasses and protractor are great for helping students to measure mathematical geometry and achieve learning objectives easily.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Easy to stow, fold and carry&lt;/strong&gt;&lt;br /&gt;The convenience to carry around the T193 Stationery Flash Drive is thoughtfully considered. The unfolded length is 12cm and only 7.2cm after folding. The magnetic feature can easily organize the paper clips scattered on the desktop. In addition, it can be firmly attached to the wall of office cubicle/fridge/iron pencil case to avoid data damage caused by accidental collisions.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;USB 3.2 Gen 1 (3.0/3.1) high speed transfer interface&lt;/strong&gt;&lt;br /&gt;Not only the one-piece body is forged with top class zinc alloy, but the T193 Stationery Flash Drive also uses USB 3.2 Gen 1 (3.0/3.1) high speed transfer interface to greatly reducing the time for file transfer and accessing. The USB 3.2 flash drive with 128GB high storage capacity can satisfy the need for file backup or large multimedia file transfer.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Protection function is upgraded again&lt;/strong&gt;&lt;br /&gt;The T193 Stationery Flash Drive uses COB (Chip on Board) assembly process to offer data protection functions such as dustproof, waterproof, shockproof, etc. The solid durability makes sure that the flash drive and the data are not easily damaged or lost due to external impact during use or carrying.&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;TECHNICAL SPECIFICATIONS&lt;/p&gt;  &lt;table dir='LTR' border='1' width='880' cellspacing='0' cellpadding='2'&gt;  &lt;tbody&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Model&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;T193&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Interface&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;USB 3.2 Gen 1 (3.0/3.1)&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Capacity&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;128GB&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Color&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;Nickel Black&lt;/td&gt;  &lt;/tr&gt;  &lt;tr&gt;  &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Data Transfer Rate&lt;/strong&gt;&lt;/td&gt;  &lt;td width='74%' height='19'&gt;Read: 90MB/s Max&