&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;div class='desc'&gt;&lt;h2&gt;Bleskový přenos souborů&lt;/h2&gt;&lt;p&gt;Neztrácejte čas. Nejnovější standard rozhraní USB 3.1 poskytuje rychlost čtení až 400 MB/s*, takže vás už od práce ani zábavy nebude nic zdržovat. Například 3GB video v 4K UHD kvalitě z flash disku BAR Plus zkopírujete do svého počítače během 10 sekund.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;figure class='box-img'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_1513/1513498_6b.jpg' alt='Obr. Rafinovaná odolnost 1513498b' /&gt;&lt;/figure&gt;&lt;div class='desc'&gt;&lt;h2&gt;Rafinovaná odolnost&lt;/h2&gt;&lt;p&gt;Je stylový a odolný zároveň. Díky svému kovovému tělu spolehlivě ochrání vaše soubory. Navíc jej snadno upevníte na klíče, takže se nemusíte obávat, že ho zapomenete. BAR Plus je spojením dechberoucího designu a vysoké spolehlivosti.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;figure class='box-img'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_1513/1513498_6c.jpg' alt='Obr. Pětinásobná ochrana 1513498c' /&gt;&lt;/figure&gt;&lt;div class='desc'&gt;&lt;h2&gt;Pětinásobná ochrana&lt;/h2&gt;&lt;p&gt;Vaše data budou vždy v naprostém bezpečí – kdekoliv. Špičkové technologie a bohaté zkušenosti s výrobou flash disků společnosti Samsung činí z BAR Plus mimořádně spolehlivé úložiště. Odolává vodě*, nárazům**, extrémním teplotám***, magnetům**** i rentgenovému záření*****. A to vše s pětiletou zárukou******.&lt;/p&gt;&lt;p&gt;* Až po dobu 72 hodin v mořské vodě. ** Až do zrychlení 1 500 g. *** Provozní teploty -25 °C až 85 °C, neprovozní -40°C až 85°C. **** Až do 15 000 gaussů (srovnatelné s magnetickou rezonancí). ***** Až do 50 rentgenů (srovnatelné s letištním rentgenem). ****** Společnost Samsung nenese odpovědnost za jakékoliv škody, ztrátu dat nebo náklady způsobené obnovou dat. Pro více informací o záruce navštivte www.samsung.com/support&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;",