.cz/IMGCACHE/_1513/1513506_6b.jpg' alt='Obr. Nechejte ho zapojený 1513506b' /&gt;&lt;/figure&gt;&lt;div class='desc'&gt;&lt;h2&gt;Nechejte ho zapojený&lt;/h2&gt;&lt;p&gt;Získejte úložiště, které budete mít vždy k dispozici. Kompaktní FIT Plus při zapojení do vašeho zařízení nijak nepřekáží a současně vám poskytne více prostoru pro data. Do notebooku, chytré TV nebo i automobilu ho díky jeho designu zapojíte bez obav, že byste o něj omylem zavadili.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;div class='desc'&gt;&lt;h2&gt;Vždy připraven k přenosu&lt;/h2&gt;&lt;p&gt;Nemusíte šetřit místem. A naopak ušetříte svůj čas. Nejnovější standard rozhraní USB 3.1 poskytuje rychlost čtení až 200 MB/s1, takže vás při přenosu dat nebude nic zdržovat. Například 3GB video ve 4K UHD kvalitě z flash disku FIT Plus zkopírujete do svého počítače během 10 sekund.2 Na dosah tak budete mít mnohem více filmů, her i hudby.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;figure class='box-img'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_1513/1513506_6c.jpg' alt='Obr. Pětinásobná ochrana 1513506c' /&gt;&lt;/figure&gt;&lt;div class='desc'&gt;&lt;h2&gt;Pětinásobná ochrana&lt;/h2&gt;&lt;p&gt;Vaše data budou vždy v naprostém bezpečí – kdekoliv. Prvotřídní technologie a bohaté zkušenosti s výrobou flash disků společnosti Samsung činí z FIT Plus mimořádně spolehlivé úložiště. Odolává vodě, nárazům, extrémním teplotám, magnetům i rentgenovému záření. A to vše s pětiletou zárukou.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;","false","0","000100960018","10988","-1","true","","-1","-1","true","5","Rok(ů)","","0001-01-01T00:00:00","164.00","KS","0.00","4","2020-04-17T08:25:52.353","SAM","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1513\/1513506_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1513\/1513506_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1513\/1513506_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1513\/1513506_0d_3.jpg