t;div class='row'&gt;&lt;div class='desc'&gt;&lt;p&gt;USB-C / 3.1 Flash Disk 32GB&lt;br /&gt; Použití pro PC, Notebooky, Telefony&lt;br /&gt; Přenosová rychost: až 200MB/s&lt;br /&gt; Rozměry: 57,9 X 18,3 X 7,3 mm&lt;br /&gt; Váha: 10,0 g&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;figure class='box-img'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_1513/1513510_6a.jpg' alt='Obr. Dva flash disky v jednom 1513510a' /&gt;&lt;/figure&gt;&lt;div class='desc'&gt;&lt;h2&gt;Dva flash disky v jednom&lt;/h2&gt;&lt;p&gt;Seznamte se s dvojnásobně užitečným flash diskem. DUO Plus využívá rozhraní USB-C a současně disponuje konektorem typu A. Takže se nemusíte obávat nedostatečné kompatibility se staršími zařízeními. DUO Plus u nich k rychlému přenosu a uložení dat využijete stejně snadno jako u těch nových.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;figure class='box-img'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_1513/1513510_6b.jpg' alt='Obr. Zapojíte ho vždy napoprvé 1513510b' /&gt;&lt;/figure&gt;&lt;div class='desc'&gt;&lt;h2&gt;Zapojíte ho vždy napoprvé&lt;/h2&gt;&lt;p&gt;Nezáleží na tom, jakým směrem ho připojujete. DUO Plus je vybaven univerzálním konektorem USB-C, takže ke svému zařízení ho můžete zapojit jakkoliv. Žádné nepraktické otáčení už vás nečeká. Pouze snadný přenos souborů mezi různými přístroji s USB-C porty, ať už to jsou smartphony, tablety, nebo notebooky.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;figure class='box-img'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_1513/1513510_6c.jpg' alt='Obr. Dvojnásobná konektivita 1513510c' /&gt;&lt;/figure&gt;&lt;div class='desc'&gt;&lt;h2&gt;Dvojnásobná konektivita&lt;/h2&gt;&lt;p&gt;DUO Plus je jeden flash disk pro několik zařízení. Připojíte ho k portům USB-C i USB-A, takže snadno uvolníte místo, vytvoříte zálohu nebo přenesete soubory z různých přístrojů. A získáte více prostoru pro filmy, hudbu nebo hry.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;div class='desc'&gt;&lt;h2&gt;Rychlý a všestranný&lt;/h2&gt;&lt;p&gt;I velký objem dat přenesete s DUO Plus během několika sekund. Díky mimořádně výkonnému rozhraní USB 3.1 dosahuje flash disk rychlosti čtení až 200 MB/s. Navíc je zpětně kompatibilní s USB 3.0 a 2.0, takže jeho výkon využijete u mnoha různých zařízení.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class='row'&gt;&lt;figure class='box-img'&gt;&lt;img src='https://c.edsystem.cz/IMGCACHE/_1513/1513510_6d.jpg' alt='Obr. Pětinásobná ochrana 1513510d' /&gt;&lt;/figure&gt;&lt;div class='desc'&gt;&lt;h2&gt;Pětinásobná ochrana&lt;/h2&gt;&lt;p&gt;Vaše data budou vždy v naprostém bezpečí – kdekoliv. Prvotřídní technologie a bohaté zkušenosti s výrobou flash disků společnosti Samsung činí z DUO Plus mimořádně spolehlivé úložiště. Odolává vodě, nárazům, extrémním teplotám, magnetům i rentgenovému záření. A to vše s pětiletou zárukou.&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;","false","0","000100960018","10988","-1","true","","-1","-1","true","5","Rok(ů)","","0001-01-01T00:00:00","304.00","KS","0.00","5","2020-04-17T08:36:06.657","SAM","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1513\/1513510_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1513\/1513510_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1513\/1513510_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1513\/1513510_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1513\/1513510_0e_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8692'},'1':{'AttributeCode':'896','ValueCode':'11011'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.022','length':'15.5','width':'10.5','height':'1'},'1':{'typ':'PACK','count':'100','weight':'3.82','length':'37','width':'30','height':'28'},'2':{'typ':'PACK','count':'5','weight':'0.151','length':'17','width':'5.5','height':'11.5'}}","N","","false",""),("1513511","1061586","Samsung USB-C / 3.1 Flash Disk 64GB","406.50","498.00","SAM","1.50","90.00","0.000000","0.000","5 Rok(ů)","SAM