'JEDN','count':'1','weight':'0.021','length':'15','width':'10','height':'0.5'},'1':{'typ':'PACK','count':'100','weight':'3.823','length':'37','width':'30','height':'27'},'2':{'typ':'PACK','count':'5','weight':'0.149','length':'16.5','width':'11.5','height':'5'}}","N","","false",""),("1517673","443595","Kingston Flash Disk 128GB DataTraveler microDuo3 G2 (USB 3.0)","118.50","210.00","KIF","1.50","90.00","0.000000","0.000","5 Rok(ů)","KINGSTON FLASH","119.00","137.00","21.00","DTDUO3G2/128GB","true","50-99","Doprodej","Kingston","85235110","740617306750","Kingston Flash Disk 128GB DataTraveler microDuo3 G2 (USB 3.0)","Kapacita uložiště:128 GB; Verze USB:3.0","1","&lt;h1&gt;DataTraveler microDuo3 G2&lt;/h1&gt;  &lt;p&gt;&lt;em&gt;Flash disk s konektorem microUSB a USB typu A pro Android OTG&lt;/em&gt;&lt;/p&gt;  &lt;p&gt;Rozšíření úložného prostoru pro tablety a chytré telefony.&lt;/p&gt;  &lt;p&gt;Flash disky Kingston DataTraveler microDuo nabízejí další úložný prostor v malém, pohodlném provedení pro tablety a chytré telefony, které podporují funkci USB OTG (On-The-Go). Standard USB OTG přímé připojení tabletů a chytrých telefonů k podporovaným USB zařízením.&lt;br /&gt;Flash disky DataTraveler microDuo umožňují použití portů microUSB, které se často používají pro nabíjení zařízení, aby posloužily k rozšíření paměti až o 128 GB*. DTDUO3G2 je ideální pro ukládání velkých souborů, které potřebujete mít k dispozici na cestách, a nabízí funkci plug-and-play pro tablety a chytré telefony se systémem Android™ bez portů microSD za nižší cenu za GB než vestavěné úložiště na mobilním zařízení.&lt;br /&gt;U chytrých telefonů a tabletů, které zaznamenávají video v rozlišení 4K a pořizují fotografie s vyšším rozlišením, se volný prostor na těchto zařízeních spotřebuje značně rychleji. Flash disky DTDUO3G2 uživatelům umožňují přenášet soubory, fotografie, videa a další – bez připojení k počítači – a daný obsah tak přemístit nebo zazálohovat. Sdílení velkých souborů mezi mobilními zařízeními je jednodušší než používání online cloudových služeb a k přenosu dat mezi zařízením a počítačem není potřeba používat kabel.&lt;br /&gt;Flash disky DT microDuo jsou malé, lehké a snadno se vejdou do kapsy. Jejich elegantní design bude slušet každému mobilnímu zařízení. Přiložené víčko chrání konektor microUSB před poškozením.&lt;/p&gt;  &lt;p&gt;• Rozšíření úložného prostoru pro tablety a chytré telefony s podporou funkce USB OTG&lt;br /&gt;• Dvojité rozhraní funguje s porty USB typu A a microUSB&lt;br /&gt;• Snadné sdílení souborů mezi mobilními zařízeními bez potřeby kabelů nebo Wi-Fi&lt;br /&gt;• Malé provedení pro snadnou přenositelnost&lt;/p&gt;  &lt;p&gt;&lt;span style='color: #999999;'&gt;* Část z uvedené kapacity paměťového zařízení flash je využita na formátování a další funkce a proto není k dispozici pro úložný prostor. Z toho důvodu je vlastní kapacita dostupná pro ukládání dat nižší než kapacita uvedená na produktech. Další informace naleznete v Průvodci paměťovými zařízeními flash od společnosti Kingston na adrese kingston.com/flashguide.&lt;/span&gt;&lt;/p&gt;","false","9","000101810007","6029","-1","true","00020093","4192","-1","true","5","Rok(ů)","","0001-01-01T00:00:00","119.00","KS","77.00","4","2020-05-22T16:33:51.1","KIN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1517\/1517673_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1517\/1517673_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1517\/1517673_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1517\/1517673_0d_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8768'},'1':{'AttributeCode':'896','ValueCode':'11009'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.011','length':'12','width':'11','height':'0.5'},'1':{'typ':'PACK','count':'25','weight':'0.349','length':'17.5','width':'12.5','height':'12'}}","N","","false",""),("1519517","443598","Kingston Flash Disk 32GB DataTraveler DT70 (USB-C)","61.50","111.00","KIF","1.50","48.00","0.000000","0.000","3 Rok(ů)"