2 GB; Verze USB:3.0","1","&lt;p&gt;Přenosné úložiště na cesty. Flash disk SanDisk Ultra Flair 512GB černá je výtečným nástrojem pro zálohu a transport nejrůznějších dat mezi mnoha počítači. Může se chlubit kapacitou paměti 512 GB. K vámi zvolenému zařízení se připojuje prostřednictvím USB 3,2 Gen 1 (USB 3,0). Bezpečnost zaručuje důkladné šifrování dat. S flash diskem SanDisk Ultra Flair 512GB černá poskytujete vašim datům nejlepší možnou ochranu.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Významné přednosti SanDisk Ultra Flair 512GB černá&lt;/strong&gt;&lt;br /&gt;černá/stříbrná barva bude ve spojení s tímto flash diskem krásně vynikat&lt;br /&gt;Načítání o rychlosti až 150 MB/s&lt;br /&gt;S využitím poutka jde flash disk připevnit k vašim klíčům&lt;br /&gt;SanDisk Ultra Flair 512GB černá je možné se připojit prostřednictvím USB 3,2 Gen 1 (USB 3,0)&lt;br /&gt;Flash disk s kapacitou 512 GB&lt;br /&gt;Data jsou chráněna pokročilým šifrováním&lt;br /&gt;Tělo z kovu zvyšuje odolnost&lt;br /&gt;Vzhled flash disku SanDisk&lt;br /&gt;Současné provedení flash disku dodává vzezření vhodné ozdoby. Šikovné poutko jej dovolí uchytit k vaší klíčence nebo do peněženky. Solidní konstrukce zaručí dlouhou dobu životnosti a taky vysokou spolehlivost. Konkrétní míry se rovnají 13 × 6,6 × 43 mm.&lt;/p&gt;","false","1","000101570008","7253","-1","true","","-1","-1","true","60","Měsíc(ů)","","0001-01-01T00:00:00","916.00","KS","0.00","4","2020-07-01T12:17:20.08","SAN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1521\/1521214_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1521\/1521214_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1521\/1521214_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1521\/1521214_0d_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'9375'},'1':{'AttributeCode':'896','ValueCode':'11009'}}","{'0':{'typ':'JEDN','count':'1','weight':'0','length':'0','width':'0','height':'0'}}","N","","false",""),("1521215","493295","SanDisk Flash Disk 512GB Ultra Lux