 256-bit šifrování AES)","Kapacita uložiště:128 GB; Verze USB:3.0","1","&lt;h1&gt;DataTraveler 4000G2 managed&lt;/h1&gt;  &lt;p&gt;&lt;em&gt;Chraňte citlivá data s pomocí 256bitového šifrování AES.&lt;/em&gt;&lt;/p&gt;  &lt;p&gt;USB flash disk Kingston DataTraveler 4000G2 managed nabízí cenově dostupné zabezpečení úrovně business-grade s 256bitovým hardwarovým šifrováním AES v režimu XTS pro 100% ochranu vašich důvěrných dat. Poskytuje společnostem většinou běžně požadovaných způsobů zabezpečení pro USB. Další úrovní zabezpečení je, že disk povinně vyžaduje ochranu složitým heslem a po 10 neúspěšných pokusech o proniknutí se disk zablokuje a přeformátuje, a že disk funguje v režimu přístupu pouze pro čtení (prostřednictvím SafeConsole), což umožňuje vyhnout se potenciálním rizikům malwaru.&lt;/p&gt;  &lt;p&gt;DT4000G2DM nabízí správu pomocí SafeConsole* (dodává se samostatně), která umožňuje použití celé sady nástrojů pro správu společně se serverovou technologií řídicího centra SafeConsole. Správci IT mohou centrálně spravovat USB disky tak, aby splňovaly požadavky dodržování pravidel a poskytovat vysokou úroveň podpory.  Aktivace je jednoduchá a umožňuje pracovníkům IT dálkově ovládat nastavená hesla, konfigurovat je společně se zásadami pro správu zařízení, aktivovat audity dodržování pravidel atd. Tyto výkonné nástroje zjednodušují integraci disku, ovládání a správu i ve vzdálených lokacích.&lt;/p&gt;  &lt;p&gt;DataTraveler 4000G2DM je certifikován podle FIPS 140-2 úroveň 3 a zajišťuje shodu s TAA, takže plní často požadované firemní a vládní požadavky na zabezpečení IT. Firemní uživatelé si mohou přizpůsobit disky tak, aby splňovaly interní firemní požadavky IT. Firemní logo, serializace, počet pokusů o zadání hesla, minimální délka hesla a přizpůsobitelné identifikátory produktu pro integraci do standardního softwaru pro správu (bílý seznam) jsou dostupné prostřednictvím přizpůsobení.&lt;/p&gt;  &lt;p&gt;Technologie USB 3.0 znamená, že uživatelé nemusí snižovat rychlosti přenosu pro zvýšení zabezpečení a mohou bezpečně ukládat data a přistupovat k nim pomocí technologie SuperSpeed.&lt;/p&gt;  &lt;p&gt;• Cenově dostupné zabezpečení podnikové třídy&lt;br /&gt;• Nabízí správu SafeConsole**&lt;br /&gt;• Certifikace FIPS 140-2 úrovně 3 a shoda s TAA&lt;br /&gt;• Přizpůsobitelné podle specifických interních požadavků na IT prostředí&lt;br /&gt;• Technologie SuperSpeed (USB 3.0)&lt;/p&gt;  &lt;p&gt;&lt;br /&gt;&lt;span style='color: #999999;'&gt;*Server SafeConsole Secure USB se správou verze 5.0.1+&lt;/span&gt;&lt;br /&gt;&lt;span style='color: #999999;'&gt;**Server SafeConsole Secure USB se správou verze 5.0.1+, dodává se samostatně.&lt;/span&gt;&lt;/p&gt;","false","0","000101810007","6029","-1","true","00020093","4192","-1","true","5","Rok(ů)","","0001-01-01T00:00:00","6888.00","KS","0.00","4","2020-07-27T14:28:11.877","KIN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1524\/1524253_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1524\/1524253_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1524\/1524253_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1524\/1524253_0d_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8768'},'1':{'AttributeCode':'896','ValueCode':'11009'}}","{'0':{'typ':'JEDN','count':'1','weight':'0','length':'0','width':'0','height':'0'}}","N","","false",""),("1524256","443605","Kingston Flash Disk 128GB DataTraveler DT80 (USB-C 3.2 Gen 1)","343.50","435.00","KIF","1.50","90.00","0.000000","0.000","3 Rok(ů)","KINGSTON FLASH","349.00","362.00","21.00","DT80/128GB","true","1,00","","Kingston","85235110","740617306422","Kingston Flash Disk 128GB DataTraveler DT80 (USB-C 3.2 Gen 1)","Kapacita uložiště:128 GB; Verze USB:USB Type-C","1","&lt;h1&gt;Flash disk USB-C DataTraveler 80&lt;/h1&gt;  &lt;p&gt;&lt;em&gt;Přenosné vysokorychlostní úložiště pro všechna zařízení typu C&lt;/em&gt;&lt;/p&gt;  &lt;p&gt;Disk DataTraveler 80 značky Kingston je vysoce výkonný USB flash disk, který podporuje no