SB:3.2","1","&lt;h1&gt;USB flash disk DataTraveler Exodia&lt;/h1&gt;  &lt;p&gt;&lt;em&gt;s ochranným víčkem a klíčenkou v různých barvách&lt;/em&gt;&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Snadný přístup a rychlé přenosy každý den&lt;/strong&gt;&lt;/p&gt;  &lt;p&gt;Disk DataTraveler Exodia značky Kingston je vybavena výkonným rozhraním USB 3.2 1. generace, které zajišťuje snadný přístup k notebookům, stolním počítačům, monitorům a dalším digitálním zařízením. Disk DT Exodia umožňuje rychlé přenosy a praktické ukládání dokumentů, hudby, videí a dalšího. Disk má praktickou konstrukci a módní barevné provedení. Díky tomu je ideální pro každodenní využití v práci, domácnosti, ve škole a vlastně kdekoli, kam potřebujete svá data odnést. Disk DT Exodia je k dispozici s kapacitou až 256GB* a získáte k němu pětiletou záruku, bezplatnou technickou podporu a pověstnou spolehlivost značky Kingston.&lt;/p&gt;  &lt;p&gt;• Velké barevné oko se snadno zavěsí na klíče&lt;br /&gt;• USB zástrčku chrání praktické víčko&lt;br /&gt;• Různá barevná provedení podle capacity&lt;/p&gt;  &lt;p&gt;&lt;span style='color: #999999;'&gt;* Část z uvedené kapacity paměťového zařízení flash je využita na formátování a další funkce a proto není k dispozici pro úložný prostor. Z toho důvodu je vlastní kapacita dostupná pro ukládání dat nižší než kapacita uvedená na produktech. Další informace naleznete v Průvodci paměťovými zařízeními flash od společnosti Kingston na adrese kingston.com/flashguide.&lt;/span&gt;&lt;/p&gt;","false","0","000101810007","6029","-1","true","00020093","4192","-1","true","5","Rok(ů)","","0001-01-01T00:00:00","62.00","KS","0.00","6","2020-09-21T09:48:21.603","KIN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1529\/1529823_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1529\/1529823_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1529\/1529823_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1529\/1529823_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1529