ariadeniami. Rastúcu popularitu tohto riešenia potvrdzuje aj skutočnosť, že výrobcovia novej generácie notebookov, smartfónov, osobných počítačov a ďalších zariadení čoraz častejšie vybavujú svoje produkty ďalším konektorom 'C' popri štandardnom konektore typu A alebo volia iba konektor typu C™. GOODRAM OTG ODA je vynikajúce riešenie, ktoré bude fungovať so starými aj novými elektronickými zariadeniami generácie notebookov, smartfónov a PC. Flash disk ODA je vybavený dvoma rýchlymi rozhraniami USB 3.2 konektory: jeden štandardný typ A a typ C™, čo znamená, že prenos dát medzi zariadeniami rôznych generácií nebol nikdy taký jednoduchý a rýchly. &lt;p&gt;&lt;strong&gt;Najvyššia kvalita = doživotná záruka&lt;br/&gt;&lt;/strong&gt;Pri výrobe ODA používame len tie najlepšie komponenty a počas výrobného procesu výrobok prechádza viacstupňovými testami a prísnou kontrolou kvality. Vďaka tomu sa na ODA vzťahuje doživotná záruka výrobcu. &lt;br/&gt; &lt;p&gt;TECHNICKÉ ŠPECIFIKÁCIE &lt;table dir='LTR' border='1' width='880' cellspacing='0' cellpadding='2'&gt; &lt;tbody&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Kapacita&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;16 GB&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Farba&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;Sivler&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Rozhranie&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;USB 3.2 gen 1 typ A spätne kompatibilný s USB 3.1 / 3.0 / 2.0 / 1.1; USB typu C™&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Rýchlosť prevádzky&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;čítanie: do 60 MB/s&lt;br/&gt;zápis: do 20 MB/s&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width