,"595.00","KS","3.00","4","2021-07-15T09:59:54.637","TRN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1583\/1583197_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1583\/1583197_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1583\/1583197_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1583\/1583197_0d_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'9375'},'1':{'AttributeCode':'896','ValueCode':'11010'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.018','length':'13','width':'10.5','height':'1'}}","N","","false",""),("1591876","443640","Kingston Flash Disk 1TB USB3.2 Gen 2 DataTraveler Max","2093.50","2185.00","KIF","1.50","90.00","0.000000","0.000","5 Rok(ů)","KINGSTON FLASH","2103.00","2602.00","21.00","DTMAX/1TB","true","6,00","","Kingston","85235110","740617322354","Kingston Flash Disk 1TB USB3.2 Gen 2 DataTraveler Max","Kapacita uložiště:1 TB; Verze USB:3.2","1","&lt;p&gt;DataTraveler Max značky Kingston je vysoce výkonný flash disk USB Type-C&lt;span style='color: #999999;'&gt;&lt;sup&gt;1&lt;/sup&gt;&lt;/span&gt;, který využívá nejnovější standard rozhraní USB 3.2 2. generace pro rekordní rychlost čtení/zápisu až 1000/900 MB/s&lt;sup&gt;&lt;span style='color: #999999;'&gt;2&lt;/span&gt;&lt;/sup&gt;. Jedinečné pouzdro s prolisem, navržené s ohledem na přenosnost a pohodlí, chrání konektor, když ho nepoužíváte, a lze ho snadno přesunout jediným pohybem. DT Max nabízí špičkový výkon a rozšířené kapacity až 1 TB&lt;sup&gt;&lt;span style='color: #999999;'&gt;3&lt;/span&gt;&lt;/sup&gt;, což z něj činí ideální řešení pro přenos a ukládání velkých digitálních souborů, jako jsou fotografie v rozlišení HD, videa v rozlišení 4K/8K, hudba a další.&lt;/p&gt;  &lt;p&gt;DT Max se opírá o pětiletou omezenou záruku, bezplatnou technickou podporu a pověstnou spolehlivost značky Kingston.&lt;/p&gt;  &lt;p&gt;• Pokročilý USB disk s rozhraním USB 3.2 Type-C&lt;sup&gt;&lt;span style='color: #999999;'&gt;1&lt;/span&gt;&lt;/sup&gt; 2. generace&lt;br /&gt;•