ná dostupná kapacita je menšia ako kapacita uvedená na výrobkoch. &lt;/td&gt; &lt;/tr&gt; &lt;/tbody&gt; &lt;/table&gt; &lt;p&gt; .","false","10","0001013300070003","8609","-1","true","","-1","-1","true","60","Měsíc(ů)","","0001-01-01T00:00:00","120.00","KS","0.00","5","2021-11-02T15:02:00.653","ADT","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603394_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603394_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603394_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603394_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1603\/1603394_0e_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8767'},'1':{'AttributeCode':'896','ValueCode':'11008'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.013','length':'11.5','width':'10','height':'1'}}","N","","false",""),("1608155","985160","TRANSCEND Flash Disk 128GB JetFlash®920, TLC, USB 3.2 (R:420/W:400 MB/s) černý","551.50","643.00","TRN","1.50","90.00","0.000000","0.000","5 Rok(ů)","TRANSCEND","579.00","693.00","21.00","TS128GJF920","true","5,00","","Transcend","85235110","0760557846949","TRANSCEND Flash Disk 128GB JetFlash®920, TLC, USB 3.2 (R:420/W:400 MB/s) černý","Kapacita uložiště:128 GB; Verze USB:3.2","1","&lt;p&gt;Predstavujeme vám vysoko odolný a výkonný USB flash disk JetFlash 920 od spoločnosti Transcend, ktorý nie je obyčajný. Vďaka senzačným rýchlostiam čítania až 420 MB/s a zápisu až 400 MB/s poskytuje JetFlash 920 špičkový výkon v elegantnom a prenosnom dizajne. Jeho hliníkové kovové puzdro ochráni vaše &lt;span style='color: #000000;'&gt;údaje, nech ste kdekoľvek.&lt;/span&gt;                         &lt;/span&gt; &lt;h3&gt;&lt;span style='color: #000000;'&gt;Nie je to váš bežný USB flash disk&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;&lt;span style='color: #000000;'&gt; &lt;/span&gt; &lt;p style='color: #ffffff;'&gt;&lt;span style='color: #000000;'&gt;JetFlash 920 môže vyzerať ako bežný USB kľúč, ale jeho výkon presahuje výkon bežných flash diskov. Vďaka rýchlosti čítania až 420 MB/s a rýchlosti zápisu až 400 MB/s môžete na disk preniesť 4 GB za menej ako 15 sekúnd. Jednoducho ho pripojte a v okamihu prenesiete všetky svoje filmy v rozlíšení 4K a obrázky vo vysokom rozlíšení.&lt;/span&gt; &lt;p style='color: #ffffff;'&gt;&lt;span style='color: #000000;'&gt;&lt;small&gt;&lt;span style='font-size: small;'&gt;Poznámka: Disk JetFlash 920 sa dodáva predformátovaný vo formáte súborov FAT32 pre čo najširšiu kompatibilitu. Ak chcete preniesť jeden súbor väčší ako 4 GB, musíte disk preformátovať na iný formát, napríklad exFAT. &lt;/span&gt;&lt;/small&gt;&lt;/span&gt; &lt;h3&gt;&lt;span style='color: #000000;'&gt;Výdrž tam, kde je to dôležité&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;&lt;span style='color: #000000;'&gt; &lt;/span&gt; &lt;p style='color: #ffffff;'&gt;&lt;span style='color: #000000;'&gt;Náročné každodenné používanie si vyžaduje USB s trvalou účinnosťou a odolnosťou. Či už potrebujete denne prenášať množstvo grafiky/videí v HD rozlíšení, alebo používate USB na aplikácie náročné na zápis, ako je napríklad úložisko pre zabudovanú palubnú kameru v niektorých vozidlách EV, môžete sa spoľahnúť na Transcend JetFlash 920, ktorý všetko zvládne bez problémov! Tieto disky s vysokou životnosťou majú 10-krát dlhšiu životnosť ako bežné disky TLC USB. JetFlash 920 určite uchová vaše dôležité údaje v bezpečí a neporušené.&lt;/span&gt; &lt;p style='color: #ffffff;'&gt;  &lt;h3&gt;&lt;span style='color: #000000;'&gt;Kovový lesk&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;&lt;span style='color: #000000;'&gt; &lt;/span&gt; &lt;p&gt;&lt;span style='color: #000000;'&gt;Chráňte svoje údaje pomocou pamäte JetFlash 920 od spoločnosti Transcend, ktorej hliníkové kovové puzdro s pieskovanou povrchovou úpravou je rovnako robustné ako elegantné. Vysoko prenosný neznamená krehký, aspoň nie v prípade JetFlash 920, ktorého odolná konštrukcia ponúka špičkovú ochranu vašich dát zvnútra aj zvonku.&lt;/span&gt; &lt;h3&gt;&lt;span style='color: #000000;'&gt;Obrovská úložná kapacita&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;&lt;span style='color: #000000;'&gt; &lt;/span&gt; &lt;p&gt;&lt;span style='color: #000000;'&gt;Disk JetFlash 920 sa dodáva v priestranných úložiskách s kapacitou až 512 GB, čo vám umožní prenášať, ukladať a zdieľať súbory ľahšie ako kedykoľvek predtým.&lt;/span&gt; &lt;h3&gt;&lt;span style='color: #000000;'&gt;Ideálne na cesty&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;&lt;span style='color: #000000;'&gt; &lt;/span&gt; &lt;p style='color: #ffffff;'&gt;&lt;span style='color: #000000;'&gt;K dispozícii je otvor na šnúrku na pripevnenie zariadenia na kufor alebo tašky, vďaka čomu je JetFlash 920 ľahko dostupný a zároveň vyzerá moderne. Súčasťou balenia je krytka na ochranu konektora USB pred náhodným poškodením.&lt;/span&gt; &lt;p style='color: #ffffff;'&gt;&lt;span style='color: #000000;'&gt;&lt;small&gt;&lt;span style='font-size: small;'&gt;Poznámka: Šnúrka nie je súčasťou balenia.&lt;/span&gt;&lt;/small&gt;&lt;/span&gt; &lt;p style='color: #ffffff;'&gt;  &lt;h3&gt;Špecifikácie:&lt;/h3&gt; &lt;table class='table-responsive table-spec' border='0' width='100%' cellspacing='0' cellpadding='0'&gt; &lt;tbody&gt; &lt;tr&gt; &lt;td class='table-spec-group' colspan='2'&gt; &lt;h4&gt;Vzhľad&lt;/h4&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;Rozmery&lt;/th&gt; &lt;td class='product_spec_detail' width='70%'&gt;62 mm x 20 mm x 7.8 mm (2.44' x 0.79' x 0.3')&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;Hmotnosť&lt;/th&gt; &lt;td class='product_spec_detail' width='70%'&gt;10 g (0.35 oz)&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_horizon'&gt;Farba&lt;/span&gt;&lt;/th&gt; &lt;td class='product_spec_detail product_spec_item_horizon_exe' width='70%'&gt; &lt;ul&gt; &lt;li&gt;&lt;span class='color-text'&gt;Vesmírne šedá&lt;/span&gt;&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td class='table-spec-group' colspan='2'&gt; &lt;h4&gt;Rozhranie&lt;/h4&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_horizon'&gt;Rozhranie pripojenia&lt;/span&gt;&lt;/th&gt; &lt;td class='product_spec_detail product_spec_item_horizon_exe' width='70%'&gt; &lt;ul&gt; &lt;li&gt;USB 3.2 Gen 1&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_horizon'&gt;Typ USB&lt;/span&gt;&lt;/th&gt; &lt;td class='product_spec_detail product_spec_item_horizon_exe' width='70%'&gt; &lt;ul&gt; &lt;li&gt;USB typu A&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td class='table-spec-group' colspan='2'&gt; &lt;h4&gt;Úložisko&lt;/h4&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_horizon'&gt;Kapacita&lt;/span&gt;&lt;/th&gt; &lt;td class='product_spec_detail product_spec_item_horizon_exe' width='70%'&gt; &lt;ul&gt; &lt;li&gt;128 GB/&lt;/li&gt; &lt;li&gt;256 GB/&lt;/li&gt; &lt;li&gt;512 GB&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;Poznámka&lt;/th&gt; &lt;td class='product_spec_detail' width='70%'&gt; &lt;ul&gt; &lt;li&gt;Upozorňujeme, že skutočná kapacita sa môže líšiť od kapacity uvedenej na výrobku, pretože časť kapacity sa používa na systémové súbory a údržbu úložiska.&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td class='table-spec-group' colspan='2'&gt; &lt;h4&gt;Výkon&lt;/h4&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;Rýchlosť čítania (max.)&lt;/th&gt; &lt;td class='product_spec_detail' width='70%'&gt;až 420 MB/s&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;Rýchlosť zápisu (max.)&lt;/th&gt; &lt;td class='product_spec_detail' width='70%'&gt;až do 400 MB/s&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_list'&gt;Poznámka&lt;/span&gt;&lt;/th&gt; &lt;td class='product_spec_detail product_spec_item_list_exe' width='70%'&gt; &lt;ul style='list-style: none; margin: 0px;'&gt; &lt;li&gt;Rýchlosť sa môže líšiť v závislosti od hardvéru hostiteľa, softvéru, používania a kapacity úložiska.&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td class='table-spec-group' colspan='2'&gt; &lt;h4&gt;Záruka&lt;/h4&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_horizon'&gt;Certifikát&lt;/span&gt;&lt;/th&gt; &lt;td class='product_spec_detail product_spec_item_horizon_exe' width='70%'&gt; &lt;ul&gt; &lt;li&gt;CE/&lt;/li&gt; &lt;li&gt;FCC/&lt;/li&gt; &lt;li&gt;BSMI/&lt;/li&gt; &lt;li&gt;KC/&lt;/li&gt; &lt;li&gt;RCM/&lt;/li&gt; &lt;li&gt;EAC&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;Záruka&lt;/th&gt; &lt;td class='product_spec_detail' width='70%'&gt; &lt;ul&gt; &lt;li&gt;Päťročná obmedzená záruka&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td class='table-spec-group' colspan='2'&gt; &lt;h4&gt;Požiadavky na systém&lt;/h4&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_list'&gt;Operačný systém&lt;/span&gt;&lt;/th&gt; &lt;td class='product_spec_detail product_spec_item_list_exe' width='70%'&gt; &lt;ul&gt; &lt;li&gt;Microsoft Windows 7&lt;/li&gt; &lt;li&gt;Microsoft Windows 8&lt;/li&gt; &lt;li&gt;Microsoft Windows 10&lt;/li&gt; &lt;li&gt;Mac OS 9.0 alebo neskôr&lt;/li&gt; &lt;li&gt;Jadro Linuxu 2.4.2 alebo neskôr&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;/tbody&gt; &lt;/table&gt; &lt;p&gt; .","false","0","0001025800020018","9762","-1","true","","-1","-1","true","5","Rok(ů)","","0001-01-01T00:00:00","579.00","KS","5.00","11","2021-12-22T15:46:44.353","TRN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1608\/1608155_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1608\/1608155_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1608\/1608155_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1608\/1608155_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_