 vo vysokom rozlíšení.&lt;/span&gt; &lt;p style='color: #ffffff;'&gt;&lt;span style='color: #000000;'&gt;&lt;small&gt;&lt;span style='font-size: small;'&gt;Poznámka: Disk JetFlash 920 sa dodáva predformátovaný vo formáte súborov FAT32 pre čo najširšiu kompatibilitu. Ak chcete preniesť jeden súbor väčší ako 4 GB, musíte disk preformátovať na iný formát, napríklad exFAT. &lt;/span&gt;&lt;/small&gt;&lt;/span&gt; &lt;h3&gt;&lt;span style='color: #000000;'&gt;Výdrž tam, kde je to dôležité&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;&lt;span style='color: #000000;'&gt; &lt;/span&gt; &lt;p style='color: #ffffff;'&gt;&lt;span style='color: #000000;'&gt;Náročné každodenné používanie si vyžaduje USB s trvalou účinnosťou a odolnosťou. Či už potrebujete denne prenášať množstvo grafiky/videí v HD rozlíšení, alebo používate USB na aplikácie náročné na zápis, ako je napríklad úložisko pre zabudovanú palubnú kameru v niektorých vozidlách EV, môžete sa spoľahnúť na Transcend JetFlash 920, ktorý všetko zvládne bez problémov! Tieto disky s vysokou životnosťou majú 10-krát dlhšiu životnosť ako bežné disky TLC USB. JetFlash 920 určite uchová vaše dôležité údaje v bezpečí a neporušené.&lt;/span&gt; &lt;p style='color: #ffffff;'&gt;  &lt;h3&gt;&lt;span style='color: #000000;'&gt;Kovový lesk&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;&lt;span style='color: #000000;'&gt; &lt;/span&gt; &lt;p&gt;&lt;span style='color: #000000;'&gt;Chráňte svoje údaje pomocou pamäte JetFlash 920 od spoločnosti Transcend, ktorej hliníkové kovové puzdro s pieskovanou povrchovou úpravou je rovnako robustné ako elegantné. Vysoko prenosný neznamená krehký, aspoň nie v prípade JetFlash 920, ktorého odolná konštrukcia ponúka špičkovú ochranu vašich dát zvnútra aj zvonku.&lt;/span&gt; &lt;h3&gt;&lt;span style='color: #000000;'&gt;Obrovská úložná kapacita&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;&lt;span style='color: #000000;'&gt; &lt;/span&gt; &lt;p&gt;&lt;span style='color: #000000;'&gt;Disk JetFlash 920 sa dodáva v priestranných úložiskách s kapacitou až 512 GB, čo vám umožní prenášať, ukladať a zdieľať súbory ľahšie ako kedykoľvek predtým.&lt;/span&gt; &lt;h3&gt;&lt;span style='color: #000000;'&gt;Ideálne na cesty&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;&lt;span style='color: #000000;'&gt; &lt;/span&gt; &lt;p style='color: #ffffff;'&gt;&lt;span style='color: #000000;'&gt;K dispozícii je otvor na šnúrku na pripevnenie zariadenia na kufor alebo tašky, vďaka čomu je JetFlash 920 ľahko dostupný a zároveň vyzerá moderne. Súčasťou balenia je krytka na ochranu konektora USB pred náhodným poškodením.&lt;/span&gt; &lt;p style='color: #ffffff;'&gt;&lt;span style='color: #000000;'&gt;&lt;small&gt;&lt;span style='font-size: small;'&gt;Poznámka: Šnúrka nie je súčasťou balenia.&lt;/span&gt;&lt;/small&gt;&lt;/span&gt; &lt;p style='color: #ffffff;'&gt;  &lt;h3&gt;Špecifikácie:&lt;/h3&gt; &lt;table class='table-responsive table-spec' border='0' width='100%' cellspacing='0' cellpadding='0'&gt; &lt;tbody&gt; &lt;tr&gt; &lt;td class='table-spec-group' colspan='2'&gt; &lt;h4&gt;Vzhľad&lt;/h4&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;Rozmery&lt;/th&gt; &lt;td class='product_spec_detail' width='70%'&gt;62 mm x 20 mm x 7.8 mm (2.44' x 0.79' x 0.3')&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;Hmotnosť&lt;/th&gt; &lt;td class='product_spec_detail' width='70%'&gt;10 g (0.35 oz)&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_horizon'&gt;Farba&lt;/span&gt;&lt;/th&gt; &lt;td class='product_spec_detail product_spec_item_horizon_exe' width='70%'&gt; &lt;ul&gt; &lt;li&gt;&lt;span class='color-text'&gt;Vesmírne šedá&lt;/span&gt;&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td class='table-spec-group' colspan='2'&gt; &lt;h4&gt;Rozhranie&lt;/h4&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_horizon'&gt;Rozhranie pripojenia&lt;/span&gt;&lt;/th&gt; &lt;td class='product_spec_detail product_spec_item_horizon_exe' width='70%'&gt; &lt;ul&gt; &lt;li&gt;USB 3.2 Gen 1&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_horizon'&gt;Typ USB&lt;/span&gt;&lt;/th&gt; &lt;td class='product_spec_detail product_spec_item_horizon_exe' width='70%'&gt; &lt;ul&gt; &lt;li&gt;USB typu A&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td class='table-spec-group' colspan='2'&gt; &lt;h4&gt;Úložisko&lt;/h4&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_horizon'&gt;Kapacita&lt;/span&gt;&lt;/th&gt; &lt;td class='product_spec_detail product_spec_item_horizon_exe' width='70%'&gt; &lt;ul&gt; &lt;li&gt;128 GB/&lt;/li&gt; &lt;li&gt;256 GB/&lt;/li&gt; &lt;li&gt;512 GB&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;Poznámka&lt;/th&gt; &lt;td class='product_spec_detail' width='70%'&gt; &lt;ul&gt; &lt;li&gt;Upozorňujeme, že skutočná kapacita sa môže líšiť od kapacity uvedenej na výrobku, pretože časť kapacity sa používa na systémové súbory a údržbu úložiska.&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td class='table-spec-group' colspan='2'&gt; &lt;h4&gt;Výkon&lt;/h4&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;Rýchlosť čítania (max.)&lt;/th&gt; &lt;td class='product_spec_detail' width='70%'&gt;až 420 MB/s&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;Rýchlosť zápisu (max.)&lt;/th&gt; &lt;td class='product_spec_detail' width='70%'&gt;až do 400 MB/s&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_list'&gt;Poznámka&lt;/span&gt;&lt;/th&gt; &lt;td class='product_spec_detail product_spec_item_list_exe' width='70%'&gt; &lt;ul style='list-style: none; margin: 0px;'&gt; &lt;li&gt;Rýchlosť sa môže líšiť v závislosti od hardvéru hostiteľa, softvéru, používania a kapacity úložiska.&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td class='table-spec-group' colspan='2'&gt; &lt;h4&gt;Záruka&lt;/h4&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_horizon'&gt;Certifikát&lt;/span&gt;&lt;/th&gt; &lt;td class='product_spec_detail product_spec_item_horizon_exe' width='70%'&gt; &lt;ul&gt; &lt;li&gt;CE/&lt;/li&gt; &lt;li&gt;FCC/&lt;/li&gt; &lt;li&gt;BSMI/&lt;/li&gt; &lt;li&gt;KC/&lt;/li&gt; &lt;li&gt;RCM/&lt;/li&gt; &lt;li&gt;EAC&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;Záruka&lt;/th&gt; &lt;td class='product_spec_detail' width='70%'&gt; &lt;ul&gt; &lt;li&gt;Päťročná obmedzená záruka&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td class='table-spec-group' colspan='2'&gt; &lt;h4&gt;Požiadavky na systém&lt;/h4&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_list'&gt;Operačný systém&lt;/span&gt;&lt;/th&gt; &lt;td class='product_spec_detail product_spec_item_list_exe' width='70%'&gt; &lt;ul&gt; &lt;li&gt;Microsoft Windows 7&lt;/li&gt; &lt;li&gt;Microsoft Windows 8&lt;/li&gt; &lt;li&gt;Microsoft Windows 10&lt;/li&gt; &lt;li&gt;Mac OS 9.0 alebo neskôr&lt;/li&gt; &lt;li&gt;Jadro Linuxu 2.4.2 alebo neskôr&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;/tbody&gt; &lt;/table&gt; &lt;p&gt; .","false","0","0001025800020018","9762","-1","true","","-1","-1","true","5","Rok(ů)","","0001-01-01T00:00:00","898.00","KS","0.00","11","2021-12-22T15:48:07.903","TRN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1608\/1608156_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1608\/1608156_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1608\/1608156_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1608\/1608156_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1608\/1608156_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1608\/1608156_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1608\/1608156_0g_3.jpg','7':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1608\/1608156_0h_3.jpg','8':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1608\/1608156_0i_3.jpg','9':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1608\/1608156_0j_3.jpg','10':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1608\/1608156_0k_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'9374'},'1':{'AttributeCode':'896','ValueCode':'18978'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.018','length':'13','width':'11','height':'1'}}","N","","false",""),("1608157","985162","TRANSCEND Flash Disk 128GB JetFlash®930C, TLC, USB 3.2/USB Type C (R:420/W:400 MB/s) černý","586.50","678.00","TRN","1.50","90.00","0.000000","0.000","5 Rok(ů)","TRANSCEND","617.00","738.00","21.00","TS128GJF930C","true","4,00","","Transcend","85235110","0760557850328","TRANSCEND Flash Disk 128GB JetFlash®930C, TLC, USB 3.2/USB Type C (R:420/W:400 MB/s) černý","Kapacita uložiště:128 GB; Verze USB:3.2, USB Type-C","1","&lt;div id='Page_Head_rich_title'&gt; &lt;div class='products jumbotron hidden-xs' style='background: url('https://CDN.transcend-info.com/products/images/ModelPic/1185/RC-JF930C-banner.jpg') no-repeat center / cover;'&gt; &lt;div class='container'&gt; &lt;h1 class='hidden-sm'&gt;disk 2 v 1: zdvojnásobte možnosti pripojenia.&lt;/h1&gt; &lt;h2&gt;USB 3.2 Gen 1/3.1. generácia 1&lt;/h2&gt; &lt;p&gt;JetFlash 930C &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class='container pages product_detail general category'&gt; &lt;h1&gt;USB 3.2 Gen 1/3.1. generácia 1&lt;/h1&gt; &lt;div&gt; &lt;div class='row product_general_header'&gt; &lt;div id='Content_PL_MoreView'&gt; &lt;div class='col-sm-6 product_imagemultiple'&gt; &lt;div id='myCarousel' class='carousel slide' data-ride='carousel'&gt; &lt;div class='carousel-inner'&gt; &lt;div class='item active'&gt;&lt;img src='https://cdn.transcend-info.com/products/images/ModelPic/1185/PP_JF930C-1.png' alt='' /&gt;&lt;/div&gt; &lt;/div&gt; &lt;div id='Content_pic_dist'&gt;&lt;a class='left carousel-control' href='https://cz.transcend-info.com/Products/No-1185#myCarousel' data-slide='prev'&gt;&lt;img src='https://cz.transcend-info.com/images/product_image_left.png' alt='' /&gt;&lt;/a&gt; &lt;a class='right carousel-control' href='https://cz.transcend-info.com/Products/No-1185#myCarousel' data-slide='next'&gt;&lt;img src='https://cz.transcend-info.com/images/product_image_right.png' alt='' /&gt;&lt;/a&gt;&lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class='col-sm-6 product_general_intro'&gt; &lt;h2&gt;JetFlash 930C&lt;/h2&gt; &lt;p&gt;  &lt;p&gt;Flash disk JetFlash 930C od spoločnosti Transcend je vybavený dvojitým konektorom, ktorý podporuje zariadenia USB typu A a typu C. S rozhraním USB 3.2 Gen 1 a zabudovanou pamäťou 3D NAND flash dosahuje rýchlosť až 420 MB/s. Vysoká kapacita až 512 GB vytvára dostatočný úložný priestor pre multimediálne súbory a herné súbory. Ak hľadáte prenosné a štýlové úložné zariadenie na hranie hier, JetFlash 930C od spoločnosti Transcend je to pravé! &lt;p&gt;  &lt;div class='sns'&gt; &lt;div style='line-height: 32px; margin-right: 10px; float: left;'&gt;Zdieľať&lt;/div&gt; &lt;div id='st-1' class='sharethis-inline-share-buttons st-left  st-inline-share-buttons st-animated' style='width: calc(4*48px); float: left;'&gt; &lt;div class='st-btn st-first' style='display: inline-block;' data-network='facebook'&gt;&lt;img src='https://platform-cdn.sharethis.com/img/facebook.svg' alt='facebook sharing button' /&gt;&lt;/div&gt; &lt;div class='st-btn' style='display: inline-block;' data-network='twitter'&gt;&lt;img src='https://platform-cdn.sharethis.com/img/twitter.svg' alt='twitter sharing button' /&gt;&lt;/div&gt; &lt;div class='st-btn' style='display: inline-block;' data-network='linkedin'&gt;&lt;img src='https://platform-cdn.sharethis.com/img/linkedin.svg' alt='linkedin sharing button' /&gt;&lt;/div&gt; &lt;div class='st-btn st-last' style='display: inline-block;' data-network='vk'&gt;&lt;img src='https://platform-cdn.sharethis.com/img/vk.svg' alt='vk sharing button' /&gt;&lt;/div&gt; &lt;/div&gt; &lt;div class='shareFloat'&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class='jumbotron  pages product_detail' style='background-position: center; background-image: url('https://CDN.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-BG-1.jpg'); background-color: #ffffff;'&gt; &lt;div class='container'&gt; &lt;div class='row product_feature_general '&gt; &lt;div class='col-md-6 product_feature_rich_content'&gt; &lt;h3&gt;&lt;span style='color: #ffffff;'&gt;Dvojitý konektor USB pre dvojnásobné pohodlie&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;  &lt;p style='color: #ffffff;'&gt;Flash disk JetFlash 930C je navrhnutý s duálnym konektorom, ktorý podporuje zariadenia USB typu A a typu C. Súbory môžete jednoducho prenášať medzi smartfónmi, počítačmi a dokonca aj hernými konzolami! &lt;p style='color: #ffffff;'&gt;&lt;small&gt;&lt;span style='font-size: small;'&gt;Poznámka: &lt;br/&gt;1. Konektory USB typu A a typu C nemožno používať súčasne. Mobilné zariadenia musia podporovať USB OTG.&lt;br/&gt;2. Na ukladanie hier a aplikácií z herných konzol do externého úložiska musia byť splnené určité požiadavky. Pred použitím skontrolujte kompatibilitu.&lt;/span&gt;&lt;/small&gt; &lt;p&gt;  &lt;/div&gt; &lt;div class='col-md-6 product_feature_rich_pic'&gt;&lt;img class='img-responsive' src='https://cdn.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-feature-1.png' alt='' /&gt;&lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class='jumbotron  pages product_detail' style='background-position: center; background-image: url('https://CDN.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-BG-2.jpg'); background-color: #ffffff;'&gt; &lt;div class='container'&gt; &lt;div class='row product_feature_general  col-reverse'&gt; &lt;div class='col-md-6 product_feature_rich_content'&gt; &lt;h3&gt;&lt;span style='color: #ffffff;'&gt;Bezkonkurenčné prenosové rýchlosti&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;  &lt;p style='color: #ffffff;'&gt;S pamäťou 3D NAND flash a rozhraním USB 3.jetFlash 930C od Transcend ponúka pokročilú technológiu, ktorá sa prejavuje v špičkovom výkone 420 MB/s pri čítaní a 400 MB/s pri zápise. Tento disk s vysokou výdržou má 10-krát dlhšiu životnosť ako bežný disk 3D NAND flash. Presuňte svoje herné súbory v okamihu! &lt;p&gt;  &lt;/div&gt; &lt;div class='col-md-6 product_feature_rich_pic'&gt;&lt;img class='img-responsive' src='https://cdn.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-feature-2.png' alt='' /&gt;&lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class='jumbotron  pages product_detail' style='background-position: center; background-image: url('https://CDN.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-BG-3.jpg'); background-color: #ffffff;'&gt; &lt;div class='container'&gt; &lt;div class='row product_feature_general '&gt; &lt;div class='col-md-6 product_feature_rich_content'&gt; &lt;h3&gt;&lt;span style='color: #ffffff;'&gt;Kovový lesk&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;  &lt;p style='color: #ffffff;'&gt;Flash disk JetFlash 930C od spoločnosti Transcend má hliníkové kovové puzdro žiariace jemným zlatým odtieňom. To znamená nielen pokročilú ochranu, ale aj elegantný a štýlový vzhľad aj pri hraní hier. &lt;p&gt;  &lt;/div&gt; &lt;div class='col-md-6 product_feature_rich_pic'&gt;&lt;img class='img-responsive' src='https://cdn.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-feature-3.png' alt='' /&gt;&lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class='jumbotron  pages product_detail' style='background-position: center; background-image: url('https://CDN.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-BG-4.jpg'); background-color: #ffffff;'&gt; &lt;div class='container'&gt; &lt;div class='row product_feature_general  col-reverse'&gt; &lt;div class='col-md-6 product_feature_rich_content'&gt; &lt;h3&gt;&lt;span style='color: #ffffff;'&gt;Obrovská úložná kapacita&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;  &lt;p style='color: #ffffff;'&gt;Flash disk JetFlash 930C ponúka kapacitu až 512 GB na podporu rôznych multimediálnych súborov a poskytuje úložný priestor, ktorý potrebujete. Herné súbory môžete prenášať, ukladať a zdieľať jednoduchšie ako kedykoľvek predtým! &lt;p&gt;  &lt;/div&gt; &lt;div class='col-md-6 product_feature_rich_pic'&gt;&lt;img class='img-responsive' src='https://cdn.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-feature-4.png' alt='' /&gt;&lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class='jumbotron  pages product_detail' style='background-position: center; background-image: url('https://CDN.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-BG-5.jpg'); background-color: #ffffff;'&gt; &lt;div class='container'&gt; &lt;div class='row product_feature_general '&gt; &lt;div class='col-md-6 product_feature_rich_content'&gt; &lt;h3&gt;&lt;span style='color: #ffffff;'&gt;Softvér s pridanou hodnotou&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;  &lt;p style='color: #ffffff;'&gt;Softvér na správu dát Transcend Elite, ktorý si môžete bezplatne stiahnuť z oficiálnej webovej stránky spoločnosti Transcend, je kompatibilný s operačným systémom Windows aj macOS. Transcend Elite ponúka funkcie zálohovania a obnovy, šifrovania dát a cloudového zálohovania, ktoré vám pomôžu udržať dôležité súbory organizované, chránené a aktuálne! &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;p&gt;&lt;br/&gt; &lt;p style='color: #ffffff;'&gt;Spoločnosť Transcend ponúka aj RecoveRx, bezplatný nástroj na obnovu dát, ktorý umožňuje hľadať stopy po vymazaných súboroch vrátane digitálnych fotografií, dokumentov, hudby a videí hlboko v úložnom zariadení. &lt;div class='jumbotron  pages product_detail' style='background-position: center; background-image: url('https://CDN.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-BG-5.jpg'); background-color: #ffffff;'&gt; &lt;div class='container'&gt; &lt;div class='row product_feature_general '&gt; &lt;div class='col-md-6 product_feature_rich_content'&gt; &lt;/div&gt; &lt;div class='col-md-6 product_feature_rich_pic'&gt;&lt;img class='img-responsive' src='https://cdn.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-feature-5.png' alt='' /&gt;&lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class='container pages product_detail general category'&gt;&lt;a name='anchor'&gt;&lt;/a&gt; &lt;div class='row product_spec'&gt; &lt;h3&gt;Špecifikácie&lt;/h3&gt; &lt;div class='col-md-12 center product_spec_pic'&gt;&lt;img class='img-responsive' src='https://cdn.transcend-info.com/products/images/ModelPic/1185/Spec_JF930C.png' alt='' /&gt;&lt;/div&gt; &lt;div class='col-md-8 col-md-offset-2'&gt; &lt;table class='table-responsive table-spec' border='0' width='100%' cellspacing='0' cellpadding='0'&gt; &lt;tbody&gt; &lt;tr&gt; &lt;td class='table-spec-group' colspan='2'&gt; &lt;h4&gt;Vzhľad&lt;/h4&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;Rozmery&lt;/th&gt; &lt;td class='product_spec_detail' width='70%'&gt;71.3 mm x 20 mm x 7.8 mm (2.81' x 0.79' x 0.31')&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;Hmotnosť&lt;/th&gt; &lt;td class='product_spec_detail' width='70%'&gt;11 g (0.39 oz)&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_horizon'&gt;Farba&lt;/span&gt;&lt;/th&gt; &lt;td class='product_spec_detail product_spec_item_horizon_exe' width='70%'&gt; &lt;ul&gt; &lt;li&gt;&lt;span class='color-text'&gt;Zlato&lt;/span&gt;&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td class='table-spec-group' colspan='2'&gt; &lt;h4&gt;Rozhranie&lt;/h4&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_horizon'&gt;Rozhranie pripojenia&lt;/span&gt;&lt;/th&gt; &lt;td class='product_spec_detail product_spec_item_horizon_exe' width='70%'&gt; &lt;ul&gt; &lt;li&gt;USB 3.2 Gen 1&lt;/li&gt; &lt;/ul&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;&lt;span class='product_spec_item_horizo