vojnásobte možnosti pripojenia.&lt;/h1&gt; &lt;h2&gt;USB 3.2 Gen 1/3.1. generácia 1&lt;/h2&gt; &lt;p&gt;JetFlash 930C &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class='container pages product_detail general category'&gt; &lt;h1&gt;USB 3.2 Gen 1/3.1. generácia 1&lt;/h1&gt; &lt;div&gt; &lt;div class='row product_general_header'&gt; &lt;div id='Content_PL_MoreView'&gt; &lt;div class='col-sm-6 product_imagemultiple'&gt; &lt;div id='myCarousel' class='carousel slide' data-ride='carousel'&gt; &lt;div class='carousel-inner'&gt; &lt;div class='item active'&gt;&lt;img src='https://cdn.transcend-info.com/products/images/ModelPic/1185/PP_JF930C-1.png' alt='' /&gt;&lt;/div&gt; &lt;/div&gt; &lt;div id='Content_pic_dist'&gt;&lt;a class='left carousel-control' href='https://cz.transcend-info.com/Products/No-1185#myCarousel' data-slide='prev'&gt;&lt;img src='https://cz.transcend-info.com/images/product_image_left.png' alt='' /&gt;&lt;/a&gt; &lt;a class='right carousel-control' href='https://cz.transcend-info.com/Products/No-1185#myCarousel' data-slide='next'&gt;&lt;img src='https://cz.transcend-info.com/images/product_image_right.png' alt='' /&gt;&lt;/a&gt;&lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class='col-sm-6 product_general_intro'&gt; &lt;h2&gt;JetFlash 930C&lt;/h2&gt; &lt;p&gt;  &lt;p&gt;Flash disk JetFlash 930C od spoločnosti Transcend je vybavený dvojitým konektorom, ktorý podporuje zariadenia USB typu A a typu C. S rozhraním USB 3.2 Gen 1 a zabudovanou pamäťou 3D NAND flash dosahuje rýchlosť až 420 MB/s. Vysoká kapacita až 512 GB vytvára dostatočný úložný priestor pre multimediálne súbory a herné súbory. Ak hľadáte prenosné a štýlové úložné zariadenie na hranie hier, JetFlash 930C od spoločnosti Transcend je to pravé! &lt;p&gt;  &lt;div class='sns'&gt; &lt;div style='line-height: 32px; margin-right: 10px; float: left;'&gt;Zdieľať&lt;/div&gt; &lt;div id='st-1' class='sharethis-inline-share-buttons st-left  st-inline-share-buttons st-animated' style='width: calc(4*48px); float: left;'&gt; &lt;div class='st-btn st-first' style='display: inline-block;' data-network='facebook'&gt;&lt;img src='https://platform-cdn.sharethis.com/img/facebook.svg' alt='facebook sharing button' /&gt;&lt;/div&gt; &lt;div class='st-btn' style='display: inline-block;' data-network='twitter'&gt;&lt;img src='https://platform-cdn.sharethis.com/img/twitter.svg' alt='twitter sharing button' /&gt;&lt;/div&gt; &lt;div class='st-btn' style='display: inline-block;' data-network='linkedin'&gt;&lt;img src='https://platform-cdn.sharethis.com/img/linkedin.svg' alt='linkedin sharing button' /&gt;&lt;/div&gt; &lt;div class='st-btn st-last' style='display: inline-block;' data-network='vk'&gt;&lt;img src='https://platform-cdn.sharethis.com/img/vk.svg' alt='vk sharing button' /&gt;&lt;/div&gt; &lt;/div&gt; &lt;div class='shareFloat'&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class='jumbotron  pages product_detail' style='background-position: center; background-image: url('https://CDN.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-BG-1.jpg'); background-color: #ffffff;'&gt; &lt;div class='container'&gt; &lt;div class='row product_feature_general '&gt; &lt;div class='col-md-6 product_feature_rich_content'&gt; &lt;h3&gt;&lt;span style='color: #ffffff;'&gt;Dvojitý konektor USB pre dvojnásobné pohodlie&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;  &lt;p style='color: #ffffff;'&gt;Flash disk JetFlash 930C je navrhnutý s duálnym konektorom, ktorý podporuje zariadenia USB typu A a typu C. Súbory môžete jednoducho prenášať medzi smartfónmi, počítačmi a dokonca aj hernými konzolami! &lt;p style='color: #ffffff;'&gt;&lt;small&gt;&lt;span style='font-size: small;'&gt;Poznámka: &lt;br/&gt;1. Konektory USB typu A a typu C nemožno používať súčasne. Mobilné zariadenia musia podporovať USB OTG.&lt;br/&gt;2. Na ukladanie hier a aplikácií z herných konzol do externého úložiska musia byť splnené určité požiadavky. Pred použitím skontrolujte kompatibilitu.&lt;/span&gt;&lt;/small&gt; &lt;p&gt;  &lt;/div&gt; &lt;div class='col-md-6 product_feature_rich_pic'&gt;&lt;img class='img-responsive' src='https://cdn.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-feature-1.png' alt='' /&gt;&lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class='jumbotron  pages product_detail' style='background-position: center; background-image: url('https://CDN.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-BG-2.jpg'); background-color: #ffffff;'&gt; &lt;div class='container'&gt; &lt;div class='row product_feature_general  col-reverse'&gt; &lt;div class='col-md-6 product_feature_rich_content'&gt; &lt;h3&gt;&lt;span style='color: #ffffff;'&gt;Bezkonkurenčné prenosové rýchlosti&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;  &lt;p style='color: #ffffff;'&gt;S pamäťou 3D NAND flash a rozhraním USB 3.jetFlash 930C od Transcend ponúka pokročilú technológiu, ktorá sa prejavuje v špičkovom výkone 420 MB/s pri čítaní a 400 MB/s pri zápise. Tento disk s vysokou výdržou má 10-krát dlhšiu životnosť ako bežný disk 3D NAND flash. Presuňte svoje herné súbory v okamihu! &lt;p&gt;  &lt;/div&gt; &lt;div class='col-md-6 product_feature_rich_pic'&gt;&lt;img class='img-responsive' src='https://cdn.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-feature-2.png' alt='' /&gt;&lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class='jumbotron  pages product_detail' style='background-position: center; background-image: url('https://CDN.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-BG-3.jpg'); background-color: #ffffff;'&gt; &lt;div class='container'&gt; &lt;div class='row product_feature_general '&gt; &lt;div class='col-md-6 product_feature_rich_content'&gt; &lt;h3&gt;&lt;span style='color: #ffffff;'&gt;Kovový lesk&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;  &lt;p style='color: #ffffff;'&gt;Flash disk JetFlash 930C od spoločnosti Transcend má hliníkové kovové puzdro žiariace jemným zlatým odtieňom. To znamená nielen pokročilú ochranu, ale aj elegantný a štýlový vzhľad aj pri hraní hier. &lt;p&gt;  &lt;/div&gt; &lt;div class='col-md-6 product_feature_rich_pic'&gt;&lt;img class='img-responsive' src='https://cdn.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-feature-3.png' alt='' /&gt;&lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class='jumbotron  pages product_detail' style='background-position: center; background-image: url('https://CDN.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-BG-4.jpg'); background-color: #ffffff;'&gt; &lt;div class='container'&gt; &lt;div class='row product_feature_general  col-reverse'&gt; &lt;div class='col-md-6 product_feature_rich_content'&gt; &lt;h3&gt;&lt;span style='color: #ffffff;'&gt;Obrovská úložná kapacita&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;  &lt;p style='color: #ffffff;'&gt;Flash disk JetFlash 930C ponúka kapacitu až 512 GB na podporu rôznych multimediálnych súborov a poskytuje úložný priestor, ktorý potrebujete. Herné súbory môžete prenášať, ukladať a zdieľať jednoduchšie ako kedykoľvek predtým! &lt;p&gt;  &lt;/div&gt; &lt;div class='col-md-6 product_feature_rich_pic'&gt;&lt;img class='img-responsive' src='https://cdn.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-feature-4.png' alt='' /&gt;&lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class='jumbotron  pages product_detail' style='background-position: center; background-image: url('https://CDN.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-BG-5.jpg'); background-color: #ffffff;'&gt; &lt;div class='container'&gt; &lt;div class='row product_feature_general '&gt; &lt;div class='col-md-6 product_feature_rich_content'&gt; &lt;h3&gt;&lt;span style='color: #ffffff;'&gt;Softvér s pridanou hodnotou&lt;/span&gt;&lt;/h3&gt; &lt;p&gt;  &lt;p style='color: #ffffff;'&gt;Softvér na správu dát Transcend Elite, ktorý si môžete bezplatne stiahnuť z oficiálnej webovej stránky spoločnosti Transcend, je kompatibilný s operačným systémom Windows aj macOS. Transcend Elite ponúka funkcie zálohovania a obnovy, šifrovania dát a cloudového zálohovania, ktoré vám pomôžu udržať dôležité súbory organizované, chránené a aktuálne! &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;p&gt;&lt;br/&gt; &lt;p style='color: #ffffff;'&gt;Spoločnosť Transcend ponúka aj RecoveRx, bezplatný nástroj na obnovu dát, ktorý umožňuje hľadať stopy po vymazaných súboroch vrátane digitálnych fotografií, dokumentov, hudby a videí hlboko v úložnom zariadení. &lt;div class='jumbotron  pages product_detail' style='background-position: center; background-image: url('https://CDN.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-BG-5.jpg'); background-color: #ffffff;'&gt; &lt;div class='container'&gt; &lt;div class='row product_feature_general '&gt; &lt;div class='col-md-6 product_feature_rich_content'&gt; &lt;/div&gt; &lt;div class='col-md-6 product_feature_rich_pic'&gt;&lt;img class='img-responsive' src='https://cdn.transcend-info.com/Products/images/ModelPic/1185/RC-JF930C-feature-5.png' alt='' /&gt;&lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;/div&gt; &lt;div class='container pages product_detail general category'&gt;&lt;a name='anchor'&gt;&lt;/a&gt; &lt;div class='row product_spec'&gt; &lt;h3&gt;Špecifikácie&lt;/h3&gt; &lt;div class='col-md-12 center product_spec_pic'&gt;&lt;img class='img-responsive' src='https://cdn.transcend-info.com/products/images/ModelPic/1185/Spec_JF930C.png' alt='' /&gt;&lt;/div&gt; &lt;div class='col-md-8 col-md-offset-2'&gt; &lt;table class='table-responsive table-spec' border='0' width='100%' cellspacing='0' cellpadding='0'&gt; &lt;tbody&gt; &lt;tr&gt; &lt;td class='table-spec-group' colspan='2'&gt; &lt;h4&gt;Vzhľad&lt;/h4&gt; &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;Rozmery&lt;/th&gt; &lt;td class='product_spec_detail' width='70%'&gt;71.3 mm x 20 mm x 7.8 mm (2.81' x 0.79' x 0.31')&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;th width='30%'&gt;Hmotnosť&lt;/th&gt; &