tal USB 3.2 Gen 1","185.50","277.00","KIF","1.50","90.00","0.000000","0.000","5 Rok(ů)","KINGSTON FLASH","186.00","220.00","21.00","DTMC3G2/64GB","true","100+","","Kingston","85235110","740617328066","Kingston Flash Disk 64GB DataTraveler Micro 200MB/s Metal USB 3.2 Gen 1","Kapacita uložiště:64 GB; Verze USB:3.2","1","&lt;h1&gt;Flash disk DataTraveler Micro USB &lt;br/&gt;s veľmi malým prémiovým kovovým dizajnom&lt;/h1&gt; &lt;p&gt;DataTraveler Micro je veľmi malý a ľahký disk USB, ktorý je ideálny na pohodlné ukladanie do zásuvky, kompatibilný s počítačmi, tlačiarňami, hernými konzolami a ďalšími zariadeniami. Disk je navrhnutý s nízkoprofilovým, prémiovým kovovým krytom a zabudovaným pútkom na kľúče, ktoré umožňuje ponechať v portoch USB bez rušenia. DT Micro poskytuje USB 3.2 Gen 1 s rýchlosťou čítania až 200 MB/s1 a kapacitou až 256 GB2 na rýchly prenos a ukladanie veľkých súborov, ako sú filmy, hudba, hry a fotografie. &lt;p&gt;- Mimoriadne malý, prémiový kovový dizajn&lt;br/&gt;- Rýchly prenos dát až do 200 MB/s1 pri čítaní&lt;br/&gt;- Vysoká kapacita úložiska až 256 GB2 &lt;h2&gt;Mimoriadne malá konštrukcia s možnosťou zapojenia a ponechania&lt;/h2&gt; &lt;p&gt;Nízkoprofilové, prémiové kovové puzdro navrhnuté tak, aby v porte USB nerušilo &lt;h2&gt;15x rýchlejší ako štandardný USB 2.0 diskov1&lt;/h2&gt; &lt;p&gt;Ukladajte a prenášajte obsah rýchlo vďaka vysokovýkonnému rozhraniu USB 3.2 rýchlosti čítania až do 200 MB/s1 &lt;h2&gt;Rozšírené kapacity&lt;/h2&gt; &lt;p&gt;Veľkokapacitné úložisko s kapacitou až 256 GB2, &lt;h2&gt;Špecifikácie&lt;/h2&gt; &lt;p&gt;&lt;strong&gt;Kapacity2&lt;/strong&gt;: 64 GB, 128 GB, 256 GB&lt;br/&gt;&lt;strong&gt;Rýchlosť1&lt;/strong&gt;: USB 3.2 Gen 1, 200 MB/s čítanie&lt;br/&gt;&lt;strong&gt;Rozmery&lt;/strong&gt;: 24.95 mm x 12.2 mm x 4.5 mm&lt;br/&gt;&lt;strong&gt;Prevádzková teplota&lt;/strong&gt;: 0 °C~60 °C&lt;br/&gt;&lt;strong&gt;Teplota skladovania&lt;/strong&gt;: -20 °C~85 °C&lt;br/&gt;&lt;strong&gt;Záruka/podpora&lt;/strong&gt;: Päťročná záruka, bezplatná technická podpora&lt;br/&gt;&lt;strong&gt;Kompatibilný s&lt;/strong&gt;: Windows 11, 10, 8.1, macOS (v.10.14.x +), Linux (v. 2.6.x +), Chrome OS™ &lt;p&gt;  &lt;hr /&gt; &lt;p&gt;  &lt;p&gt;&lt;span style='color: #999999;'&gt;1. Zápis je až 15x rýchlejší ako pri štandardnom USB 2.0 (4 MB/s). Rýchlosť sa môže líšiť v závislosti od hardvéru, softvéru a používania hostiteľa.&lt;/span&gt;&lt;br/&gt;&lt;span style='color: #999999;'&gt;2. Časť uvedenej kapacity pamäťového zariadenia Flash sa používa na formátovanie a iné funkcie, a preto nie je k dispozícii na ukladanie údajov. Skutočná dostupná kapacita na ukladanie údajov je preto menšia, ako je uvedené na výrobku. Ďalšie informácie nájdete v príručke o pamäti Flash spoločnosti Kingston.&lt;/span&gt;.","false","0","000101810007","6029","-1","true","00020093","4192","-1","true","5","Rok(ů)","","0001-01-01T00:00:00","186.00","KS","99","3","2022-05-23T11:16:25.24","KIN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1619\/1619500_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1619\/1619500_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1619\/1619500_0c_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8767'},'1':{'AttributeCode':'896','ValueCode':'18978'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.012','length':'14','width':'12','height':'2'},'1':{'typ':'PACK','count':'200','weight':'2.99','length':'38','width':'24.5','height':'14'},'2':{'typ':'PACK','count':'25','weight':'0.363','length':'12','width':'11','height':'9'}}","N","","false",""),("1619501","443671","Kingston Flash Disk 128GB DataTraveler Micro 200MB/s Metal USB 3.2 Gen 1","351.50","443.00","KIF","1.50","90.00","0.000000","0.000","5 Rok(ů)","KINGSTON FLASH","351.00","460.00","21.00","DTMC3G2/128GB","true","50-99","","Kingston","85235110","740617328028","Kingston Flash Disk 128GB DataTraveler Micro 200MB/s Metal USB 3.2 Gen 1","Kapacita uložiště:128 GB; Verze USB:3.2","1","&lt;h1&gt;DataTraveler Micro US