ue to host hardware, software and usage.&lt;/span&gt;&lt;br /&gt;&lt;span style='color: #999999;'&gt;2. Some of the listed capacity on a Flash storage device is used for formatting and other functions and thus is not available for data storage. As such, the actual available capacity for data storage is less than what is listed on the product. For more information go to Kingston's Flash Memory Guide.&lt;/span&gt;&lt;/p&gt;","false","0","000101810007","6029","-1","true","00020093","4192","-1","true","5","Rok(ů)","","0001-01-01T00:00:00","351.00","KS","51.00","3","2022-05-23T11:16:42.24","KIN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1619\/1619501_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1619\/1619501_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1619\/1619501_0c_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8768'},'1':{'AttributeCode':'896','ValueCode':'18978'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.012','length':'14','width':'12','height':'2'},'1':{'typ':'PACK','count':'25','weight':'0.341','length':'15','width':'14','height':'12'}}","N","","false",""),("1619502","443672","Kingston Flash Disk 256GB DataTraveler Micro 200MB/s Metal USB 3.2 Gen 1","636.50","728.00","KIF","1.50","90.00","0.000000","0.000","5 Rok(ů)","KINGSTON FLASH","639.00","795.00","21.00","DTMC3G2/256GB","true","100+","","Kingston","85235110","740617327984","Kingston Flash Disk 256GB DataTraveler Micro 200MB/s Metal USB 3.2 Gen 1","Kapacita uložiště:256 GB; Verze USB:3.2","1","&lt;h1&gt;DataTraveler Micro USB Flash Drive &lt;br /&gt;with Ultra-Small Premium Metal Design&lt;/h1&gt;  &lt;p&gt;DataTraveler Micro is an ultra-small, lightweight USB drive ideal for convenient plug-and-stay storage that’s compatible with computers, printers, gaming consoles and more. The drive is designed with a low-profile, premium metal casing and built-in key loop to leave in USB ports without interference. DT Micro delivers USB 3.2 Gen 1 speeds up to 200MB/s read1 and up to 256GB2 capacities to quickly transfer and store large files such as movies, music, games and photos.&lt;/p&gt;  &lt;p&gt;• Ultra-small, premium metal design&lt;br /&gt;• Fast data transfer speeds up to 200MB/s1 read&lt;br /&gt;• High capacity storage up to 256GB2&lt;/p&gt;  &lt;h2&gt;Ultra-small, plug-and-stay design&lt;/h2&gt;  &lt;p&gt;Low-profile, premium metal casing designed to leave in a USB port with little interference&lt;/p&gt;  &lt;h2&gt;15x faster than standard USB 2.0 drives1&lt;/h2&gt;  &lt;p&gt;Store and transfer content quickly with high-performance USB 3.2 speeds up to 200MB/s1 read&lt;/p&gt;  &lt;h2&gt;Expanded capacities&lt;/h2&gt;  &lt;p&gt;High capacity storage up to 256GB2,&lt;/p&gt;  &lt;h2&gt;Specifications&lt;/h2&gt;  &lt;p&gt;&lt;strong&gt;Capacities&lt;/strong&gt;2: 64GB, 128GB, 256GB&lt;br /&gt;&lt;strong&gt;Speed&lt;/strong&gt;1: USB 3.2 Gen 1, 200MB/s Read&lt;br /&gt;&lt;strong&gt;Dimensions&lt;/strong&gt;: 24.95mm x 12.2mm x 4.5mm&lt;br /&gt;&lt;strong&gt;Operating temperature&lt;/strong&gt;: 0°C~60°C&lt;br /&gt;&lt;strong&gt;Storage temperature&lt;/strong&gt;: -20°C~85°C&lt;br /&gt;&lt;strong&gt;Warranty/support&lt;/strong&gt;: Five-year warranty, free technical support&lt;br /&gt;&lt;strong&gt;Compatible with&lt;/strong&gt;: Windows 11, 10, 8.1, macOS (v.10.14.x +), Linux (v. 2.6.x +), Chrome OS™&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;hr /&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt;&lt;span style='color: #999999;'&gt;1. Write up to 15x faster than standard USB 2.0 drives (4MB/s). Speed may vary due to host hardware, software and usage.&lt;/span&gt;&lt;br /&gt;&lt;span style='color: #999999;'&gt;2. Some of the listed capacity on a Flash storage device is used for formatting and other functions and thus is not available for data storage. As such, the actual available capacity for data storage is less than what is listed on the product. For more information go to Kingston's Flash Memory Guide.&lt;/span&gt;&lt;/p&gt;","false","0","000101810007","6029","-1","true","00020093","4192","-1","true","5","Rok(ů)","","0001-01-01T00:00:00","639.00","KS","99","3","2022-05-23T11:16:59.293","KIN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1619\/1619502_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1619\/1619502_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1619\/1619502_0c_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'9374'},'1':{'AttributeCode':'896','ValueCode':'18978'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.012','length':'14','width':'12','height':'2'},'1':{'typ':'PACK','count':'25','weight':'0.363','length':'13','width':'12','height':'10'}}","N","","false",""),("1619859","443677","Kingston Flash Disk IronKey 8GB Vault Privacy 50 AES-256 Encrypted, FIPS 197","1018.50","1032.00","KIF","1.50","12.00","0.000000","0.000","60 Měsíc(ů)","KINGSTON FLASH","1033.00","1072.00","21.00","IKVP50/8GB","false","0,00","","Kingston","85235110","740617328950","Kingston Flash Disk IronKey 8GB Vault Privacy 50 AES-256 Encrypted, FIPS 197","Kapacita uložiště:8 GB; Verze USB:3.2","1","&lt;h1&gt;Šifrovaný USB flash disk Kingston IronKey Vault Privacy 50&lt;/h1&gt;  &lt;p&gt;Řada Kingston IronKey Vault Privacy 50 představuje špičkové USB disky, které poskytují zabezpečení na podnikové úrovni s 256bitovým hardwarovým šifrováním AES s certifikací FIPS 197 v režimu XTS, ochranu proti BadUSB s digitálně podepsaným firmwarem a ochranu proti útokům  na přístupové heslo hrubou silou. Řada VP50 je také kompatibilní s TAA. Protože se jedná o šifrované úložiště pod fyzickou kontrolou uživatele, je řada VP50 lepší než využívání internetu a cloudových služeb k ochraně dat.&lt;/p&gt;  &lt;p&gt;Řada Vault Privacy 50 podporuje možnost více hesel (admin, uživatel a jednorázové obnovení) s režimy fráze nebo komplexního přístupového hesla. To zlepšuje možnosti obnovení přístupu k datům, pokud je zapomenuto jedno z hesel. Tradiční režim komplexního hesla umožňuje tvorbu hesel v délce 6–16 znaků s využitím 3 ze 4 znakových sad. Nový režim přístupového hesla umožňuje využití číselného kódu PIN, věty, seznamu slov nebo zapamatovatelného citátu v délce 10 až 64 znaků. Správce může povolit uživatele a heslo pro jednorázové obnovení nebo resetovat heslo uživatele pro obnovení přístupu k datům. Pro usnadnění zadávání hesla lze aktivovat symbol „oka“, který odkryje zadávané heslo, čímž se omezí překlepy vedoucí k neúspěšným pokusům o přihlášení. Ochrana proti útokům hrubou silou zablokuje uživatelská hesla nebo hesla pro jednorázovou obnovu po 10 neplatných heslech zadaných v řadě a šifrovaně vymaže disk, pokud je heslo správce 10× za sebou zadáno nesprávně.'       &lt;/p&gt;  &lt;p&gt;Pro ochranu před potenciálním malwarem na nedůvěryhodných systémech může správce i uživatel nastavit režim pouze pro čtení, aby byl disk chráněn proti zápisu; vestavěná virtuální klávesnice navíc chrání hesla před keyloggery nebo screenloggery.&lt;/p&gt;  &lt;p&gt;Díky certifikaci FIPS 197 a podpoře TAA mohou organizace přizpůsobovat a konfigurovat disky řady VP50 pomocí ID produktu (PID) pro integraci se standardním softwarem pro správu koncových bodů, aby splnily požadavky podnikového IT a požadavky na kybernetickou bezpečnost prostřednictvím programu Kingston Customization Program.&lt;/p&gt;  &lt;p&gt;Malé a střední podniky mohou používat roli správce pro místní správu svých disků, např. používat správce pro konfiguraci nebo resetování uživatelských hesel zaměstnanců nebo hesel pro jednorázové obnovení, obnovení přístupu k datům na uzamčených discích a splnění zákonů a předpisů pro případy forenzní analýzy.'       &lt;/p&gt;  &lt;p&gt;• Certifikace FIPS 197 s 256bitovým šifrováním XTS-AES&lt;br /&gt;• Ochrana proti útokům hrubou silou a útokům BadUSB&lt;br /&gt;• Možnost použití více hesel s režimy fráze a komplexního přístupového hesla&lt;br /&gt;• Nový režim přístupového hesla&lt;br /&gt;• Nastavení duálního režimu pouze pro čtení (ochrana proti zápisu)&lt;br /&gt;• Místní správa disků pro malé a střední podniky'       &lt;/p&gt;  &lt;h2&gt;Technické parametry&lt;/h2&gt;  &lt;p&gt;&lt;strong&gt;Rozhraní&lt;/strong&gt;: USB 3.2 Gen 1       &lt;br /&gt;&lt;strong&gt;Konektor&lt;/strong&gt;: Typ A       &lt;br /&gt;&lt;strong&gt;Kapacity&lt;/strong&gt;*: 8 GB, 16 GB, 32 GB, 64 GB, 128 GB, 256 GB       &lt;br /&gt;&lt;strong&gt;Rychlost&lt;/strong&gt;**: &lt;br /&gt;&lt;span style='text-decoration: underline;'&gt;USB 3.2 Gen 1&lt;/span&gt;&lt;br /&gt;• 8 GB – 128 GB: 250 MB/s při čtení a 180 MB/s při zápisu&lt;br /&gt;• 256 GB: 230 MB/s při čtení a 150 MB/s při zápisu&lt;br /&gt;&lt;span style='text-decoration: underline;'&gt;USB 2.0&lt;/span&gt;&lt;br /&gt;• 8 GB – 256 GB: 30 MB/s při čtení a 20 MB/s při zápisu'       &lt;br /&gt;&lt;strong&gt;Vodotěsné provedení&lt;/strong&gt;***: Max. 122 cm; IEC 60529 IPX8       &lt;br /&gt;&lt;strong&gt;Provozní teplota&lt;/strong&gt;: 0 až 60 °C       &lt;br /&gt;&lt;strong&gt;Skladovací teplota&lt;/strong&gt;: -20 až 85 °C       &lt;br /&gt;&lt;strong&gt;Kompatibilita&lt;/strong&gt;: USB 3.0/USB 3.1/USB 3.2 Gen 1       &lt;br /&gt;&lt;strong&gt;Kompatibilita s operačními systémy&lt;/strong&gt;: Windows 11, 10, 8.1, macOS (v. 10.14.x – 12.xx)       &lt;/p&gt;  &lt;hr /&gt;  &lt;p&gt;&lt;span style='color: #999999;'&gt;* Část z uvedené kapacity paměťového zařízení flash je využita pro formátování a další funkce a proto není k dispozici pro úložný prostor. Z tohoto důvodu je vlastní kapacita dostupná pro ukládání dat nižší, než je kapacita uvedená na výrobcích. Další informace naleznete v Průvodci paměťovými zařízeními flash od společnosti Kingston.           &lt;/span&gt;&lt;br /&gt;&lt;span style='color: #999999;'&gt;** Rychlost se může lišit v závislosti na hardwaru, softwaru i způsobu použití.           &lt;/span&gt;&lt;br /&gt;&lt;span style='color: #999999;'&gt;*** Výrobek musí být před použitím čistý a suchý a musí mít nasazený kryt.           &lt;/span&gt;&lt;/p&gt;","false","0","000101810009","7068","-1","true","","-1","-1","t