n 1       &lt;br /&gt;&lt;strong&gt;Konektor&lt;/strong&gt;: Typ A       &lt;br /&gt;&lt;strong&gt;Kapacity&lt;/strong&gt;*: 8 GB, 16 GB, 32 GB, 64 GB, 128 GB, 256 GB       &lt;br /&gt;&lt;strong&gt;Rychlost&lt;/strong&gt;**: &lt;br /&gt;&lt;span style='text-decoration: underline;'&gt;USB 3.2 Gen 1&lt;/span&gt;&lt;br /&gt;• 8 GB – 128 GB: 250 MB/s při čtení a 180 MB/s při zápisu&lt;br /&gt;• 256 GB: 230 MB/s při čtení a 150 MB/s při zápisu&lt;br /&gt;&lt;span style='text-decoration: underline;'&gt;USB 2.0&lt;/span&gt;&lt;br /&gt;• 8 GB – 256 GB: 30 MB/s při čtení a 20 MB/s při zápisu'       &lt;br /&gt;&lt;strong&gt;Vodotěsné provedení&lt;/strong&gt;***: Max. 122 cm; IEC 60529 IPX8       &lt;br /&gt;&lt;strong&gt;Provozní teplota&lt;/strong&gt;: 0 až 60 °C       &lt;br /&gt;&lt;strong&gt;Skladovací teplota&lt;/strong&gt;: -20 až 85 °C       &lt;br /&gt;&lt;strong&gt;Kompatibilita&lt;/strong&gt;: USB 3.0/USB 3.1/USB 3.2 Gen 1       &lt;br /&gt;&lt;strong&gt;Kompatibilita s operačními systémy&lt;/strong&gt;: Windows 11, 10, 8.1, macOS (v. 10.14.x – 12.xx)       &lt;/p&gt;  &lt;hr /&gt;  &lt;p&gt;&lt;span style='color: #999999;'&gt;* Část z uvedené kapacity paměťového zařízení flash je využita pro formátování a další funkce a proto není k dispozici pro úložný prostor. Z tohoto důvodu je vlastní kapacita dostupná pro ukládání dat nižší, než je kapacita uvedená na výrobcích. Další informace naleznete v Průvodci paměťovými zařízeními flash od společnosti Kingston.           &lt;/span&gt;&lt;br /&gt;&lt;span style='color: #999999;'&gt;** Rychlost se může lišit v závislosti na hardwaru, softwaru i způsobu použití.           &lt;/span&gt;&lt;br /&gt;&lt;span style='color: #999999;'&gt;*** Výrobek musí být před použitím čistý a suchý a musí mít nasazený kryt.           &lt;/span&gt;&lt;/p&gt;","false","0","000101810009","7068","-1","true","","-1","-1","true","60","Měsíc(ů)","","0001-01-01T00:00:00","1253.00","KS","1.00","3","2022-06-13T13:54:28.53","KIN","179","true","0","{'0