roti útokům hrubou silou. Řada LP50 je také kompatibilní s TAA.&lt;/p&gt;  &lt;p&gt;Řada LP50 nyní podporuje volbu více hesel (správce a uživatele) s režimy složitého přístupového hesla nebo fráze. Režim složitého hesla umožňuje tvorbu hesel v délce 6–16 znaků s využitím 3 ze 4 znakových sad. Režim přístupového hesla fráze umožňuje využití číselného kódu PIN, věty, seznamu slov nebo zapamatovatelného citátu v délce 10 až 64 znaků. Správce může povolit heslo uživatele nebo resetovat heslo uživatele pro obnovení přístupu k datům. Pro usnadnění zadávání hesla lze aktivovat symbol „oka“, který odkryje zadávané heslo, čímž se omezí překlepy vedoucí k neúspěšným pokusům o přihlášení. Ochrana proti útokům hrubou silou zablokuje uživatele po 10 neplatných heslech zadaných v řadě a šifrovaně vymaže disk, pokud je heslo správce zadáno nesprávně 10× za sebou. Vestavěná virtuální klávesnice navíc chrání hesla před keyloggery nebo screenloggery.&lt;/p&gt;  &lt;p&gt;USB flash disk Locker+ 50 je navržen pro maximální komfort s malým kovovým pouzdrem a vestavěným očkem pro kroužek na klíče, abyste si mohli vzít data kamkoli. Řada LP50 nabízí rovněž volitelné zálohování USBtoCloud (poskytované ClevX) pro přístup k datům na disku z vašeho osobního cloudového úložiště prostřednictvím služeb Google Drive™, OneDrive (Microsoft), Amazon Cloud Drive, Dropbox™ a Box. USB flash disky LP50 je schopen každý snadno nastavit a používat – není nutné instalovat žádnou aplikaci, veškerý potřebný software a zabezpečení jsou již přítomny na disku. Disky pracují v operačních systémech Windows i macOS, takže mohou uživatelé přistupovat k datům z více systémů.&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Šifrování XTS-AES s ochranou proti útokům na přístupové heslo hrubou silouBadUSB&lt;/li&gt;  &lt;li&gt;Možnost použití více hesel (správce a uživatel) a režimů složitého přístupového hesla nebo fráze&lt;/li&gt;  &lt;li&gt;Nový režim přístupového hesla&lt;/li&gt;  &lt;li&gt;Automatické zálohování do osobního cloudu&lt;/li&gt;  &lt;li&gt;Další funkce zabezpečení&lt;/li&gt;  &lt;/ul&gt;  &lt;h2&gt;Hardwarově šifrovaný disk USB 3.1 s šifrováním XTS-AES&lt;/h2&gt;  &lt;p&gt;Ochrana důležitých dat pomocí vestavěné ochrany proti útokům BadUSB a útokům hrubou silou.&lt;/p&gt;  &lt;h2&gt;Možnost použití více hesel (správce a uživatel) a režimů složitého/standardního přístupového hesla&lt;/h2&gt;  &lt;p&gt;Správce může resetovat heslo uživatele pro obnovení přístupu uživatele k datům.&lt;/p&gt;  &lt;h2&gt;Možnost volby fráze jako přístupového hesla&lt;/h2&gt;  &lt;p&gt;Umožňuje volbu složitého nebo standardního přístupového hesla. Přístupové heslo může být tvořeno číselným kódem PIN, větou včetně znaků pro mezery, seznamem slov nebo i snadno zapamatovatelným citátem – v délce 10 až 64 znaků.&lt;/p&gt;  &lt;h2&gt;Automatické zálohování do osobního cloudu&lt;/h2&gt;  &lt;p&gt;Přístup k datům uloženým na disku IronKey Locker+ 50 z vašeho osobního cloudového úložiště.&lt;/p&gt;  &lt;h2&gt;Další funkce zabezpečení&lt;/h2&gt;  &lt;p&gt;Omezení neúspěšných pokusů o přihlášení a frustrace povolením tlačítka „oko“ pro zobrazení zadávaného hesla. Použití virtuální klávesnice k ochraně zadávaného hesla před keyloggery a screenloggery.&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;","false","0","000101810009","7068","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","640.00","KS","0.00","3","2022-07-04T10:00:15.647","KIN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1624\/1624697_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1624\/1624697_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1624\/1624697_0c_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'66'},'1':{'AttributeCode':'896','ValueCode':'18978'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.047','length':'18.5','width':'13','height':'1'}}","N","","false",""),("1624700","443685","Kingston Flash Disk IronKey 32GB IKLP50 Locker+ 50 AES USB, w/256bit Encryption","639.50","689.00","KIF","1.50","48.00","0.000000","0