em PIN, větou včetně znaků pro mezery, seznamem slov nebo i snadno zapamatovatelným citátem – v délce 10 až 64 znaků.&lt;/p&gt;  &lt;h2&gt;Automatické zálohování do osobního cloudu&lt;/h2&gt;  &lt;p&gt;Přístup k datům uloženým na disku IronKey Locker+ 50 z vašeho osobního cloudového úložiště.&lt;/p&gt;  &lt;h2&gt;Další funkce zabezpečení&lt;/h2&gt;  &lt;p&gt;Omezení neúspěšných pokusů o přihlášení a frustrace povolením tlačítka „oko“ pro zobrazení zadávaného hesla. Použití virtuální klávesnice k ochraně zadávaného hesla před keyloggery a screenloggery.&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;","false","1","000101810009","7068","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","1569.00","KS","2.00","3","2022-07-04T10:00:48.337","KIN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1624\/1624701_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1624\/1624701_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1624\/1624701_0c_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8767'},'1':{'AttributeCode':'896','ValueCode':'18978'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.047','length':'19','width':'13','height':'1.5'}}","N","","false",""),("1624702","443687","Kingston Flash Disk IronKey 128GB IKLP50 IronKey Locker+ 50 AES USB, w/256bit Encryption","1943.50","2035.00","KIF","1.50","90.00","0.000000","0.000","24 Měsíc(ů)","KINGSTON FLASH","1953.00","2427.00","21.00","IKLP50/128GB","false","0,00","","Kingston","85235110","740617329391","Kingston Flash Disk IronKey 128GB IKLP50 IronKey Locker+ 50 AES USB, w/256bit Encryption","Kapacita uložiště:128 GB; Verze USB:3.2","1","&lt;h1&gt;USB flash disky Kingston IronKey Locker+ 50&lt;/h1&gt;  &lt;p&gt;&lt;em&gt;Šifrování XTS-AES pro ochranu dat s automatickým USBtoCloud zálohováním&lt;/em&gt;&lt;/p&gt;  &lt;p&gt;USB flash disky Kingston IronKey Locker+ 50 poskytují zabezpečení na spotřebitelské úrovni s hardwarovým šifrováním AES v režimu XTS včetně zabezpečení proti BadUSB s digitálně podepsaným fir