.00","0.000000","0.000","5 Rok(ů)","KINGSTON FLASH","666.00","817.00","21.00","DTMAXA/256GB","true","10-49","","Kingston","85235110","740617328370","Kingston Flash Disk 256GB DataTraveler Max Type-A 1000R/900W USB 3.2 Gen 2","Kapacita uložiště:256 GB; Verze USB:3.2","1","&lt;h1&gt;DataTraveler Max USB flash disk s rozhraním USB 3.2 Gen 2&lt;/h1&gt;  &lt;p&gt;&lt;em&gt;&lt;strong&gt;K dispozici s konektorem USB-C nebo USB-A&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;  &lt;p&gt;USB flash disky řady Kingston’s DataTraveler Max využívají nejnovější standard USB 3.2 Gen 2 pro zajištění rekordních rychlostí čtení/zápisu 1 000/900 MB/s&lt;span style='color: #999999;'&gt;1&lt;/span&gt;. Jedinečné pouzdro s prolisem, navržené s ohledem na přenosnost a pohodlí, chrání konektor, když ho nepoužíváte, a lze ho snadno přesunout jediným pohybem. K dispozici jsou verze s konektory USB Type-C&lt;span style='color: #999999;'&gt;2&lt;/span&gt; a Type-A pro podporu moderních i tradičních notebooků a stolních počítačů. Řada DT Max nabízí špičkový výkon a rozšířené kapacity až 1 TB&lt;span style='color: #999999;'&gt;3&lt;/span&gt;, což z těchto disků činí ideální řešení pro přenos a ukládání velkých digitálních souborů, jako jsou snímky v rozlišení HD, videa v rozlišení 4K/8K, hudba a další.&lt;/p&gt;  &lt;p&gt;Disky s oběma typy konektorů Type-C a Type-A řady DT Max jsou kryty omezenou pětiletou zárukou, zdarma dostupnou technickou podporu a legendární spolehlivostí výrobků firmy Kingston.&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Pokročilé flash disky s rozhraním USB 3.2 Gen 2&lt;/li&gt;  &lt;li&gt;Jedinečné pouzdro s prolisem a očkem na klíčenku&lt;/li&gt;  &lt;li&gt;Rychlost čtení až 1 000 MB/s&lt;span style='color: #999999;'&gt;1&lt;/span&gt;&lt;/li&gt;  &lt;li&gt;Kapacita až 1 TB&lt;span style='color: #999999;'&gt;3&lt;/span&gt;&lt;/li&gt;  &lt;/ul&gt;  &lt;h2&gt;Nejnovější standard rozhraní USB 3.2 Gen 2&lt;/h2&gt;  &lt;p&gt;Přesuňte bleskově vaše soubory neuvěřitelnou rychlostí až 1 000 MB/s při 