rmádní úrovni s vylepšeními, která dále zvyšují laťku ochrany dat. Jeho obvody jsou pokryty vrstvou speciálního epoxidu, která prakticky znemožňuje odstranění součástek bez jejich poškození. Tento houževnatý epoxid chrání polovodičové součástky před fzyickým útokem. Disk je navržen tak, aby neoprávněná manipulace byla ihned zřejmá a vlastníci tak byli upozorněni. Zahrnuje také ochranu proti útoku na heslo hrubou silou a ochranu BadUSB s digitálně podepsaným firmwarem. Alfanumerická klávesnice je potažena vrstvou polymeru, která klávesy chrání a zároveň neumožňuje analýzu otisků prstů na tlačítkách, čímž skrývá jejich použití.&lt;/p&gt;  &lt;p&gt;KP200 využívá vestavěnou dobíjecí baterii, kterou lze použít k odemknutí disku bez použití jakéhokoli softwaru a poté k jeho připojení k libovolnému zařízení, které podporuje velkokapacitní paměťové zařízení USB typu A. To uživatelům poskytuje největší přizpůsobivost na různých typech platforem a operačních systémů.&lt;/p&gt;  &lt;p&gt;Pomocí možností několika PIN kódů (správce/uživatel) lze klávesnici použít k nastavení snadno zapamatovatelného, ale těžko uhodnutelného alfanumerického PIN kódu pro správce a uživatele. Správce může obnovit PIN kód uživatele a poskytnout přístup k disku v případě, kdy dojde ke ztrátě PIN kódu uživatele nebo pokud se disk po dosažení maximálního počtu 10 pokusů o přihlášení uživatele uzamkne. Když jsou povolené PIN kódy správce i uživatele vyčerpány, disk KP200 uzamkne PIN kód uživatele po 10 neúspěšných pokusech o přihlášení. Pokud je PIN kód správce také zadán nesprávně 10krát za sebou, ochrana proti útoku hrubou silou vymaže disk, navždy zničí data a zresetuje disk.&lt;/p&gt;  &lt;p&gt;Disk také poskytuje dvě úrovně režimů jen pro čtení (nebo ochrany proti zápisu) – jedná se o globální režim, který může nastavit správce, a režim pro jednu relaci, který může nastavit uživatel. Režimy jen pro čtení mohou chránit disk před malwarem v nedůvěryhodných systémech. Kromě toho může správce načíst obsah a nastavit globální režim jen pro čtení, aby měl uživatel přístup k datům, ale nemohl provádět žádné změny.&lt;/p&gt;  &lt;ul&gt;  &lt;li&gt;Certifikace FIPS 140-3 Level 3 (čeká na schválení)&lt;/li&gt;  &lt;li&gt;Nezávislý na operačním systému/zařízení&lt;/li&gt;  &lt;li&gt;Možnost několika PIN kódů (správce a uživatel)&lt;/li&gt;  &lt;li&gt;Možnost globálního režimu jen pro čtení nebo režimu relace jen pro čtení&lt;/li&gt;  &lt;/ul&gt;  &lt;h2&gt;Certifikace FIPS 140-3 Level 3 (čeká na schválení)&lt;/h2&gt;  &lt;p&gt;Disk KP200 nyní vyhovuje požadavkům nové bezpečnostní specifikace armádní úrovně FIPS 140-3 Level 3 zveřejněné institutem NIST. Jedná se o vylepšenou verzi specifikací FIPS 140-2, která dále zvyšuje možnosti zabezpečení disku a odolnost proti neoprávněné manipulaci. Zahrnuje 256bitové šifrování XTS-AES spolu s ochranou proti útokům hrubou silou a BadUSB s digitálně podepsaným firmwarem. Jeho obvody jsou pokryty vrstvou speciálního epoxidu, která prakticky znemožňuje odstranění součástek bez jejich poškození. Tento houževnatý epoxid chrání polovodičové součástky před útokem.&lt;/p&gt;  &lt;h2&gt;Nezávislý na operačním systému a zařízení&lt;/h2&gt;  &lt;p&gt;Disk KP200 využívá vestavěnou dobíjecí baterii a proto lze klávesnici použít k odemknutí disku bez použití jakéhokoli softwaru a poté lze disk připojit k libovolnému systému, který podporuje velkokapacitní paměťové zařízení USB typu A. To uživatelům poskytuje největší přizpůsobivost na různých typech platforem a operačních systémů.&lt;/p&gt;  &lt;h2&gt;Možnost několika PIN kódů&lt;/h2&gt;  &lt;p&gt;Uživatelé mají možnost nastavit režim Uživatel nebo Správce/uživatel. Správce lze použít k obnovení PIN kódu uživatele a poskytnutí přístupu k disku v případě kdy dojde ke ztrátě PIN kódu uživatele nebo pokud se disk po dosažení maximálního počtu 10 pokusů o přihlášení uživatele uzamkne.&lt;/p&gt;  &lt;h2&gt;Globální režim jen pro čtení a režim relace jen pro čtení (ochrana proti zápisu)&lt;/h2&gt;  &lt;p&gt;Správce i uživatel mohou nastavit režim jen pro čtení pro určitou relaci, který chrání disk před malwarem v nedůvěryhodných systémech. Správce může také nastavit globální režim jen pro čtení, který nastaví disk do režimu jen pro čtení až do resetování.&lt;/p&gt;  &lt;h2&gt;Rychlost:&lt;/h2&gt;  &lt;p&gt;&lt;strong&gt;USB 3.2 Gen 1&lt;/strong&gt;&lt;br /&gt;8GB – 128GB: 145MB/s čtení, 115MB/s zápis&lt;br /&gt;&lt;strong&gt;USB 2.0&lt;/strong&gt;&lt;br /&gt;8GB: 30MB/s read, 12MB/s write&lt;br /&gt;16GB – 128GB: 30MB/s čtení, 20MB/s zápis&lt;/p&gt;","false","1","000101810009","7068","-1","true","","-1","-1","true","60","Měsíc(ů)","","2023-01-20T00:00:00","2830.00","KS","0.00","6","2022-09-01T10:22:19.7","KIN","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1632\/1632713_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1632\/1632713_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1632\/1632713_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1632\/1632713_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1632\/1632713_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1632\/1632713_0f_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8692'},'1':{'AttributeCode':'896','ValueCode':'18978'}}","{'0':{'typ':'JEDN','count':'1','weight':'0','length':'0','width':'0','height':'0'}}","N","","false",""),("1632714","443700","Kingston Flash Disk IronKey 64GB Keypad 200 encrypted USB flash drive","3628.50","3720.00","KIF","1.50","90.00","0.000000","0.000","60 Měsíc(ů)","KINGSTON FLASH","3674.00","4564.00","21.00","IKKP200/64GB","false","0,00","Novinka","Kingston","85235110","","Kingston Flash Disk IronKey 64GB Keypad 200 encrypted USB flash drive","Kapacita uložiště:64 GB; Verze USB:3.2","1","&lt;h1&gt;Kingston IronKey Keypad 200 hardwarově šifrovaný USB flash disk&lt;/h1&gt;  &lt;p&gt;&lt;em&gt;&lt;strong&gt;FIPS 140-3 Level 3 (čeká na schválení) s 256bitovým hardwarovým šifrováním XTS-AES&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;  &lt;p&gt;Kingston IronKey™ Ke