i komponenty a procházejí vícestupňovými testy kvality, než se vydají na cestu do maloobchodních prodejen. Oddělení kontroly kvality zajišťuje, že každé USB je dokonale připraveno na mnoho let používání, a proto našim uživatelům garantujeme doživotní záruku.&lt;/li&gt;  &lt;/ul&gt;","false","0","","-1","-1","true","","-1","-1","true","99","Doživotní","","0001-01-01T00:00:00","73.00","KS","10.00","6","2022-09-07T09:53:26.987","GRM","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1636\/1636541_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1636\/1636541_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1636\/1636541_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1636\/1636541_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1636\/1636541_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1636\/1636541_0f_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'66'},'1':{'AttributeCode':'896','ValueCode':'11009'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.02','length':'13','width':'10','height':'2'},'1':{'typ':'PACK','count':'20','weight':'0.442','length':'11','width':'13','height':'14'}}","N","","false",""),("1636544","490269","GOODRAM Flash Disk 32GB UME3 CARE, USB 3.0","75.50","125.00","GDR","1.50","48.00","0.000000","0.000","99 Doživotní","GOODRAM","75.00","183.00","21.00","UME3-0320CRR11","true","10-49","","GoodRAM","85235110","5908267961445","GOODRAM Flash Disk 32GB UME3 CARE, USB 3.0","Kapacita uložiště:32 GB; Verze USB:3.0","1","&lt;h2&gt;USB 3.0 UME3 CARE&lt;/h2&gt;  &lt;p style='text-align: justify;'&gt;UME CARE was created for those for whom safety and hygiene are important, especially in the office space. Thanks to the Biomaster technology, the product housing contains silver ions with bactericidal properties. Consequently, the product is completely protected from bacteria throughout the entire period of use. Antibacterial properties of the UME CARE have been guaranteed by laboratory tests. After 24 hours, the reduction of microorganisms o