ny laboratorními testy. Po 24 hodinách je redukce mikroorganismů na povrchu UME CARE až 99 %.&lt;br /&gt;Technologie BIOMASTER&lt;br /&gt;Prokazatelně inhibuje růst mikrobů až o 99,99 %.&lt;br /&gt;Je založeno na technologii iontů stříbra, uznávané po staletí bez škodlivých účinků.&lt;br /&gt;Technologie mnohokrát testována také podle norem ISO.&lt;br /&gt;Je vestavěná. neopotřebovává se ani nevyluhuje.&lt;br /&gt;Germicid je bez zápachu a není vidět. Neovlivňuje produkt žádným viditelným způsobem, kromě toho, že je antibakteriální.&lt;br /&gt;Polymer ošetřený Biomasterem lze efektivně recyklovat bez jakýchkoliv komplikací.&lt;br /&gt;USB flash disk UME3 CARE je k dispozici v kapacitě 64 GB. Použité komponenty umožňují čtení rychlostí až 60 MB/s a zápis až 20 MB/s. Stejně jako na všechny ostatní USB flash disky GOODRAM se i na UME3 CARE vztahuje doživotní záruka výrobce.&lt;br /&gt;Všechny USB Flash disky GOODRAM jsou vyráběny v Polsku  s vysoce vybranými komponenty a procházejí vícestupňovými testy kvality, než se vydají na cestu do maloobchodních prodejen. Oddělení kontroly kvality zajišťuje, že každé USB je dokonale připraveno na mnoho let používání, a proto našim uživatelům garantujeme doživotní záruku.&lt;/p&gt;","false","0","","-1","-1","true","","-1","-1","true","99","Doživotní","","0001-01-01T00:00:00","107.00","KS","3.00","6","2022-09-07T10:02:58.013","GRM","179","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1636\/1636545_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1636\/1636545_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1636\/1636545_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1636\/1636545_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1636\/1636545_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1636\/1636545_0f_3.jpg'}","{'0':{'AttributeCode':'8','ValueCode':'8767'},'1':{'AttributeCode':'896','ValueCode':'11009'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.02','length':'12','width':'10','height':'1'},'1':{'typ':'PA